(35, 'categories_31', '31', 'categories', '{\"id\":\"31\",\"name\":\"Diagnostic ENT\",\"section\":\"Medical Devices\",\"description\":\"Domain_Name  Equipment ENT diagnostic Kit includes ophthalmoscope, otoscope, laryngoscope, tongue depressors and other minor interventional instruments specially designed for easy grip and robust use. Used to visually examine eyes, ears, nose and throat for prognosis.\",\"parent_id\":\"1\"}', '2021-04-23 13:48:47', 31, 2, 1, 0, '0000-00-00 00:00:00', 0, '2021-04-23 11:48:47'),
(36, 'categories_32', '32', 'categories', '{\"id\":\"32\",\"name\":\"Ultrasonic Doppler\",\"section\":\"Medical Devices\",\"description\":\"Domain_Name  Equipment offers Ultrasonic Doppler range featuring 4, 5, 8 MHz probes for flow monitor whereas 2 or 3 MHz doppler probe for doppler ausculation. We offer a broad range of  vascular, feotal as well as transcranial dopplers.\",\"parent_id\":\"1\"}', '2021-04-23 13:48:47', 32, 2, 1, 0, '0000-00-00 00:00:00', 0, '2021-04-23 11:48:47'),
(37, 'categories_33', '33', 'categories', '{\"id\":\"33\",\"name\":\"Infant Incubator\",\"section\":\"Medical Devices\",\"description\":\"Infant Incubator is used in neonatal care to regulate temperature and humidity conditions inorder to maintain a controlled environment for neonates.  Domain_Name  Equipment Infant Incubator range features accurate temperature and humidity monitoring and regulation, accessible outer shell with easy-to-clean surfaces, spacious adjustable  baby bed.\",\"parent_id\":\"3\"}', '2021-04-23 13:48:47', 33, 2, 1, 0, '0000-00-00 00:00:00', 0, '2021-04-23 11:48:47'),
