(22, 'Medical X-ray Imaging', 1, 'Medical Equipment', 'Domain_Name  Equipment offers advanced solutions for digital radiography and conventional X-ray screening. X-ray equipment range includes normal frequency mobile, stationary units, high frequency mobile units and digital X-ray machines to give you a broad range of equipments. Our range ensures sharp image clarity, dynamic user-oriented features, advanced image acquisition.', 1, 1, 'Medical X-ray Imaging', 'medical-diagnostic/medical-x-ray-imaging', 'Medical X-ray Imaging', 'Medical X-ray Imaging', '', 'Medical Diagnostic | Medical X-ray Imaging | Domain_Name', 'Medical Diagnostic , Medical X-ray Imaging, Domain_Name', 'Domain_Name  Equipment offers advanced solutions for digital radiography and conventional X-ray screening. X-ray equipment range includes normal frequency mobile, stationary units, high frequency mobile units and digital X-ray machines to give you a broad range of equipments. Our range ensures sharp image clarity, dynamic user-oriented features, advanced image acquisition.', 'Medical-X-ray-Imaging', 1, '2021-04-23 13:48:47', 1, '2021-04-23 08:18:47'),
