(24, 'Medical Ultrasound', 1, 'Medical Equipment', 'Medical Ultrasound uses ultrasonic imaging modes for body-tissue imaging.  Domain_Name  Equipment offers a wide variety of consoles as per specialised applications, general imaging, 3D/4D imaging, 2D & Color Doppler to deliver excellent image quality, advanced quantification and processing features.', 1, 1, 'Medical Ultrasound', 'medical-diagnostic/medical-ultrasound', 'Medical Ultrasound', 'Medical Ultrasound', '', 'Medical Diagnostic | Medical Ultrasound | Domain_Name', 'Medical Diagnostic , Medical Ultrasound, Domain_Name', 'Medical Ultrasound uses ultrasonic imaging modes for body-tissue imaging.  Domain_Name  Equipment offers a wide variety of consoles as per specialised applications, general imaging, 3D/4D imaging, 2D & Color Doppler to deliver excellent image quality, advanced quantification and processing features.', 'Medical-Ultrasound', 1, '2021-04-23 13:48:47', 1, '2021-04-23 08:18:47'),
