(37, 'Infusion Pump', 1, 'Medical Equipment', 'Domain_Name  Equipment offers a wide range of superior quality portable and mini-sized Infusion pumps, suited for a wide range of applications in hospitals wards and clinics. Infusion pumps are medical devices capable of delivering a controlled dosage of fluidized drugs, enteral nutrition into a patient\'s circulatory system.', 3, 1, 'Infusion Pump', 'critical-care/infusion-pump', 'Infusion Pump', 'Infusion Pump', '', 'Critical Care | Infusion Pump | Domain_Name', 'Critical Care , Infusion Pump, Domain_Name', 'Domain_Name  Equipment offers a wide range of superior quality portable and mini-sized Infusion pumps, suited for a wide range of applications in hospitals wards and clinics. Infusion pumps are medical devices capable of delivering a controlled dosage of fluidized drugs, enteral nutrition into a patient\'s circulatory system.', 'Infusion-Pump', 1, '2021-04-23 13:48:47', 1, '2021-04-23 08:18:47'),
