(1, 'KVX-A100', 'Veterinary X-ray Machine KVX-A100', 1, 'A1', 0, 22, 'Veterinary X-ray Machine KVX-A100 is a portable, ultra-compact high frequency digital radiography system specifically designed for equine, bovine, exotic and multi-species x-ray imaging practices. X-ray assembly features accurate simulation-control, precise tube-voltage and tube-current with various pre-defined anatomical x-ray positioning con suitable for easy orientation and imaging.', '', '', 'Digital double loop technology </br>\nAuto-test and failure self-protection facility </br>\nDigital LED display for tube-voltage and tube-current settings </br>\nConcise X-ray focusing </br>  \nConsistent Image quality', '', '', '', '{\"Max Output Power\":\"4 kW\",\"Nominal Power\":\"100 kV, 40mA, 0.1 s, 4 kW\",\"Input Power\":\"220 V \\u00b1 2 V (AC); 50\\/60 Hz\",\"Tube Focus-spot\":\"0.6 \\/ 1.5 mm\",\"Digital Detectors\":\"Limit Resolution : 3.6 LP\\/mm <\\/br> Pixel Area : 427 \\u00d7 356 mm <\\/br> A\\/D conversion : 14 bit\",\"Power Capacity\":\"\\u2265 5 kVA\",\"Frequency\":\"\\u2265 40 kHz\",\"Tube voltage (kV Range)\":\"40 kV \\u2500 110 kV\",\"Tube current (mA Range)\":\"36 mA \\u2500 70 mA\",\"Radiographic density (mAs Range)\":\"1 mAs \\u2500 200 mAs\",\"Time Range\":\"0.04 s \\u2500 3.2 s\",\"Inner Resistance\":\"\\u2264 0.50\",\"Anode Heat Capacity\":\"76 kHU\",\"X-Ray Pre-set Positioning\":\"48 anatomical positions\",\"Dimensions\":\"290 \\u00d7 260 \\u00d7 230  mm\",\"Weight\":\"18.8 Kgs\"}', 'Used in outdoor or indoor radiography practices for diagnostic X-ray imaging in the pet clinic, rescue diagnosis, horse-stable or barn or cattle-shed for on-the-go X-ray imaging practices.', '', '', '', 'Veterinary X-ray Machine KVX-A100', 'Medical Diagnostic | Veterinary X-ray Machine KVX-A100', 'KVX-A100', 'Veterinary X-ray Machine KVX-A100 is a portable, ultra-compact high frequency digital radiography system specifically designed for equine, bovine, exotic and multi-species x-ray imaging practices. X-ray assembly features accurate simulation-control, precise tube-voltage and tube-current with various pre-defined anatomical x-ray positioning con suitable for easy orientation and imaging.', '', '', 'Veterinary X-ray Machine KVX-A100', 'Veterinary X-ray Machine KVX-A100', '', '{\"small\":\"assets\\/images\\/products\\/Veterinary-X-ray-Machine-KVX-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Veterinary-X-ray-Machine-KVX-A100-250x250.jpg\"}', '', 'Medical-Diagnostic/Medical-X-ray-Imaging/KVX-A100', 1, '2019-07-24 12:43:34', 1, '2019-07-24 07:13:34'),
(2, 'KABM-A100', 'Ambulatory NIBP Monitor KABM-A100', 1, 'A1', 0, 108, 'Ambulatory NIBP Monitor KABM-A100 is a handheld 24-hour continuous ambulatory blood pressure recorder. Incorporated data review system aids in results analysis, graphic trend to determine efficacy of drugs prescribed. Alarms for critical events, error message and time assures patient safe. Dual methods of operation allows flexible use.', '', '', 'Softwares reporting </br>\nAutomatic analysis </br>\nColor TFT display </br>\nAuto and Manual mode </br>\nSuitable for Adult, Pediatric, Neonates </br>\nUSB connectivity', '', '', '', '{\"Patient range\":\"Adult, pediatric, neonate\",\"NIBP Measurement method\":\"Oscillometric\",\"NIBP Measurement range\":\"0 kPa \\u2013 38.67 kPa (0 mmHg \\u2013 290 mmHg)\",\"NIBP Measurement mode\":\"Arm Measurement\",\"NIBP Measurement interval\":\"15, 30, 60, 120, 240 min (Auto mode )\",\"NIBP - Resolution\":\"1 mmHg\",\"NIBP -  Accuracy\":\"\\u00b1 3 mmHg\",\"Pulse Rate Measurement range\":\"40 bpm \\u2013 240 bpm\",\"Pulse rate - Resolution\":\"1 bpm\",\"Pulse rate - Display\":\"2.4\\u201d color TFT \\u2013 LCD\",\"Power Supply\":\"DC : 3 V\",\"Alarm\":\"SYS, DIA  (User defined)\",\"Storage\":\"Auto mode : up to 350 results <\\/br> Manual mode : up to 300 results\",\"Dimension\":\"128 \\u00d7 69 \\u00d7 36 mm\",\"Weight\":\"< 300 g\"}', 'Used in small to medium clinics and medical institutions to monitor blood pressure up to 24 hours continuously and dynamically, providing accurate basis for the diagnosis for primary care, secondary care and in clinical research.', '', '', '', 'Ambulatory NIBP Monitor KABM-A100', 'Patient Monitoring System | Ambulatory NIBP Monitor KABM-A100', 'KABM-A100', 'Ambulatory NIBP Monitor KABM-A100 is a handheld 24-hour continuous ambulatory blood pressure recorder. Incorporated data review system aids in results analysis, graphic trend to determine efficacy of drugs prescribed. Alarms for critical events, error message and time assures patient safe. Dual methods of operation allows flexible use.', '', '', 'Ambulatory NIBP Monitor KABM-A100', 'Ambulatory NIBP Monitor KABM-A100', '', '{\"small\":\"assets\\/images\\/products\\/Holter-Monitor-KHM-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Holter-Monitor-KHM-A100-250x250.jpg\"}', '', 'Critical-Care/Patient-Monitoring-System/Holter-Monitor/KABM-A100', 1, '2019-07-24 12:44:55', 1, '2019-07-24 07:14:55'),
