-20 intensity levels, adjustable)\",\"Standards and Compliance\":\"EN 60601-1, level 1 class B <\\/br> EN 60601-1-2 <\\/br> EN 60601-1-4  <\\/br> EN60645-1 <\\/br> EN60645-2 <\\/br>  EN60645-4  <\\/br>  ANSI S3.6-1996\",\"Distortion\":\"Air conduction: < 2.5% ; Bone conduction: < 5%\",\"Warm-up Time\":\"Less than 10 minutes\",\"Connectivity\":\"USB 2.0 data interface\",\"Report format size\":\"A4 or B5 format report\",\"Calibration\":\"Calibrates multiple types of earphone at the same time\",\"Masking\":\"Pure tone masking ; Ipsilateral masking\",\"Power Supply\":\"100V \\/ 50 Hz  to 240V \\/ 60 Hz\",\"Power Consumption\":\"60 VA\",\"Dimensions\":\"450 x 300 x 110 mm\",\"Weight\":\"2.4 Kgs\"}', 'Used in ENT hospitals, research communities, rehabilitation centre and deaf training centres for clinical audiometry to test conductive hearing mechanisms.', '', '', '', 'Audiometer KAU-A100', 'Medical Diagnostic | Audiometer KAU-A100', 'KAU-A100', 'Audiometer KAU-A100 is a high-precision two channel diagnostic practical screening instrument to examine hearing acuity. Digital signal processing enables high quality masking and refractivity. Alphanumeric trans-reflective LCD screen displays sound output intensity, frequency and test information for visible results.', '', '', 'Audiometer KAU-A100', 'Audiometer KAU-A100', '', '{\"small\":\"assets\\/images\\/products\\/Audiometer-KAU-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Audiometer-KAU-A100-250x250.jpg\"}', '', 'Medical-Diagnostic/Diagnostic-ENT/KAU-A100', 1, '2019-07-24 12:53:02', 1, '2019-07-24 07:23:03'),
(9, 'KHT-A100', 'Haemocytometer KHT-A100', 1, 'A1', 0, 19, 'Abimed Haemocytometer KHT-A100 has an attractive appearance, shows clear and rational data construction and is convenient to use.', '', '', 'The Haemocytometer can be controlled through microcomputer<br/>\nDisplays 10 groups of numbers and can total accurately<br/>\nIt is easy and convenient to use<br/>', '', '', '', '{\"Maximum Count Category\":\"10 groups\",\"Count Capacity of every group\":\"0 - 99\",\"Voltage\":\"220 V \\u00b1 10 %(50 Hz)\",\"Power Rating\":\"5 W\",\"External Dimensions\":\"220 x 166 x 78 mm\"}', 'Used in medium and small sized laboratories for counting of blood cells.', '', '', '', 'Haemocytometer KHT-A100', 'In-Vitro Diagnostic | Haemocytometer KHT-A100', 'KHT-A100', 'Abimed Haemocytometer KHT-A100 has an attractive appearance, shows clear and rational data construction and is convenient to use.', '', '', 'Haemocytometer KHT-A100', 'Haemocytometer KHT-A100', '', '{\"small\":\"assets\\/images\\/products\\/Haemocytometer-KHT-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Haemocytometer-KHT-A100-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Haemocytometer/KHT-A100', 1, '2019-07-24 12:53:42', 1, '2019-07-24 07:23:42'),
(10, 'KBCM-A100', 'Auto Blood Culture Machine KBCM-A100', 1, 'A1', 0, 107, 'Auto blood culture Machine KBCM-A100 is a tabletop system with continuous swinging vibration culture mode to increase bacterial growth enhancing detection rate of micro-organisms. Provision for detection in every 10 minutes by each independent detector.', '', '', 'Test principles: Calorimetry and Carbonate<br/>\r\nContinuous swinging vibration culture mode<br/>\r\nDetection in every ten minutes by each independent detector<br/>\r\nSpecimen type: Blood and various sterile body fluid<br/>\r\nBarcode scanner for easy data input<br/>\r\nAudio visual alarm audio (door light flash and screen flash)<br/>\r\nPrinting function available<br/>\r\nMouse and keyboard ( optional )\r\nBlood culture bottle Features\r\nDetection of wide range of microbes (fungi and fastidious etc)<br/>\r\nMaterial – multi layer polymeric fiber<br/>\r\nDelayed vial entry capabilities upto 48 hrs. at RT<br/>\r\nVacuum blood sampling<br/>', '', '', '', '{\"Ambient temperature\":\"5 \\u00b0C to 35 \\u00b0C\",\"Handling\":\"50 to 55 bottles per day\",\"Touch screen\":\"External 17 inch\",\"Atmospheric pressure\":\"76 kPa ~ 106 kPa\",\"Power supply\":\"AC 220 V \\u00b1 20 V ; 50 \\/ 60 Hz \\u00b1 1 Hz\",\"Dimensions\":\"700 x 853 x 1060 mm\",\"Weight\":\"106 kgs\"}', 'Used in clinical laboratories to detect the micro-organisms like bacteria, yeast and fungi.', '', '', '', 'Auto Blood Culture Machine KBCM-A100', 'In-Vitro Diagnostic | Auto Blood Culture Machine KBCM-A100', 'KBCM-A100', 'Auto blood culture Machine KBCM-A100 is a tabletop system with continuous swinging vibration culture mode to increase bacterial growth enhancing detection rate of micro-organisms. Provision for detection in every 10 minutes by each independent detector.', '', '', 'Auto Blood Culture Machine KBCM-A100', 'Auto Blood Culture Machine KBCM-A100', '', '{\"small\":\"assets\\/images\\/products\\/Auto-Blood-Culture-Machine-KBCM-A100-150x150.jpg\",\"medium\":