(11, 'KED-A100', 'Automated External Defibrillator KED-A100', 1, 'A1', 0, 36, 'Automated External Defibrillator KED-A100 is a biphasic portable semi-automated public access defibrillation device. System incorporates advanced cardiac life-support features which include step-by-step voice instructions from pad placement to shock delivery with clear visual real-time guidance indicators as well as electrode position analysis for safe and quick treatment aid during cardiac emergency suitable to use for on-the-spot responders with or without training.', '', '', 'Simple 3-step defibrillation process </br>\nDual switch-press control </br>\nMax. discharge energy up to 200 J </br>\nUp to 20 distinct voice prompts </br>\nLock-out protection facility </br>\nLED visual indicators', '', '', '', '{\"Waveform\":\"Biphasic\",\"Energy Sequence\":\"150 J, 200 J\",\"Analysis Time\":\"9 seconds\",\"Audio Indications\":\"20 distinct voice instructions\",\"Charge Time\":\"8 seconds for 150 J <\\/br> \\n10 seconds for 200 J\",\"Capacity\":\"100 discharges (200 J) <\\/br> \\n120 discharges (150 J)\",\"Rhythm Analysis Time\":\"Less than 30 secs for new battery <\\/br> \\nLess than 35 secs after 6 shock discharge <\\/br> \\nLess than 25 secs at initial switch-on\",\"Visual  Indications\":\"LED flash light indicator\",\"Control Keys\":\"Shock and On\\/Off keys\",\"Energy Accuracy\":\"\\u00b1 15 % tolerance (25 \\u2126  to 175 \\u2126)\",\"Impedance Range\":\"20 \\u2126  to 200 \\u2126\",\"Battery\":\"Non-rechargeable (12V DC)\",\"Operating Temperature\":\"0 \\u00b0C  to 40 \\u00b0C\",\"Operating Humidity\":\"30 % to 95 %\",\"Dimensions\":\"303 x 216 x 89 mm\",\"Weight\":\"2 Kgs\"}', 'Used in various mass transit locations like Airports, Train stations, high traffic public places or outdoor activity parks, gyms, arenas, community centers as well as in public events to handle sudden cardiac emergency situations.', '', '', '', 'Automated External Defibrillator KED-A100', 'Critical Care | Automated External Defibrillator KED-A100', 'KED-A100', 'Automated External Defibrillator KED-A100 is a biphasic portable semi-automated public access defibrillation device. System incorporates advanced cardiac life-support features which include step-by-step voice instructions from pad placement to shock delivery with clear visual real-time guidance indicators as well as electrode position analysis for safe and quick treatment aid during cardiac emergency suitable to use for on-the-spot responders with or without training.', '', '', 'Automated External Defibrillator KED-A100', 'Automated External Defibrillator KED-A100', '', '{\"small\":\"assets\\/images\\/products\\/Automated-External-Defibrillator-KED-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Automated-External-Defibrillator-KED-A100-250x250.jpg\"}', '', 'Critical-Care/Defibrillator/KED-A100', 1, '2019-07-24 12:54:35', 1, '2019-07-24 07:24:35'),
(12, 'KAT-A100', 'Autopsy Table KAT-A100', 1, 'A1', 0, 59, 'KAT-A100 is ± 35° horizontal rotation examination table consisting of 3 removable sideboard table with holes. Equipped with Infrared sensor faucet with manual faucet providing easy adjustment of hot and cold water temperature. Features table water curtain device which flushes dirt automatically, preventing contamination. Integrated crusher for crushing broken tissues, small bones after dissection.', '', '', 'Double deck structure<br/>\nMaterial - Stainless steel ( anti corrosive )<br/>\nMesa arc-shaped inner connection (easy cleaning)<br/>\nMeasurement scale on operating table<br/>\nIntegrated mobile sprinkler for continuous cleansing<br/>\nRemovable disk for organ placement<br/>\nWaterproof power socket ensures user safety<br/>\nStable and reliable on lift<br/> \nExhaust system safeguards against toxic gas', '', '', '', '{\"Table rotation\":\"Horizontal \\u00b1 35 \\u00b0\",\"Trays\":\"3 (removable)\",\"Sink\":\"2 faucet (sensor and manual)\",\"Material\":\"Stainless steel \\n(compression molding technique)\",\"Structure\":\"Double deck\",\"Exhaust system\":\"Negative pressure ventilation mode\",\"Dimension ( L x W x H )\":\"250 x 78 x 75 mm\"}', 'Used in forensic science, anatomical lab, hospital pathology lab, for performing human and animal autopsy', '', '', '', 'Autopsy Table KAT-A100', 'OR Solutions | Autopsy Table KAT-A100', 'KAT-A100', 'KAT-A100 is ± 35° horizontal rotation examination table consisting of 3 removable sideboard table with holes. Equipped with Infrared sensor faucet with manual faucet providing easy adjustment of hot and cold water temperature. Features table water curtain device which flushes dirt automatically, preventing contamination. Integrated crusher for crushing broken tissues, small bones after dissection.', '', '', 'Autopsy Table KAT-A100', 'Autopsy Table KAT-A100', '', '{\"small\":\"assets\\/images\\/products\\/Autopsy-Table-KAT-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Autopsy-Table-KAT-A100-250x250.jpg\"}', '', 'OR-Solutions/Autopsy-Table/KAT-A100', 1, '2019-07-24 12:55:08', 1, '2019-07-24 07:25:09'),
