(15, 'KBIW-A100', 'Blood and Infusion Warmer KBIW-A100', 1, 'A1', 0, 101, 'Blood and Infusion Warmer KBIW-A100 is high-performance microprocessor-controlled in-line blood/infusion fluid warming system suitable for low to medium flow capacity featuring advanced thermal sensors, self-test facility and comprehensive malfunction alarms for optimized and safe inline bubble-free warming of blood and infusions therapy fluids. Grooved cylindrical heat exchanger disperses uniform heat within confined heat exchange area at slow fluid rate.', '', '', 'Dry heat technology </br>\nIn-line fluid warming </br>\nTriple sensor feedback </br>\n24 hours of continuous operation </br>\nEasy-to-mount clamp', '', '', '', '{\"Temperature Range\":\"37\\u00b0C to 42\\u00b0C\",\"Temperature Accuracy\":\"\\u00b1 0.5\\u00b0C\",\"Warm-up Time\":\"< 45 s (20\\u00b0C  to 36\\u00b0C)\",\"Power Consumption\":\"250 VA\",\"Warming Capacity\":\"Up to 6000 ml\\/hr\",\"Tube Diameter Range\":\"\",\"Device Classification\":\"Class I, Type B\",\"Overheat Protection\":\"43 \\u00b0C \\/ 45 \\u00b0C \\/ (48 \\u00b1 3 ) \\u00b0C\",\"Low Temperature Alarm\":\"36 \\u00b0C\",\"Power Supply\":\"\",\"Dimensions\":\"100 x 170 x 210 mm\",\"Weight\":\"1.3 Kg\"}', 'Used in operating rooms, surgical care wards, Intensive care unit, and other departments for warming blood components and enteral or parenteral nutrition fluids during massive transfusions, post-operative or critical-care nutrition to prevent hypothermia in patients.', '', '', '', 'Blood and Infusion Warmer KBIW-A100', 'Critical Care | Blood and Infusion Warmer KBIW-A100', 'KBIW-A100', 'Blood and Infusion Warmer KBIW-A100 is high-performance microprocessor-controlled in-line blood/infusion fluid warming system suitable for low to medium flow capacity featuring advanced thermal sensors, self-test facility and comprehensive malfunction alarms for optimized and safe inline bubble-free warming of blood and infusions therapy fluids. Grooved cylindrical heat exchanger disperses uniform heat within confined heat exchange area at slow fluid rate.', '', '', 'Blood and Infusion Warmer KBIW-A100', 'Blood and Infusion Warmer KBIW-A100', '', '{\"small\":\"assets\\/images\\/products\\/Blood-and-Infusion-Warmer-KBIW-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Blood-and-Infusion-Warmer-KBIW-A100-250x250.jpg\"}', '', 'Critical-Care/Blood-and-Infusion-Warmer/KBIW-A100', 1, '2019-07-24 12:58:07', 1, '2019-07-24 07:28:07'),
(16, 'KBIW-A200', 'Blood and Infusion Warmer KBIW-A200', 1, 'A2', 0, 101, 'Blood and Infusion Warmer KBIW-A200 is compact microprocessor-controlled in-line blood/infusion fluid warming system suitable for low to medium infusion featuring advanced thermal sensors, self-test facility and comprehensive malfunction alarms for optimized and safe inline bubble-free warming of blood and infusions therapy fluids. Dual loop tube position with dual-lock magnetic cover plate ensures uniform heat at slow fluid rate.', '', '', 'Dry heat technology </br>\nIn-line fluid warming </br>\nDual-loop tube positioning </br>\n24 hours of continuous operation </br>\nWide range of IV tube compatibility </br>\nEasy-to-mount clamp', '', '', '', '{\"Temperature Range\":\"37\\u00b0C to 42\\u00b0C\",\"Temperature Accuracy\":\"\\u00b1 1.0\\u00b0C\",\"Warm-up Time\":\"< 45 s (20\\u00b0C  to 36\\u00b0C)\",\"Power Consumption\":\"80 VA\",\"Warming Capacity\":\"16 ml\\/min\",\"Tube Diameter Range\":\"3.5 mm  \\u0336  5.0 mm O.D.\",\"Device Classification\":\"Class I, Type B\",\"Overheat Protection\":\"43\\u00b0C \\/ 45\\u00b0C \\/ (48 \\u00b1 3)\\u00b0C\",\"Low Temperature Alarm\":\"36 \\u00b0C\",\"Power Supply\":\"230 V \\u00b1 10%, 50  \\u0336  60 Hz\",\"Dimensions\":\"180 x 75 x 40 mm\",\"Weight\":\"\"}', 'Used in operating rooms, surgical care wards, Intensive care unit, and other departments for warming blood components and enteral or parenteral nutrition fluids during massive transfusions, post-operative or critical-care nutrition to prevent hypothermia in patients.', '', '', '', 'Blood and Infusion Warmer KBIW-A200', 'Critical Care | Blood and Infusion Warmer KBIW-A200', 'KBIW-A200', 'Blood and Infusion Warmer KBIW-A200 is compact microprocessor-controlled in-line blood/infusion fluid warming system suitable for low to medium infusion featuring advanced thermal sensors, self-test facility and comprehensive malfunction alarms for optimized and safe inline bubble-free warming of blood and infusi