(17, 'KBS-A100', 'Mammography system KBS-A100', 1, 'A1', 0, 23, 'Mammography system KBS-A100 is a high-end breast imaging scanner with dedicated magnification system. Incorporated x-ray controller allows selection of imaging factors for shorter inter-exposure times. Slim design and motorized imaging station enable easy breast positioning. Smooth compression platform with plate ensures uniform compression for increased breast tissue visibility.', '', '', 'High frequency focused Molybdenum target </br>\nStreamlined compression plate improves clarity </br>\nHigh resolution imaging </br>  \nControlled minimal dosage </br>\nTouch panel operation', '', '', '', '{\"Generator Type\":\"High frequency inverter 80 kHz\",\"Radiographic Ratings\":\"Large focal point, 20-35 kV\\/10-510 mAs <br\\/>\\nSmall focal point, 20-35 kV\\/ 10-110 mAs\",\"Focal Size\":\"Dual focus 0.2\\/0.4 mm\",\"Input Power\":\"Single phase AC 220 V, 50-60 Hz\",\"Power Ratings\":\"6 kW\",\"Target Material\":\"Molybdenum (Mo)\",\"Port Material\":\"Beryllium (Be)\",\"Anode Heat Storage\":\"100 kJ\",\"Anode Cooling\":\"Air cooling\",\"Filtration\":\"Molybdenum (0.03 mm) Al (O.5 mm)\",\"C-arm vertical segment\":\"580 mm\",\"Rotational movement\":\"+175\\u2070~-180\\u2070\",\"SID\":\"650 mm\",\"Cassette image receptor\":\"180 x 240 mm <\\/br> Grid Ratio- 5:1, 30 line\\/cm\",\"Line Voltage\":\"AC 220 V\\/50 Hz @ 25 A, Single phase\",\"Dimensions\":\"2050 x 600 x 1100 mm\",\"Weight\":\"240 kgs\"}', 'Used in radiology departments for enhanced visualization of breast tissue for mammary benign lumps, nodes, calcified points and early detection of malignant tumours.', '', '', '', 'Mammography system KBS-A100', 'Medical Diagnostic | Mammography system KBS-A100', 'KBS-A100', 'Mammography system KBS-A100 is a high-end breast imaging scanner with dedicated magnification system. Incorporated x-ray controller allows selection of imaging factors for shorter inter-exposure times. Slim design and motorized imaging station enable easy breast positioning. Smooth compression platform with plate ensures uniform compression for increased breast tissue visibility.', '', '', 'Mammography system KBS-A100', 'Mammography system KBS-A100', '', '{\"small\":\"assets\\/images\\/products\\/Mammography-system-KBS-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Mammography-system-KBS-A100-250x250.jpg\"}', '', 'Medical-Diagnostic/Breast-Scanning-System/KBS-A100', 1, '2019-07-24 12:59:32', 1, '2019-07-24 07:29:32'),
(18, 'KBS-A101', 'Mammography system KBS-A101', 1, 'A1', 0, 23, 'Mammography system KBS-A101 is a breast imaging scanner with dedicated magnification system. Slim design and motorized movements enable easy breast positioning. Smooth compression platform with plate ensures uniform compression for increased breast tissue visibility.', '', '', 'High frequency focused Molybdenum target </br>\nStreamlined compression plate </br>\nHigh resolution imaging </br>\nOptimal dosage </br>  \nTouch panel operation', '', '', '', '{\"Generator Type\":\"High frequency inverter 40 kHz\",\"Radiographic Ratings\":\"Large focal point, 20-35 kV\\/10-510 mAs <br\\/>\\nSmall focal point, 20-35 kV\\/ 10-110 mAs\",\"Focal Size\":\"Dual focus 0.5 mm\",\"Input Power\":\"Single phase AC 220 V, 50-60 Hz\",\"Power Ratings\":\"1.8 kW\",\"Target Material\":\"Molybdenum (Mo)\",\"Port Material\":\"Beryllium (Be)\",\"Anode Heat Storage\":\"35 KJ\",\"Anode Cooling\":\"Air cooling\",\"Filtration\":\"Molybdenum (0.03 mm) Al (O.5 mm)\",\"C-arm vertical segment\":\"580 mm\",\"Rotational movement\":\"+175\\u2070~-180\\u2070\",\"SID\":\"650 mm\",\"Cassette image receptor\":\"190 X 240 mm\",\"Line Voltage\":\"AC 220 V @ 15 A, Single phase\",\"Dimensions\":\"2050 x 600 x 1100 mm\",\"Weight\":\"240 kgs\"}', 'Used in radiology departments for enhanced visualization of breast tissue for mammary benign lumps, nodes, calcified points and early detection of malignant tumours.', '', '', '', 'Mammography system KBS-A101', 'Medical Diagnostic | Mammography system KBS-A101', 'KBS-A101', 'Mammography system KBS-A101 is a breast imaging scanner with dedicated magnification system. Slim design and motorized movements enable easy breast positioning. Smooth compression platform with plate ensures uniform compression for increased breast tissue visibility.', '', '', 'Mammography system KBS-A101', 'Mammography system KBS-A101', '', '{\"small\":\"assets\\/images\\/products\\/Mammography-system-KBS-A101-150x150.jpg\",\"medium\":