(19, 'KCM-A100', 'CPAP Machine KCM-A100', 1, 'A1', 0, 97, 'CPAP Machine KCM-A100 is a noninvasive ventilation system equipped with LCD screen for display of patient trends, CPAP pressure. Uniform humidification ensures optimal respiratory comfort. Patient respiration automatically triggers work mode and expiratory pressure relief (EPR) function traces every breath for safe and reliable performance. Internal memory records case details for data transmission via USB port. Integrated automatic leakage and altitude compensation for improved accuracy.', '', '', '3.5 inch TFT LCD screen </br>\n128x64 LCD resolution </br>\nAccurate and reliable performance </br>\nSingle touch operation </br>\nQuiet operation </br>\nModes: CPAP and CPAP+EPR </br>\nPatient data recording </br> \nTimely indicative visual alarm', '', '', '', '{\"Display\":\"3.5\\u2019\\u2019 TFT LCD\",\"Resolution\":\"128 X 64 LCD\",\"Mode\":\"CPAP, CPAP + EPR\",\"Pressure\":\"4-20 cm H2O\",\"EPR\":\"2-4 cm H2O\",\"Ramp Duration\":\"0-60 min\",\"Automatic Leakage Compensation\":\"Yes\",\"Automatic Altitude Adjustable\":\"Yes\",\"Automatic ON\\/OFF\":\"Yes\",\"Adjustable Uniform Humidification System\":\"Yes\",\"Replaceable Water Chamber\":\"Yes\",\"USB Connectivity\":\"Yes\",\"Noise  Level\":\"<30 dBA\",\"Input\":\"110 V - 240 V AC, 50 Hz\\/60 Hz\",\"Dimensions\":\"255 \\u00d7 170 \\u00d7 112 mm\",\"Weight\":\"1.8 Kg\"}', 'Used in clinical or primary healthcare facilities to treat or alleviate respiratory ailments such as obstructive sleep apnea syndrome, chronic obstructive pulmonary disease, acute lung injury, pneumonia, ventilator weaning, etc.', '', '', '', 'CPAP Machine KCM-A100', 'Respiratory Aids | CPAP Machine KCM-A100', 'KCM-A100', 'CPAP Machine KCM-A100 is a noninvasive ventilation system equipped with LCD screen for display of patient trends, CPAP pressure. Uniform humidification ensures optimal respiratory comfort. Patient respiration automatically triggers work mode and expiratory pressure relief (EPR) function traces every breath for safe and reliable performance. Internal memory records case details for data transmission via USB port. Integrated automatic leakage and altitude compensation for improved accuracy.', '', '', 'CPAP Machine KCM-A100', 'CPAP Machine KCM-A100', '', '{\"small\":\"assets\\/images\\/products\\/Cpap-Machine-KCM-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Cpap-Machine-KCM-A100-250x250.jpg\"}', '', 'Respiratory-Aids/CPAP-Machine/KCM-A100', 1, '2019-07-24 13:00:30', 1, '2019-07-24 07:30:30'),
(20, 'KCA-A200', 'Chemistry Analyser KCA-A200', 1, 'A2', 0, 88, 'Chemistry Analyser KCA-A200 is a high-performance fully automated benchtop clinical chemistry analyzer. Multi-standard and user programmable functionality enables customized usage. West guard Analysis and self-test feature improves productivity and accuracy.', '', '', 'Intelligent Multi-tasking operation </br>\nSelf-diagnosis and Auto-alarm </br>\nEnd point, Kinetic, fixed time, Bi-chromatic, multi-standard, two steps of end point </br>\nStandard/ Control/ STAT modes </br>\nLevy-Jennings chart and West guard Analysis QC </br>\nUSB network interface', '', '', '', '{\"Type\":\"Fully Automated Analysis system\",\"Throughput\":\"140 tests per hour\",\"Analytical Methods\":\"End point, Kinetic, fixed time, Bi-chromatic, multi-standard, Two steps of end point and more\",\"Assay Modules\":\"Over 200 modules\",\"Sample Slots\":\"64  slots for standard and control\",\"Sample Volume\":\"1-100ul, 1ul \\/ step\",\"Reaction tray size\":\"96 reaction cuvettes\",\"Flow cell volume\":\"32 ul\",\"Reagent\":\"Diluter : 1000ul, 1ul\\/step\",\"Reagent Slots\":\"\",\"Photometric Measuring range\":\"0.0 \\u2013 3.0 OD (filters)\",\"Reagent Volume\":\"\",\"Probe Handling\":\"With liquid sensor & automatic probe washing and crash function\",\"Washing Reaction Cuvettes\":\"Automatic Flow cell washing\",\"Data Transmission\":\"USB 2.0\",\"Reaction Time\":\"\",\"Alarms\":\"Reagent \\/ sample alarm, Water alarm, Hit the needle alarm, Replace the reaction plate\",\"Calibration\":\"System Calibration :\\nDeduction of washer blank\\/ reagent blank <\\/br> Nonlinear linear or with 1-6 calibration standards\",\"Lamp\":\"7 high-quality 6 V\\/ 10 W Halogen lamp\",\"Storage\":\"Up to millions of analysis reports\",\"Absorbance Resolution\":\"\",\"Absorbance Accuracy\":\"\",\"Repeatability\":\"\",\"Quality Control\":\"Levy-Jennings chart and West guard analysis\\u00a0\",\"Power Supply\":\"220 V \\/ 50 Hz or 110 V \\/ 60 Hz\",\"Dimension\":\"600 x 500 x 410 mm\",\"Weight\":\"\"}', 'Used in small to medium sized pathological diagnostic laboratories with wide range of applications including determination of the concentration of enzymes, substrates, electrolytes, specific proteins, drugs of abuse, and therapeutic drugs in samples for diagnosis of toxicological effect on renal, cardiac, and liver function.', '', '', '', 'Chemistry Analyser KCA-A200', 'Laboratory Analyser | Chemistry Analyser KCA-A200', 'KCA-A200', 'Chemistry Analyser KCA-A200 is a high-performance fully automated benchtop clinical chemistry analyzer. Multi-standard and user programmable functionality enables customized usage. West guard Analysis and self-test feature improves productivity and accuracy.', '', '', 'Chemistry Analyser KCA-A200', 'Chemistry Analyser KCA-A200', '', '{\"small\":\"assets\\/images\\/products\\/Chemistry-Analyser-KCA-A200-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Chemistry-Analyser-KCA-A200-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/Chemistry-Analyser/KCA-A200', 1, '2019-07-24 13:01:21', 1, '2019-07-24 07:31:22'),
(21, 'KCA-A201', 'Chemistry Analyser KCA-A201', 1, 'A2', 0, 88, 'Chemistry Analyser KCA-A201 is a high-performance fully automated benchtop clinical chemistry analyzer. Random access based automation system increases test productivity and accuracy. System incorporates cuvette washing station and contact-free reaction design for better hygiene practices.', '', '', 'Random access automation system </br>\nUp to 80 assay modules </br>\nIntelligent multi-tasking operation </br>\nStandard/ Control/ STAT modes </br>\nAuto-alarms with Levy Jennings QC </br> \nTele-diagnostic network interface </br>\nBar code sample scanning (Optional)', '', '', '', '{\"Type\":\"Fully Automated Random Access System\",\"Throughput\":\"Reagent 1 : 400 test\\/hr <\\/br> Reagent 2 : 600 test\\/hr <\\/br> With ISE : 400 test\\/hr\",\"Analytical Methods\":\"End-point, Multi-standard, Immuno-turbid metric, 1-2 reagent, Reagent\\/serum blank, etc.\",\"Assay Modules\":\"80 modules\",\"Sample Slots\":\"80\",\"Sample Volume\":\"1\\u00b5L - 100\\u00b5L, (0.1\\u00b5L\\/step)\",\"Reaction tray size\":\"\",\"Flow cell volume\":\"\",\"Reagent\":\"\",\"Reagent Slots\":\"2 x 40\",\"Photometric Measuring range\":\"\",\"Reagent Volume\":\"R1 : 1\\u00b5L - 400\\u00b5L, (1\\u00b5L\\/step) <\\/br> R2 : 1\\u00b5L - 400\\u00b5L, (1\\u00b5L\\/step) <\\/br> 1\\u00b5L - 500\\u00b5L, (0.1\\u00b5L\\/step) [Min. 50 \\u00b5L\\/test on request]\",\"Probe Handling\":\"Liquid level sensor, Collision sensor, Teflon coating and Automatic washing station.\",\"Washing Reaction Cuvettes\":\"8 channel Auto-washing\",\"Data Transmission\":\"\",\"Reaction Time\":\"0 s \\u2013 999 s\",\"Alarms\":\"Auto-alarm for crucial events (collision, reagent\\/ sample insufficiency,                                    full waste container, etc.)\",\"Calibration\":\"Linear, Non-linear, Multi-point, K factor\",\"Lamp\":\"Halogen Lamp <\\/br> Wavelength : 340 nm \\u2013 810 nm\",\"Storage\":\"\",\"Absorbance Resolution\":\"0.0001 Abs\",\"Absorbance Accuracy\":\"\\u00b1 0.0003 Abs ; ( 0 Abs \\u2013 2.5 Abs)\",\"Repeatability\":\"\\u2264 2 %\",\"Quality Control\":\"Levy-Jennings quality control at 3 levels\",\"Power Supply\":\"220 V \\/ 50 Hz or 110 V \\/ 60 Hz\",\"Dimension\":\"1000 x 850 x 700 mm\",\"Weight\":\"137 Kgs\"}', 'Used in small to medium sized pathological diagnostic laboratories with wide range of applications including determination of the concentration of enzymes, substrates, electrolytes, specific proteins, drugs of abuse, and therapeutic drugs in samples for diagnosis of toxicological effect on renal, cardiac, and liver function.', '', '', '', 'Chemistry Analyser KCA-A201', 'Laboratory Analyser | Chemistry Analyser KCA-A201', 'KCA-A201', 'Chemistry Analyser KCA-A201 is a high-performance fully automated benchtop clinical chemistry analyzer. Random access based automation system increases test productivity and accuracy. System incorporates cuvette washing station and contact-free reaction design for better hygiene practices.', '', '', 'Chemistry Analyser KCA-A201', 'Chemistry Analyser KCA-A201', '', '{\"small\":\"assets\\/images\\/products\\/Chemistry-Analyser-KCA-A201-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Chemistry-Analyser-KCA-A201-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/Chemistry-Analyser/KCA-A201', 1, '2019-07-24 13:01:22', 1, '2019-07-24 07:31:22'),
(23, 'KCA-A202', 'Chemistry Analyser KCA-A202', 1, 'A2', 0, 88, 'Chemistry Analyser KCA-A202 is a fully automated benchtop clinical chemistry analyzer. System incorporates pre-defined analysis programs which simplifies test functionality. Built-in reagent cooling and pre-heating facility eliminates need to refrigerate or heat sample which saves time. Touch screen display combined with STAT and routine testing allows versatile applicability.', '', '', 'Throughput : 120 photometric tests/hour </br>\nAnalytical modes : End-point/Two-point/Kinetic </br>\nErgonomic operational software </br>\nMicro-volume sample analysis </br>\nReagent pre-heat and refrigeration', '', '', '', '{\"Type\":\"Fully Automatic Random Access system\",\"Throughput\":\"120 tests\\/hour\",\"Assay Modules\":\"Up to 26 Assays\",\"Sample slots\":\"9\",\"Sample volume\":\"3 \\u00b5L \\u2013 45 \\u00b5L, (0.5 \\u00b5L step adjustability)\",\"Reagent slots\":\"26\",\"Reagent volume\":\"R1 : 180 \\u00b5L \\u2013 450 \\u00b5L, (1 \\u00b5L step adjustability) <\\/br> R2 : 180 \\u00b5L \\u2013 450 \\u00b5L, (1 \\u00b5L step adjustability)\",\"Reaction slots\":\"90 cuvettes, 10 cuvettes\\/strips\",\"Cuvette (Optical length)\":\"5 mm\",\"Reaction volume\":\"180 \\u00b5L \\u2013 500 \\u00b5L\",\"Reaction temperature\":\"(37\\u00b0 \\u00b1 0.4\\u00b0) C\",\"Probe Handling\":\"Pre-heat, Collision protection, Liquid-level detection, Inventory checking, Automatic inner and outer probe washing\",\"Lamp\":\"Halogen bulb\",\"Absorbance range\":\"(0 Abs \\u2013 3.500 Abs) \\u00b1 1 %\",\"Wavelength\":\"340 nm \\u2013 700 nm\",\"Resolution\":\"0.0001 Abs\",\"Temperature\":\"10\\u00b0C - 35\\u00b0C\",\"Humidity\":\"35% \\u2013 80%\",\"Reagent refrigeration\":\"4\\u00b0C - 15\\u00b0C\",\"Water Consumption\":\"1.5 L\\/hr\",\"Power Supply\":\"100 V \\u2013 240 V ; 50\\/60 Hz\",\"Dimension\":\"583 x 453 x 530 cm\",\"Weight\":\"70 Kgs\"}', 'Used in small to medium sized pathological diagnostic laboratories with wide range of applications including determination of the concentration of enzymes, substrates, electrolytes, specific proteins, drugs of abuse, and therapeutic drugs in samples for diagnosis of toxicological effect on renal, cardiac, and liver function.', '', '', '', 'Chemistry Analyser KCA-A202', 'Laboratory Analyser | Chemistry Analyser KCA-A202', 'KCA-A202', 'Chemistry Analyser KCA-A202 is a fully automated benchtop clinical chemistry analyzer. System incorporates pre-defined analysis programs which simplifies test functionality. Built-in reagent cooling and pre-heating facility eliminates need to refrigerate or heat sample which saves time. Touch screen display combined with STAT and routine testing allows versatile applicability.', '', '', 'Chemistry Analyser KCA-A202', 'Chemistry Analyser KCA-A202', '', '{\"small\":\"assets\\/images\\/products\\/Chemistry-Analyser-KCA-A202-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Chemistry-Analyser-KCA-A202-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/Chemistry-Analyser/KCA-A202', 1, '2019-07-24 13:01:59', 1, '2019-07-24 07:31:59'),
(24, 'KCG-A100', 'Coagulation Analyser KCG-A100', 1, 'A1', 0, 91, 'Coagulation Analyser KCG-A100 is a high-performance semi-automated benchtop coagulation analyser. Incorporated automatic stirring system speeds up and aids in sample preparation. Reaction cuvette pre-heating saves time and reduces work-effort. Large storage memory and intuitive navigation allows quick review of previous result values.', '', '', 'Single channel analysis </br>\nPre-programmed test menu for single assays </br>\nLower reagent consumption </br>\nAutomated storage and printout </br>\nPreparation and incubation for samples/ reagents </br>\nUp to 7 point calibration or reference curves', '', '', '', '{\"Number of channels\":\"Single channel\",\"Test parameters\":\"PT [Prothrombin Time]  <\\/br> APTT [Activated Partial Thromboplastin Time] <\\/br> TT [Thrombin Time] <\\/br> FBG [Fibrinogen Concentration] <\\/br> Clotting Factors\",\"Measurement method\":\"Photometric analysis\",\"Display\":\"Back-illuminated LCD\",\"Reagent volume\":\"50 \\u00b5l ~ 100\\u00b5l\",\"Pre-heat temperature\":\"37 \\u00b1 0.2 \\u00b0C\",\"Capacity\":\"Sample: 16 positions <\\/br> Reagent: 2 positions\",\"Storage\":\"Large storage memory and user-friendly review system\",\"Output interface\":\"Built-in thermal printer\",\"Power supply\":\"110V \\/ 60Hz <\\/br> 220V \\/ 50Hz\",\"Stirring\":\"Automated magnetic stirring motor for cuvette\",\"Dimension\":\"310 X 200 X 280 mm\",\"Weight\":\"4.5 Kgs\"}', 'Used in small to medium sized pathological diagnostic laboratories, small or private hospital laboratories with wide range of applications in Hemostasis for diagnostic evaluation to test for Thrombo-embolytic disease, Thrombocytopenia, Impaired liver function or Hemophilia.', '', '', '', 'Coagulation Analyser KCG-A100', 'Laboratory Analyser | Coagulation Analyser KCG-A100', 'KCG-A100', 'Coagulation Analyser KCG-A100 is a high-performance semi-automated benchtop coagulation analyser. Incorporated automatic stirring system speeds up and aids in sample preparation. Reaction cuvette pre-heating saves time and reduces work-effort. Large storage memory and intuitive navigation allows quick review of previous result values.', '', '', 'Coagulation Analyser KCG-A100', 'Coagulation Analyser KCG-A100', '', '{\"small\":\"assets\\/images\\/products\\/Coagulation-Analyser-KCG-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Coagulation-Analyser-KCG-A100-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/Coagulation-Analyser/KCG-A100', 1, '2019-07-24 13:04:04', 1, '2019-07-24 07:34:04'),
(25, 'KCS-A100', 'Connecting Stretcher KCS-A100', 1, 'A1', 0, 62, 'KCS-A100 is emergency connecting trolley for operating room. Stretchers can be moved for easy transport of patient from outside to inside the operating room when two trolleys are at the same level. Stretcher can be locked automatically with the trolley. Two trolleys are joined together but up and down separately. Backrest function is controlled by spring.', '', '', 'Aluminum alloy trolley structure<br/>\nAluminum alloy railway connects 2 stretchers<br/> \nPP bottom  platform<br/> \nTwo ABS side rails<br/> \nCentral locking function<br/> \nIV pole, PU (polyurethane) cover water proof mattress', '', '', '', '{\"Backrest upward angle\":\"75 \\u00b0\",\"Side rails\":\"ABS material\",\"Bottom platform\":\"Polypropylene\",\"Variable height\":\"640 to 970mm\",\"Mattress thickness\":\"80 mm\",\"Weight capacity\":\"150 Kgs\",\"Caster diameter\":\"150 mm\",\"Dimension\":\"3650 \\u00d7 640 \\u00d7 640-970 mm\"}', 'Used in hospital operating rooms to transfer patient from table to anesthesia.', '', '', '', 'Connecting Stretcher KCS-A100', 'Patient Transfer Solutions | Connecting Stretcher KCS-A100', 'KCS-A100', 'KCS-A100 is emergency connecting trolley for operating room. Stretchers can be moved for easy transport of patient from outside to inside the operating room when two trolleys are at the same level. Stretcher can be locked automatically with the trolley. Two trolleys are joined together but up and down separately. Backrest function is controlled by spring.', '', '', 'Connecting Stretcher KCS-A100', 'Connecting Stretcher KCS-A100', '', '{\"small\":\"assets\\/images\\/products\\/Connecting-Stretcher-KCS-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Connecting-Stretcher-KCS-A100-250x250.jpg\"}', '', 'Patient-Transfer-Solutions/Stretchers/KCS-A100', 1, '2019-07-24 13:05:49', 1, '2019-07-24 07:35:50'),
(26, 'KCS-A101', 'Connecting Stretcher KCS-A101', 1, 'A1', 0, 62, 'KCS-A101 is emergency connecting trolley for operating room. Stretchers can be moved for easy transport of patient from outside to inside the operating room when two trolleys are at the same level. Stretcher can be locked automatically with the trolley. Two trolleys with rise and fall guide wheel are joined together but up and down separately. Backrest function is controlled by spring.', '', '', 'Aluminum alloy trolley structure<br/>  \nAluminum alloy railway to connects 2 stretchers<br/>   \nTwo steel flat side rails<br/>   \nSteel bottom platform<br/>   \nCentral locking function<br/>   \nIV pole, PU (polyurethane) cover water proof mattress', '', '', '', '{\"Backrest upward angle\":\"75 \\u00b0\",\"Side rails\":\"Steel material\",\"Bottom platform\":\"Steel material\",\"Variable height\":\"640 to 970mm\",\"Mattress thickness\":\"80 mm\",\"Weight capacity\":\"150 Kgs\",\"Caster diameter\":\"150 mm\",\"Dimension\":\"3650 \\u00d7 640 \\u00d7 640-970 mm\"}', 'Used in hospital operating rooms to transfer patient from table to anesthesia.', '', '', '', 'Connecting Stretcher KCS-A101', 'Patient Transfer Solutions | Connecting Stretcher KCS-A101', 'KCS-A101', 'KCS-A101 is emergency connecting trolley for operating room. Stretchers can be moved for easy transport of patient from outside to inside the operating room when two trolleys are at the same level. Stretcher can be locked automatically with the trolley. Two trolleys with rise and fall guide wheel are joined together but up and down separately. Backrest function is controlled by spring.', '', '', 'Connecting Stretcher KCS-A101', 'Connecting Stretcher KCS-A101', '', '{\"small\":\"assets\\/images\\/products\\/Connecting-Stretcher-KCS-A101-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Connecting-Stretcher-KCS-A101-250x250.jpg\"}', '', 'Patient-Transfer-Solutions/Stretchers/KCS-A101', 1, '2019-07-24 13:05:49', 1, '2019-07-24 07:35:52'),
(27, 'KDM-A100', 'Defibrillator Monitor KDM-A100', 1, 'A1', 0, 36, 'Defibrillator Monitor KDM-A100 is a biphasic life-support clinical defibrillator equipped with provisional core functionalities which include guided automatic as well as manual defibrillation modes, advanced ECG monitoring, SpO2 monitoring and analysis for predictive arrhythmia detection as well as thermal recorder. System features high resolution screen, touch-key panel to display and select various monitoring parameters with energy navigation knob and alarm.', '', '', '7-inch high resolution display </br>\nAED as well as Manual defibrillation mode </br>\nArrhythmia analysis and recording </br>\nDisplay parameters: Heart Rate, Lead/Pads, Audio/Mute, SpO2 level, Defibrillation energy, Alarm limits', '', '', '', '{\"Display\":\"7-inch screen\",\"Waveform\":\"Biphasic\",\"Manual with Sync mode\":\"2, 5, 7, 10, 20, 30, 50, 70, 100, 150, 200, 300, 360 joules\",\"AED mode\":\"Auto analyze and charge x 3 with programmable auto energy level selection.\",\"Interpreted rhythms for AED\":\"Ventricular fibrillation  \\u2265 200 \\u00b5V <\\/br> \\nVentricular tachycardia \\u2265  140 bpm <\\/br> \\nQRS complex wave duration \\u2265 140 ms\",\"Sweep Speed\":\"25 mm\\/s\",\"Electrode impedance range\":\"0 \\u2126 \\u2013 250 \\u2126\",\"Analysis Time\":\"Less than 7 seconds\",\"ECG  Lead selection\":\"Displayed on monitor, paddles, I, II, III, AVR, AVL, AVF, V\",\"ECG Heart rate\":\"20 bpm \\u2013 300 bpm\",\"ECG size\":\"0.25, 0.5, 1, 1.5, 2, 4 cm\\/mV\",\"ECG Heart Rate alarm\":\"On \\/ Off displayed on monitor, user-selectable\",\"SpO<sub>2<\\/sub>measurement\":\"30 % \\u2013 100 %\",\"Recorder Paper Speed\":\"12.5 mm\\/s, 25 mm\\/s, 50 mm\\/s\",\"Alarm accuracy\":\"\\u00b110 % (less than 12 sec)\",\"Print modes\":\"Manual or automatic, user-configurable\",\"Battery\":\"Rechargeable, Ni-MH battery, 12V\",\"Dimensions\":\"500 x 380 x 360 mm\",\"Weight\":\"8 Kgs\"}', 'Used in hospital emergency wards, OT, crash-cart throughout the hospital premises, primary healthcare centers and rescue ambulance to deliver counter-shocks during sudden cardiac arrest or cardiac resuscitation situations.', '', '', '', 'Defibrillator Monitor KDM-A100', 'Critical Care | Defibrillator Monitor KDM-A100', 'KDM-A100', 'Defibrillator Monitor KDM-A100 is a biphasic life-support clinical defibrillator equipped with provisional core functionalities which include guided automatic as well as manual defibrillation modes, advanced ECG monitoring, SpO2 monitoring and analysis for predictive arrhythmia detection as well as thermal recorder. System features high resolution screen, touch-key panel to display and select various monitoring parameters with energy navigation knob and alarm.', '', '', 'Defibrillator Monitor KDM-A100', 'Defibrillator Monitor KDM-A100', '', '{\"small\":\"assets\\/images\\/products\\/Defibrillator-Monitor-KDM-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Defibrillator-Monitor-KDM-A100-250x250.jpg\"}', 'catalog/Defibrillation-Monitor.pdf', 'Critical-Care/Defibrillator/KDM-A100', 1, '2019-07-24 13:08:02', 1, '2019-07-24 07:38:02'),
