(35, 'KDX-A200', 'Dental X-ray KDX-A200', 1, 'A2', 0, 26, 'Dental X-ray KDX-A200 is a portable  intra-oral imaging modality which uses high frequency DC X-ray generators for good radiographic contrast at minimal dosage. Graphic LCD screen displays various indicative parameters for exposure control and alarms. Touch key user-interface for customized exposure. Incorporated components have vacuum insulation and stereotype sealed protection for stable and extended life of equipment.', '', '', 'Micro focus technology </br>\nDigital control panel </br>\nAccurate and quick imaging </br>\nPneumatic controlled seat – mobile or fixed  </br>\nTrusted tube quality', '', '', '', '{\"Tube Voltage\":\"60 kV\",\"Tube Current\":\"1 mA\",\"Exposure Time\":\"0.02 s \\u2013  2 s\",\"Tube Focus\":\"0.3 x 0.3 mm\",\"Film Size\":\"\",\"Configuration\":\"Portable\",\"Leak Radiation\":\"\",\"Total Filtration\":\"\",\"Battery\":\"DC : 14.8 V, 6400 mA\",\"Charger Output\":\"DC : 16.8 V\",\"Charger Input\":\"AC 100 V-240 V \\u00b110 %\",\"Frequency\":\"30 kHz\",\"Power Rating\":\"60 VA\",\"SSD (Source Skin Distance)\":\"130 mm\",\"Dimension\":\"138 x 165 x 185 mm\\u00a0\",\"Weight\":\"2.2 Kgs\"}', 'Used in dental clinics for dental X-ray imaging to reveal impacted teeth, advanced periodontal disease, sinusitis and to plan treatment dentures, braces, extractions or implants', '', '', '', 'Dental X-ray KDX-A200', 'Medical Diagnostic | Dental X-ray KDX-A200', 'KDX-A200', 'Dental X-ray KDX-A200 is a portable  intra-oral imaging modality which uses high frequency DC X-ray generators for good radiographic contrast at minimal dosage. Graphic LCD screen displays various indicative parameters for exposure control and alarms. Touch key user-interface for customized exposure. Incorporated components have vacuum insulation and stereotype sealed protection for stable and extended life of equipment.', '', '', 'Dental X-ray KDX-A200', 'Dental X-ray KDX-A200', '', '{\"small\":\"assets\\/images\\/products\\/Dental-X-ray-KDX-A200-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Dental-X-ray-KDX-A200-250x250.jpg\"}', '', 'Medical-Diagnostic/Dental-X-Ray-Imaging/KDX-A200', 1, '2019-07-24 13:13:09', 1, '2019-07-24 07:43:09'),
(36, 'KDX-A100', 'Dental X-ray KDX-A100', 1, 'A1', 0, 26, 'Dental X-ray KDX-A100 is an intra-oral imaging modality which uses fine focus X-ray generators and small focal spot for optimum penetration power, good radiographic contrast at minimal dosage. Digital one-touch operation and microprocessor based exposure control along with low voltage alarming and high voltage protection ensures stable, efficient and low radiation output consistently. Micro-focus technology ensures clear image and accurate diagnosis.', '', '', 'Micro focus technology </br>\nDigital control panel </br>\nWall mounted unit </br>\nAccurate and quick imaging </br>\nTrusted X-ray tube quality', '', '', '', '{\"Tube Voltage\":\"60 kV\",\"Tube Current\":\"8 mA\",\"Exposure Time\":\"0.2 s \\u2013 4 s\",\"Tube Focus\":\"0.8 mm\",\"Film Size\":\"\",\"Configuration\":\"Wall Mounted unit\",\"Leak Radiation\":\"One meter \\u2264 0.002 mGy\\/h (National standard:0.25mGy\\/h)\",\"Total Filtration\":\"2.5 mm Al\",\"Battery\":\"\",\"Charger Output\":\"\",\"Charger Input\":\"AC : 220 V \\u00b1 10%, 50 Hz ,1 kVA\",\"Frequency\":\"\",\"Power Rating\":\"\",\"SSD (Source Skin Distance)\":\"20 cm\",\"Dimension\":\"\",\"Weight\":\"35 Kgs\"}', 'Used in dental clinics for dental X-ray imaging to reveal impacted teeth, advanced periodontal disease, sinusitis and to plan treatment dentures, braces, extractions or implants', '', '', '', 'Dental X-ray KDX-A100', 'Medical Diagnostic | Dental X-ray KDX-A100', 'KDX-A100', 'Dental X-ray KDX-A100 is an intra-oral imaging modality which uses fine focus X-ray generators and small focal spot for optimum penetration power, good radiographic contrast at minimal dosage. Digital one-touch operation and microprocessor based exposure control along with low voltage alarming and high voltage protection ensures stable, efficient and low radiation output consistently. Micro-focus technology ensures clear image and accurate diagnosis.', '', '', 'Dental X-ray KDX-A100', 'Dental X-ray KDX-A10