(39, 'KDD-A100', 'Digital Video Dermatoscope KDD-A100', 1, 'A1', 0, 28, 'Digital Video Dermatoscope KDD-A100 is a portable, ultra-compact skin-surface examination unit equipped with lens digital magnification up to 500x and color display for effective imaging. Advanced microscopic imaging captures microscopic skin textures with detailed resolution in video as well as photographic formats. Variable brightness levels for polarization ensures vibrant images and videos.', '', '', 'In-built Polarized as well as Non-polarized technology </br>\nRange of still Image resolutions </br>\nVariable levels of magnification </br>\nPlug-in for TV/Laptop </br>\nIntegrated metal support stand', '', '', '', '{\"Display\":\"3\\u201d TFT panel, 4:3 ratio\",\"Magnification\":\"Optical : 20-200 X  <\\/br>   Digital : 500 X\",\"Image sensor\":\"5 MP\",\"Still image resolution\":\"12 M (4030x3024), 9 M, 5 M, 3 M, 1.3 M, VGA\",\"Video capture resolution\":\"VGA, QVGA\",\"Frame rate\":\"30 fps at VGA\",\"Light source\":\"8 LEDS with brightness adjustable\",\"Power source\":\"Li ion 3.7 V\\/1050 mAh rechargeable battery <\\/br> Adaptor Input: 100-240 V <\\/br>  USB output: 5V 1A\",\"TV output\":\"To any monitor with TV-in\",\"Dimension\":\"130 \\u00d7 103 \\u00d7 29 mm\",\"Weight\":\"195 g (With battery)\"}', 'Used in dermatology clinics, medical Spa to record clinical and dermatoscopic images for documenting, monitoring and supporting differential diagnosis of melanoma and other skin lesions.', '', '', '', 'Digital Video Dermatoscope KDD-A100', 'Medical Diagnostic | Digital Video Dermatoscope KDD-A100', 'KDD-A100', 'Digital Video Dermatoscope KDD-A100 is a portable, ultra-compact skin-surface examination unit equipped with lens digital magnification up to 500x and color display for effective imaging. Advanced microscopic imaging captures microscopic skin textures with detailed resolution in video as well as photographic formats. Variable brightness levels for polarization ensures vibrant images and videos.', '', '', 'Digital Video Dermatoscope KDD-A100', 'Digital Video Dermatoscope KDD-A100', '', '{\"small\":\"assets\\/images\\/products\\/Digital-Video-Dermatoscope-KDD-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Digital-Video-Dermatoscope-KDD-A100-250x250.jpg\"}', '', 'Medical-Diagnostic/Dermatoscope/KDD-A100', 1, '2019-07-24 13:14:15', 1, '2019-07-24 07:44:15'),
(40, 'KEDK-A100', 'Diagnostic Kit KEDK-A100', 1, 'A1', 0, 31, 'Diagnostic kit KEDK-A100 is extensively used by doctors for prognosis of the patients. The entire kit is very helpful in examination of eyes, nose, ears and throat conditions.', '', '', '', '', '', '', '{\"Otoscope\":\"1\",\"Size ear speculum\":\"3\",\"Ophthalmoscope\":\"1\",\"Nasal Speculum\":\"1\",\"Ben arm Illuminator\":\"1\",\"Battery handle\":\"1\",\"Sizes Laryngeal mirrors\":\"2\",\"Tongue Depressor holder\":\"1\",\"Spare halogen lamp\":\"1\"}', 'Diagnostic kit helps the doctor to evaluate the disorders related to ears, eyes, mouth and throat. An early detection prevents further complications occurring from the illness. With this complete kit it is easier to investigate any disorders.', '', '', '', 'Diagnostic Kit KEDK-A100', 'Medical Diagnostic | Diagnostic Kit KEDK-A100', 'KEDK-A100', 'Diagnostic kit KEDK-A100 is extensively used by doctors for prognosis of the patients. The entire kit is very helpful in examination of eyes, nose, ears and throat conditions.', '', '', 'Diagnostic Kit KEDK-A100', 'Diagnostic Kit KEDK-A100', '', '{\"small\":\"assets\\/images\\/products\\/Diagnostic-Kit-KEDK-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Diagnostic-Kit-KEDK-A100-250x250.jpg\"}', '', 'Medical-Diagnostic/Diagnostic-ENT/KEDK-A100', 1, '2019-07-24 13:14:53', 1, '2019-07-24 07:44:54');
