(41, 'KDR-A100', 'Dialyzer Reprocessing Machine KDR-A100', 1, 'A1', 0, 44, 'Dialyzer Reprocessing Machine KDR-A100 is an advanced dialyzer reprocessing unit equipped with touch panel control LCD screen to select various functional parameters and settings for automated reprocessing. Specialized concentration detection system delivers optimal amount of disinfectant ensuring safe disinfection process. The reprocessing system complies with several quality factors to achieve accurate ultra-filtration standards at minimal water usage.', '', '', 'Automated reprocessing cycle: 12 minutes per cycle </br> \nTouch screen LCD </br>\nOperational Workstation : Single </br>\nAccurate TCV and blood leak test </br>\nSafe and automatic disinfectant dilution </br>\nComprehensive data management system </br>\nData record and print function </br>\nEffective cross-contamination control </br>\nTroubleshoot tips and alarms </br>\nReduced water loss (< 8 L/dialyzer)', '', '', '', '{\"Cycle time\":\"12 minutes per cycle\",\"Volume test range\":\"0 mL to 150 mL ( \\u00b13 % )\",\"Operational Workstation\":\"Single\",\"Minimum Water inlet Flow\":\"1.5 L\\/min\",\"Maximum water inlet flow\":\"\",\"Water consumption\":\"\",\"Water input temperature\":\"10 \\u00b0C to 40 \\u00b0C\",\"Water input pressure\":\"0.15 MPa to 0.35 MPa\",\"Power consumption\":\"150 W\",\"Pressure lost test\":\"\",\"Operation temperature\":\"5 \\u00b0C to 40 \\u00b0C\",\"Storage temperature\":\"5 \\u00b0C to 40 \\u00b0C\",\"Standard rinse\":\"\",\"Intensive rinse\":\"\",\"Power supply\":\"AC 220 V \\u00b110 %, 50\\/60 Hz\",\"Dimensions\":\"470 \\u00d7380 \\u00d7480 mm\",\"Weight\":\"30 Kgs\"}', 'Used in nephrology (AKD) departments in hospitals or Kidney dialysis centers to effectively automate reprocessing activities detect blood volume as well as inspect for dialyzer compliance with hospital infection-control measures for reuse of the dialyzer unit and provide recorded patient data for record keeping and quality control.', '', '', '', 'Dialyzer Reprocessing Machine KDR-A100', 'General Aids | Dialyzer Reprocessing Machine KDR-A100', 'KDR-A100', 'Dialyzer Reprocessing Machine KDR-A100 is an advanced dialyzer reprocessing unit equipped with touch panel control LCD screen to select various functional parameters and settings for automated reprocessing. Specialized concentration detection system delivers optimal amount of disinfectant ensuring safe disinfection process. The reprocessing system complies with several quality factors to achieve accurate ultra-filtration standards at minimal water usage.', '', '', 'Dialyzer Reprocessing Machine KDR-A100', 'Dialyzer Reprocessing Machine KDR-A100', '', '{\"small\":\"assets\\/images\\/products\\/Dialyzer-Reprocessing-Machine-KDR-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Dialyzer-Reprocessing-Machine-KDR-A100-250x250.jpg\"}', '', 'General-Aids/Dialyser-Reprocessing-Machine/KDR-A100', 1, '2019-07-24 13:18:01', 1, '2019-07-24 07:48:01'),
(42, 'KDR-A101', 'Dialyzer Reprocessing Machine KDR-A101', 1, 'A1', 0, 44, 'Dialyzer Reprocessing Machine KDR-A101 is an advanced dialyzer reprocessing unit equipped with touch panel control LCD screen to select various functional settings for automated reprocessing. Specialized concentration detection system delivers optimal amount of disinfectant and ensures safe disinfection process. The reprocessing system complies with several quality factors to achieve accurate ultra-filtration standards at minimal water usage.', '', '', 'Automated reprocessing cycle: 12 minutes per cycle </br> \nTouch screen LCD </br>\nOperational Workstation : Double   </br>\nAccurate TCV and blood leak test </br>\nSafe and automatic disinfectant dilution </br>\nComprehensive data management system </br>\nData record and print function </br>\nEffective cross-contamination control </br>\nTroubleshoot tips and alarms </br>\nReduced water loss (< 8 L/dialyzer)', '', '', '', '{\"Cycle time\":\"12 minutes per cycle\",\"Volume test range\":\"0 mL to 150 mL ( \\u00b13 % )\",\"Operational Workstation\":\"Double\",\"Minimum Water inlet Flow\":\"1.5 L\\/min\",\"Maximum water inlet flow\":\"\",\"Water consumption\":\"\",\"Water input temperature\":\"10 \\u00b0C to 40 \\u00b0C\",\"Water input pressure\":\"0.15 MPa to 0.35 MPa\",\"Power consumption\":\"150 W\",\"Pressure lost test\":\"\",\"Operation temperature\":\"5 \\u00b0C to 40 \\u00b0C\",\"Storage temperature\":\"5 \\u00b0C to 40 \\u00b0C\",\"Standard rinse\":\"\",\"Intensive rinse\":\"\",\"Power supply\":\"AC 220 V \\u00b110 %, 50\\/60 Hz\",\"Dimensions\":\"480 \\u00d7380 \\u00d7580mm\",\"Weight\":\"35 Kgs\"}', 'Used in nephrology (AKD) departments in hospitals or Kidney dialysis centers to effectively automate reprocessing activities detect blood volume as well as inspect for dialyzer compliance with hospital infection-control measures for reuse of the dialyzer unit and provide recorded patient data for record keeping and quality control.', '', ''