(43, 'KDR-A200', 'Dialyzer Reprocessing Machine KDR-A200', 1, 'A2', 0, 44, 'Dialyzer Reprocessing Machine KDR-200 is an advanced dialyzer reprocessing unit equipped with touch screen interface to navigate, monitor and select various functional parameters and settings. Specialized inflow pressure sensor and blood volume sensor enables synchronous workflow. Comprehensive storage of time-stamped dialyzer data improves standardization and stores essential determinants for further use of dialyzer.', '', '', 'Automated reprocessing cycle: 8 minutes per cycle </br> \nAutomatic self-test </br> \nTouch screen LCD </br> \nRinse : Intensive and Standard  </br> \nData record and back up </br> \nAlarms for tube clogging </br> \nAuto-sensing pressure and blood volume </br> \nReduced water loss', '', '', '', '{\"Cycle time\":\"8 minutes per cycle\",\"Volume test range\":\"0 mL to 150 mL ( \\u00b13 % )\",\"Operational Workstation\":\"\",\"Minimum Water inlet Flow\":\"\",\"Maximum water inlet flow\":\"\\uff1e 1600 mL\\/min\",\"Water consumption\":\"8 L\",\"Water input temperature\":\"10 \\u00b0C to 30 \\u00b0C\",\"Water input pressure\":\"0.15 MPa to 0.35 Mpa\",\"Power consumption\":\"\",\"Pressure lost test\":\"Low-flux dialyzer \\uff1c0.83 mmHg\\/s <\\/br> \\nHigh-flux dialyzer \\uff1c1.25 mmHg\\/s\",\"Operation temperature\":\"\",\"Storage temperature\":\"\",\"Standard rinse\":\"11 min for one or 22 min for two\",\"Intensive rinse\":\"14 min for one or 27 min for two\",\"Power supply\":\"220 V \\/ 50 Hz\",\"Dimensions\":\"480 \\u00d7 430 \\u00d7 560 mm\",\"Weight\":\"25 Kgs\"}', 'Used in nephrology (AKD) departments in hospitals or Kidney dialysis centers to effectively automate reprocessing activities detect blood volume as well as inspect for dialyzer compliance with hospital infection-control measures for reuse of the dialyzer unit and provide recorded patient data for record keeping and quality control.', '', '', '', 'Dialyzer Reprocessing Machine KDR-A200', 'General Aids | Dialyzer Reprocessing Machine KDR-A200', 'KDR-A200', 'Dialyzer Reprocessing Machine KDR-200 is an advanced dialyzer reprocessing unit equipped with touch screen interface to navigate, monitor and select various functional parameters and settings. Specialized inflow pressure sensor and blood volume sensor enables synchronous workflow. Comprehensive storage of time-stamped dialyzer data improves standardization and stores essential determinants for further use of dialyzer.', '', '', 'Dialyzer Reprocessing Machine KDR-A200', 'Dialyzer Reprocessing Machine KDR-A200', '', '{\"small\":\"assets\\/images\\/products\\/Dialyzer-Reprocessing-Machine-KDR-A200-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Dialyzer-Reprocessing-Machine-KDR-A200-250x250.jpg\"}', '', 'General-Aids/Dialyser-Reprocessing-Machine/KDR-A200', 1, '2019-07-24 13:18:01', 1, '2019-07-24 07:48:03'),
