(49, 'KEC-A100', 'Three Channel ECG Machine KEC-A100', 1, 'A1', 0, 29, 'Three Channel ECG Machine KEC-A100 is equipped with a high resolution LCD color screen for optimal waveform display. KEC-A100 performs 12-lead ECG simultaneous acquisition with 3 operational modes namely Auto, Manual and Analysis. It ensures optimal safety against defibrillators and pacemakers. It is equipped with digital noise & EMG filters to deliver accurate results along with automatic baseline drift prevention facility for systematic print results.', '', '', '12-lead ECG simultaneous acquisition </br>\nSelectable ECG report formats (Standard/Cabrera) </br>\nSelectable print modes (Auto/Man/Ana)  </br>\nDigital filters eliminate noise, motion artifacts and prevent baseline drift </br>\nAlarms for lead-off and low battery conditions </br>\nNetwork connectivity with PC for data transfer (Optional)', '', '', '', '{\"LCD Display\":\"192 x 64 Graphic\",\"Expandable Storage\":\"\",\"Paper Speed\":\"5 \\/ 6.25 \\/ 10 \\/ 12.5 \\/ 25 \\/ 50 (mm\\/s)\",\"Sensitivity\":\"2.5, 5, 10, 20, 40 (mm\\/mV), Auto\",\"Safety Standard\":\"IEC Class I, Type CF\",\"Acquisition Mode\":\"12 lead parallel\",\"Channel Display\":\"3 CH\",\"Input Circuit\":\"Floating, protection against Defibrillator & Pacemaker\",\"Input Circuit Current\":\"\\u2264 50 nA\",\"Input Impedance\":\"\\u2265 50 M\\u2126\",\"Depolarization Voltage\":\"\",\"A\\/D Converter\":\"12 bit\",\"Time Constant\":\"\\u22653.2 s\",\"Frequency Response\":\"0.05 Hz to 165 Hz\",\"Built-in Storage\":\"\",\"Connectivity\":\"RS-232 serial port\",\"Calibration Voltage\":\"1 mV \\u00b1 2%\",\"Noise Level\":\"<15 \\u00b5 Vp-p\",\"Anti-Baseline Drift\":\"Auto\",\"EMG Filter\":\"35 Hz ~ 45 Hz (- 3 dB)\",\"ADS Filter\":\"(0.15 Hz - 0.50 Hz) Auto\",\"HUM Filter\":\"50 Hz\\/60 Hz (-20 dB)\",\"CMRR\":\"\\u2265100 dB\",\"Leakage Current\":\"<10 \\u00b5A\",\"Paper Width\":\"63 mm\",\"Paper Length\":\"20 mm\",\"Power supply\":\"AC: 110\\/220 V, 50\\/60 Hz, 85 V ~ 265 V (