(52, 'KEC-C100', 'Twelve Channel ECG Machine KEC-C100', 1, 'C1', 0, 29, 'Twelve Channel ECG Machine KEC-C100 is equipped with high resolution 6” LCD auto-backlit color screen with 6º wide angle display. The system performs 12-lead ECG simultaneous acquisition with Auto, Manual and Analysis operational modes with multi-print facility. Equipped with digital filters for noise, baseline drift & muscle tremor to deliver accurate and systematic print results. Ergonomic soft keys with one touch operation.', '', '', '12-lead ECG simultaneous acquisition </br>\nSelectable ECG report formats (Standard/Cabrera) </br>\nSelectable modes (Auto/Man/Ana/Multi) </br>\nPC based data management software </br>\n9 Export formats with print preview facility </br>\nDigital filters eliminate noise, motion artifacts and prevent baseline drift </br>\nPatient data storage expandability up to 1008 ECGs with SD card </br>\nAlarms for lead-off and low battery conditions </br>\nUSB and RS232 connectivity with PC for data transfer', '', '', '', '{\"LCD Display\":\"6\\u201d Real-time display\",\"Expandable Storage\":\"Up to 1008 ECGs\",\"Paper Speed\":\"5 \\/ 6.25 \\/ 10 \\/ 12.5 \\/ 25 \\/ 50 (mm\\/s)\",\"Sensitivity\":\"2.5, 5, 10, 20, 40 (mm\\/mV), Auto\",\"Safety Standard\":\"IEC Class I, Type CF\",\"Acquisition Mode\":\"12 lead parallel\",\"Channel Display\":\"12 CH\",\"Input Circuit\":\"Floating, protection against Defibrillator & Pacemaker\",\"Input Circuit Current\":\"\\u2264 50 nA\",\"Input Impedance\":\"\\u2265 50 M\\u2126\",\"Depolarization Voltage\":\"\\u00b1 500 mV\",\"A\\/D Converter\":\"12 bit\",\"Time Constant\":\">3.2 s\",\"Frequency Response\":\"0.05 Hz to 165 Hz\",\"Built-in Storage\":\"Up to 1008 ECGs\",\"Connectivity\":\"RS-232 port\\/ USB\\/Wireless (Optional)\",\"Calibration Voltage\":\"1 mV \\u00b1 2 %\",\"Noise Level\":\"< 15 \\u00b5 Vp-p\",\"Anti-Baseline Drift\":\"Auto\",\"EMG Filter\":\"35 Hz ~ 45 Hz (- 3 dB)\",\"ADS Filter\":\"(0.15 Hz - 0.50Hz) Auto\",\"HUM Filter\":\"