(53, 'KEEG-A100', 'EEG Machine KEEG-A100', 1, 'A1', 0, 96, 'EEG Machine KEEG-A100 is a 20 channel EEG system which performs recording, monitoring, acquisition and storage of cortical electrical activities to track brain wave patterns. Supports real-time EEG waveform recording and display. Compact continuous monitoring device with bluetooth as well as USB connectivity for data transmission. Combined display of configuration chart and channel configuration source simplifies channel editing.', '', '', 'Single-shield electrodes with DIN interface </br>\nReal-time as well as long-term monitoring </br>\nAccurate readings and printable waveforms  </br>\nConfigurations : Routine and Ambulatory (Optional) </br>\nConnectivity : USB as well as bluetooth </br>\nHD video/Infra-red video synchronous with EEG data (Optional)', '', '', '', '{\"Input channel\":\"(19 Monopolar EEG and 1 Bipolar ECG)\",\"Recording modes\":\"Real-time (via Bluetooth) \\/ Dynamic (via Flash memory)\",\"Sampling Rate\":\"128, 256, 512 Hz\",\"Evoke Stimulator\":\"\",\"A\\/ Converter\":\"12 bit\",\"Electrodes\":\"Single-shielded electrodes with touch proof connectors\",\"Data format\":\"\",\"USB Interface\":\"USB 2.0\\/  USB 1.1\",\"Hours of operation\":\"72 hours continuous operation\",\"Calibration\":\"\",\"Input impedance\":\"\\u226510 MOhm\",\"Low-pass filter\":\"1 Hz ~ 60 Hz arbitrary\",\"High-pass filter (Time)\":\"0.01s, 0.02s, 0.03s, 0.1s, 0.2s, 0.3s, 1s, 2s, 3s\",\"High-pass filter (Hz)\":\"16Hz, 8Hz, 5.3Hz, 1.6Hz, 0.8Hz, 0.5Hz, 0.16Hz, 0.08Hz, 0.05Hz\",\"CMRR\":\"\\u2265100 dB\",\"Noise\":\"\\u22640.5 uVRMS\",\"Internal memory\":\"Built-in Flash memory card (2GB)\",\"Operative Temperature\":\"\\u00b110 \\u00b0C  ~ +50 \\u00b0C\",\"Operative Humidity\":\"30% ~ 80%\",\"Power supply\":\"AC 240 V 50\\/60 Hz 2A\",\"Dimensions\":\"130 x 89 x 40 mm\",\"Weight\":\"250 g\"}', 'Used in sleep clinics, psychiatric wards and neurology departments to monitor seizure disorders, evaluate patient’s cognitive stat