(54, 'KEEG-A101', 'EEG Machine KEEG-A101', 1, 'A1', 0, 96, 'EEG Machine KEEG-A101 is a Professional EEG suitable for all standard applications of routine and long term EEG configurable in various set-ups. High quality real-time EEG signal acquisition and display. Compact, continuous monitoring device with USB connectivity for data transmission. Combined display of configuration chart and channel configuration source simplifies channel editing', '', '', 'All-in-one monitoring electrode cap </br>\nReal-time monitoring</br>\nAccurate readings and printable waveforms </br>\nConfiguration: ERP with A/V stimulator & synchronized video monitoring (Optional)</br>\nConnectivity : USB', '', '', '', '{\"Input channel\":\"32\\/64\\/128 channels Monopolar EEG\",\"Recording modes\":\"Real-time\",\"Sampling Rate\":\"128, 256, 512, 1024, 2048, 4096, 8192 Hz\",\"Evoke Stimulator\":\"A\\/V Simulator\\/ Video Signal, Current Stimulator\",\"A\\/ Converter\":\"24 bit\",\"Electrodes\":\"All-in-one monitoring electrode cap\",\"Data format\":\"EDF or TXT format\",\"USB Interface\":\"USB 2.0\\/  USB 1.1 (HDMI Interface)\",\"Hours of operation\":\"72 hours continuous operation\",\"Calibration\":\"Built-in impedance testing function and automatic calibration\",\"Input impedance\":\"\\u226510 MOhm\",\"Low-pass filter\":\"1 Hz ~ 120 Hz\",\"High-pass filter (Time)\":\"0.01s - 0.3s\",\"High-pass filter (Hz)\":\"\",\"CMRR\":\"\\u2265100 dB\",\"Noise\":\"\\u22640.5 uVRMS\",\"Internal memory\":\"\",\"Operative Temperature\":\"\\u00b110 \\u00b0C  ~ +50 \\u00b0C\",\"Operative Humidity\":\"30% ~ 80%\",\"Power supply\":\"(External) AC 100\\uff5e240 V\\/ DC \\u2013 19 V\\n(Internal) Rechargeable lithium battery(16.8v)\",\"Dimensions\":\"510 x 450 x 230 mm\",\"Weight\":\"11 Kg\"}', 'Used in sleep clinics, psychiatric wards and neurology departments to monitor seizure disorders, evaluate patient’s cognitive states, identify lesion sites and study the effect of drugs and psychological treatment.', '', '<tab