(56, 'KEMG-A100', 'Electromyography KEMG-A100', 1, 'A1', 0, 30, 'Electromyography KEMG-A100 is a 4-channel digital neurophysiological EMG/EP recording unit. System utilizes stimulator-coupled amplifier for compact system assembly. Functional electric stimulator generates single and dual current stimulation for optimal diagnostic evaluation of the condition.', '', '', 'Nerve/Muscle colour-mapping </br> \nModular A/V stimulator </br> \nSuitable for Acoustic or Visual EP test protocols </br> \nSuitable for NCV examination studies', '', '', '', '{\"Number of channels\":\"4 channel\",\"Stimulus Modes\":\"Single-current, Dual-current Stimulator\",\"Stimulus Frequency\":\"0.1 Hz ~ 50 Hz\",\"Sample Rate\":\"200 KHz\",\"Analysis Time\":\"1 ms ~ 1000 ms\",\"CMRR\":\">110 dB\",\"Amplitude Frequency\":\"1 Hz ~ 5 Hz\",\"Impedance\":\"> 1000 M\\u2126\",\"0.1\\u00a0\\u00a0 H7:I23\\u2053 100 Hz, Error <\\u00b1 10%\":\"1 ~ 5000 times\",\"Test Protocols : EMG\":\"Motor Unit Potential (MUP) <\\/br> Interference phase (IP) <\\/br> Scanning EMG (QEMG)\",\"Test Protocols : EP\":\"SEP : USEP \\/ LESEP \\/ TSEP \\/ SCEP <\\/br> AEP :  BAEP \\/ MAEP \\/ LAEP \\/ Eooch G, 40Hz <\\/br> VEP : PRVEP \\/ FVEP \\/ ERG \\/ EOG\",\"Test Protocols : NCV\":\"MCV \\/ SCV \\/ SSCT \\/ RNS \\/ F-wave \\/ H-reflex \\/ Blink reflex \\/ SSR\",\"Max Higher Filters Frequency\":\"50 Hz\",\"Min Lower Filters Frequency\":\"0.1 Hz\",\"A\\/D Conversion Rate\":\"24 bit\",\"Stimulus Width\":\"0.1\\u00a0\\u00a0 \\u2053 100 Hz, Error <\\u00b1 10%\",\"Pulse Mode\":\"50 \\u00b5s ~ 1000 \\u00b5s\",\"Pulse Duration Error\":\"Single, Double and Triple pulses\",\"Gain Amplifier\":\"0.05, 0.1, 0.5, 1 ms , Error <\\u00b1 10%\",\"Dimensions\":\"50 times \\u2053 50 million times\",\"Weight\":\"510 x 445 x 205 mm\"}', 'Used in OPD, neurology departments to detect musculature or sensory abnormalities, muscle activation level or to analyze any gait or biomechanics application.', '', '<table class=\"tableizer-table\">\n<thead><tr 