(57, 'KEP-A100', 'Elastomeric Infusion Pump KEP-A100', 1, 'A1', 0, 109, 'Elastomeric Infusion Pump KEP-A100 is a disposable, patient controlled micro-injector infusion device. Soft silicone capsule forms a low-vacuum sterile reservoir for safe drug infusion.  Flow regulator enables constant minimal drop control through the capillary catheter for gentle infusion. One-way pumping mechanism prevents backflow or spillage.', '', '', 'Resilient and durable shell </br>\nNon-electric and safe </br>\nAccurate and controlled flow-rate </br>\nLight protection capsule (Optional)', '', '', '', '{\"Type\":\"Basic, CBI + PCA\",\"Basal Flow rate\":\"2 ml\\/hr, 3 ml\\/hr, 4 ml\\/hr, 5 ml\\/hr, 10 ml\\/hr <\\/br> (default 2 ml\\/hr)\",\"Capacity\":\"60 ml \\/ 100 ml \\/ 150 ml \\/ 200 ml \\/ 275 ml\",\"Pump shell\":\"Silicon pump with ABS closure\",\"PCA Bolus volume\":\"0.5 ml\",\"PCA Lockout time\":\"15 min\"}', 'Used in maternity wards, general wards and ambulatory use to administer liquid drugs such as epidural anesthetics, analgesics, for intravenous, intra-arterial, epidural or subcutaneous infusion based pain management or bladder irrigation.', '', '', '', 'Elastomeric Infusion Pump KEP-A100', 'Medical Disposables | Elastomeric Infusion Pump KEP-A100', 'KEP-A100', 'Elastomeric Infusion Pump KEP-A100 is a disposable, patient controlled micro-injector infusion device. Soft silicone capsule forms a low-vacuum sterile reservoir for safe drug infusion.  Flow regulator enables constant minimal drop control through the capillary catheter for gentle infusion. One-way pumping mechanism prevents backflow or spillage.', '', '', 'Elastomeric Infusion Pump KEP-A100', 'Elastomeric Infusion Pump KEP-A100', '', '{\"small\":\"assets\\/images\\/products\\/Elastomeric-Infusion-Pump-KEP-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Elastomeric-Infusion-Pump-KEP-A100-250x250.jpg\"}', '', 'Medical-Disposables/Elastomeric-Infusion-pump/KEP-A100', 1, '2019-07-24 13:31:21', 1, '2019-07-