(59, 'KBP-A100', 'Electric Breast Pump KBP-A100', 1, 'A1', 0, 43, 'Electric Breast Pump KBP-A100 is a dual expression high pressure electric breast pump with adjustable suction control. Suction pump comprises of feeder system integrated with suction assembly which can be sterilized.  Soft suction cup design simulates natural feeding action for gentle expression. Closed one-way pumping mechanism prevents backflow or spillage.', '', '', 'Double-Expression technology </br>\nLatex-free Clean assembly </br>\nComfortable expression </br>\nSoft petal massage breast shield', '', '', '', '{\"Expression\":\"Double-phase\",\"Construction\":\"Food grade PP and Silicone, BPA free.\",\"Display\":\"LCD display\",\"Modes\":\"Massage and Expression\",\"Feeding Bottle\":\"Night light with Temperature sensor Technology\",\"Operational Levels\":\"9 grades of adjustment\",\"Bottle : Temperature indication\":\"Milk Temp < 40 \\u00b0C \\u2013 yellow <\\/br> Milk Temp > 40 \\u00b0C \\u2013 Fluorescent yellow\",\"Pumping System\":\"Back flow protection mechanism\",\"Power Supply\":\"AC power or Battery\",\"Dimension\":\"290 x 110 x 270 mm\",\"Weight\":\"1 Kg\"}', 'Used in nursing homes, gynecology wards, NICU as well as home-care for either working mothers or to stimulate lactation in women or to relieve engorgement or aid in recovery from pregnancy.', '', '', '', 'Electric Breast Pump KBP-A100', 'Daily Care | Electric Breast Pump KBP-A100', 'KBP-A100', 'Electric Breast Pump KBP-A100 is a dual expression high pressure electric breast pump with adjustable suction control. Suction pump comprises of feeder system integrated with suction assembly which can be sterilized.  Soft suction cup design simulates natural feeding action for gentle expression. Closed one-way pumping mechanism prevents backflow or spillage.', '', '', 'Electric Breast Pump KBP-A100', 'Electric Breast Pump KBP-A100', '', '{\"small\":\"assets\\/images\\/products\\/Electric-Breast-Pump-KBP-A100-150x150.jpg\",\"medium\":\"asse