(61, 'KEMS-A100', 'Electric Mobility Scooter KEMS-A100', 1, 'A1', 0, 99, 'KEMS-A100 is four wheeled electric scooter with adjustable speed range suitable for outdoor and home use. Adjustable seat width and armrest height provides more comfort for all body types.', '', '', 'PG controller<br/> \nAdjustable seat width, armrest height<br/> \nAdjustable seat height according to user weight<br/>   \nStrong , durable plastic wheel hub<br/> \nTruncated by removing seat, basket, battery<br/> \nLead-acid battery<br/> \nSafe electromagnetic and mechanical brake system', '', '', '', '{\"Seat width\":\"435 mm\",\"Motor\":\"24 V \\/180 W brush motor\",\"Seat height\":\"520 mm\",\"Seat depth\":\"330 mm\",\"Speed\":\"6 Km\\/hr\",\"Driving distance\":\"20 Km\",\"Battery\":\"12 V \\/ 12 Ah\",\"Max load\":\"120 Kgs\",\"Wheel size\":\"8 inch\",\"Dimension\":\"1020 \\u00d7 500 \\u00d7 840 mm\",\"Net weight\":\"47 Kg\"}', 'Used in hospitals and homes provide good balance for patient during travelling.', '', '', '', 'Electric Mobility Scooter KEMS-A100', 'Mobility Aids | Electric Mobility Scooter KEMS-A100', 'KEMS-A100', 'KEMS-A100 is four wheeled electric scooter with adjustable speed range suitable for outdoor and home use. Adjustable seat width and armrest height provides more comfort for all body types.', '', '', 'Electric Mobility Scooter KEMS-A100', 'Electric Mobility Scooter KEMS-A100', '', '{\"small\":\"assets\\/images\\/products\\/Electric-Mobility-Scooter-KEMS-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Electric-Mobility-Scooter-KEMS-A100-250x250.jpg\"}', '', 'Mobility-Aids/Mobility-Scooter/KEMS-A100', 1, '2019-07-24 13:36:26', 1, '2019-07-24 08:06:26'),
