(67, 'KES-A100', 'Electric Stretcher KES-A100', 1, 'A1', 0, 62, 'KES-A100 is a functional stretcher with a provision of five movements namely backrest and footrest movement, height adjustment, trendelenburg and anti-trendelenburg position control. Equipped with electric motors for effortless lifting operation and electric control panel for operational monitoring and controlling.', '', '', 'Electric motors<br/>\nSpring controlled back section, manually controlled foot rest<br/>  \nAluminum alloy handrails provide safety protection<br/>\nCPR handle at head side for quickly lowering the head section<br/>\nSteel bottom platform<br/>  \nEntire bed platform with x-ray cassette for imaging<br/> \nElectric control pedal<br/>\nRise and fall fifth guide wheels<br/>\nPU cover water proof mattress prevent dust mites  and allergies<br/> \nIV pole, IV pole holders<br/> \nCentral locking function', '', '', '', '{\"Trendelenburg\":\"15 \\u00b0\",\"Variable height\":\"720 \\u2013 950 mm\",\"Backrest  upward angle\":\"75 \\u00b0\",\"Footrest upward angle\":\"45 \\u00b0\",\"Anti-trendelenburg\":\"15 \\u00b0\",\"Weight capacity\":\"250 Kgs\",\"Mattress thickness\":\"80 mm\",\"Dimension\":\"2100 \\u00d7 850 \\u00d7 720  \\u2013  950 mm\"}', 'Used in hospitals, nursing homes for long stay.', '', '', '', 'Electric Stretcher KES-A100', 'Patient Transfer Solutions | Electric Stretcher KES-A100', 'KES-A100', 'KES-A100 is a functional stretcher with a provision of five movements namely backrest and footrest movement, height adjustment, trendelenburg and anti-trendelenburg position control. Equipped with electric motors for effortless lifting operation and electric control panel for operational monitoring and controlling.', '', '', 'Electric Stretcher KES-A100', 'Electric Stretcher KES-A100', '', '{\"small\":\"assets\\/images\\/products\\/Electric-Stretcher-KES-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Electric-Stretcher-KES-A100-250x250.jpg\"}', '', 'Patient-Transfer-Soluti