(70, 'KEW-A100', 'Electric Wheelchair KEW-A100', 1, 'A1', 0, 66, 'KEW-A100 is an electrically-powered standing wheelchair with smooth motorized control for effortless reclining, tilting and seat elevation. Adjustable seating as per various body shapes improve the comfort and ride quality. Incorporates leather look fabric cushion which allows easy cleaning. 50 psi pneumatic tires facilitate comfortable use on all types of ground. It is portable, light weight and ensures patient safety.', '', '', 'Seat, back rest, neck rest and knee pads<br/>\nDual motorized drivers<br/> \nRemovable lithium batteries with on board chargeability<br/>\nFully charged battery travel up to 50 Km<br/> \nPneumatic tires provide essential comfort<br/> \n360° joystick controller<br/> \nElectromagnetic brake system', '', '', '', '{\"Seat width\":\"450 mm\",\"Seat height\":\"560 mm\",\"Driving motor\":\"320 W\",\"Seat depth\":\"450 mm\",\"Arm rest height\":\"360 mm\",\"Slope capacity\":\"12 \\u00b0\",\"Max load\":\"150 Kg\",\"Max speed\":\"\",\"Battery\":\"12 V \\/ 20 Ah\",\"Front wheel\":\"18 \\u00d7 2.5 inch\",\"Back tires\":\"2.5 inch\",\"Dimension\":\"1120 \\u00d7 660 \\u00d7 1100 mm\",\"Weight\":\"125 Kgs\"}', 'Used by physically disabled patient for whom walking is difficult. These are capable of travelling long distances. Used in Hospitals, Clinics and at home for Geriatric patient.', '', '', '', 'Electric Wheelchair KEW-A100', 'Mobility Aids | Electric Wheelchair KEW-A100', 'KEW-A100', 'KEW-A100 is an electrically-powered standing wheelchair with smooth motorized control for effortless reclining, tilting and seat elevation. Adjustable seating as per various body shapes improve the comfort and ride quality. Incorporates leather look fabric cushion which allows easy cleaning. 50 psi pneumatic tires facilitate comfortable use on all types of ground. It is portable, light weight and ensures patient safety.', '', '', 'Electric Wheelchair KEW-A100', 'Electric Wheelchair KEW-A100', '', '{\"smal