(71, 'KEW-A101', 'Electric Wheelchair KEW-A101', 1, 'A1', 0, 66, 'KEW-A101 features padded cushion made of high-quality washable and breathable fabric which is easily removable for maintenance. High strength aluminum alloy frame supported by double cross bar improves stability and safety. Foldable wheelchair frame and backrest design makes it easy to carry along and store for travel. Non-pneumatic, anti-puncture front and back polyurethane tires ensure comfortable ride.', '', '', 'Double crossed welded aluminum alloy frame<br/>\nHigh quality breathable fiber seat cushion<br/> \nFoldable wheelchair frame and backrest<br/> \nAdjustable flipping foot pedal<br/>\nNon-pneumatic anti-puncture tire', '', '', '', '{\"Seat width\":\"410 mm\",\"Seat height\":\"520 mm\",\"Driving motor\":\"250 W\",\"Seat depth\":\"450 mm\",\"Arm rest height\":\"200 mm\",\"Slope capacity\":\"\",\"Max load\":\"100 Kg\",\"Max speed\":\"9 Km\\/hr\",\"Battery\":\"12 V \\/ 12 Ah\",\"Front wheel\":\"190 mm\",\"Back tires\":\"550 mm\",\"Dimension\":\"970 \\u00d7 700 \\u00d7 960  mm\",\"Weight\":\"42.4 Kgs\"}', 'Used by physically disabled patient for whom walking is difficult. These are capable of travelling long distances. Used in Hospitals, Clinics and at home for Geriatric patient.', '', '', '', 'Electric Wheelchair KEW-A101', 'Mobility Aids | Electric Wheelchair KEW-A101', 'KEW-A101', 'KEW-A101 features padded cushion made of high-quality washable and breathable fabric which is easily removable for maintenance. High strength aluminum alloy frame supported by double cross bar improves stability and safety. Foldable wheelchair frame and backrest design makes it easy to carry along and store for travel. Non-pneumatic, anti-puncture front and back polyurethane tires ensure comfortable ride.', '', '', 'Electric Wheelchair KEW-A101', 'Electric Wheelchair KEW-A101', '', '{\"small\":\"assets\\/images\\/products\\/Electric-Wheelchair-KEW-A101-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Electric