(72, 'KES-A200', 'Emergency Stretcher KES-A200', 1, 'A2', 0, 62, 'Emergency Stretcher KES-A200 comes with a streamlined design, so that it can transport patient efficiently and speedily. The device has additional function of Knee Gatch Position that helps the patient to grap rails and bend knees so feet are flat on the bed. Device is ideal for dynamic environment of the Recovery room and ER. It has the loading capacity of 700lbs to treat patients with different weights.', '', '', 'Four wheels with central brake </br>\nFifth wheel offers direction </br>\nProvides best safety for patient </br>\nLoading capacity is quite high </br>\nIntegrated storage tray with oxygen tank </br>\nFoot pedal with hydraulic system </br>\nFour section bed board structure </br>\nVelcro tape underneath the mattress', '', '', '', '{\"Mattress\":\"8 cm, (195 cm x 66 cm) \\u00b1 2\",\"Overall length\":\"213 cm\",\"Overall width\":\"81\\/85 cm\",\"Weight capacity\":\"700 lbs\",\"Height range(ground to litter top)\":\"High: 89 cm \\u00b1 1\\nLow: 54 cm \\u00b1 1\",\"Litter positioning\":\"Backrest: 0-90\\u00b0 \\nTrend\\/reverse trend: 0-18\\u00b0\",\"Patient surfacing\":\"(193 cm \\u00d7 64 cm) \\u00b1 2\",\"Side rail\":\"141 cm \\u00d7 48 cm\",\"Caster diameter\":\"20 cm\",\"Protective corner bumper\":\"4\",\"Two stages IV pole inserted hole\":\"5\",\"Two stages movable IV rod\":\"1\",\"Permanent folding IV rod\":\"1\",\"Knee gatch\":\"0\\u00b0 - 40\\u00b0\",\"Manual knee gatch\":\"0\\u00b0 - 50\\u00b0\",\"Backrest bent angle\":\"0\\u00b0 - 90\\u00b0\",\"Foot board bent angle\":\"0\\u00b0 - 40\\u00b0\"}', 'Used in operating rooms, surgical care wards, intensive care unit, and other departments for pulmonary life-support during acute lung injury or respiratory distress which result in inadequate oxygenation or ventilation inability to protect the airway fluids.', '', '', '', 'Emergency Stretcher KES-A200', 'Patient Transfer Solutions | Emergency Stretcher KES-A200', 'KES-A200', 'Emergency Stretcher KES-A200 comes with a streamlined design, so that it can transport patient efficiently and speedily. The device has additional function of Knee Gatch Position that helps the patient to grap rails and bend knees so feet are flat on the bed. Device is ideal for dynamic environment of the Recovery room and ER. It has the loading capacity of 700lbs to treat patients with different weights.', '', '', 'Emergency Stretcher KES-A200', 'Emergency Stretcher KES-A200', '', '{\"small\":\"assets\\/images\\/products\\/Emergency-Stretcher-KES-A200-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Emergency-Stretcher-KES-A200-250x250.jpg\"}', '', 'Patient-Transfer-Solutions/Stretchers/KES-A200', 1, '2019-07-24 13:56:46', 1, '2019-07-24 08:26:46'),
(73, 'KOL-A100', 'Examination Light KOL-A100', 1, 'A1', 0, 47, 'Examination Light KOL-A100 features high intensity halogen light as light source which reduces the heating and power requirement. Designed to use by medical personnel for individual medical examination and small procedures.', '', '', 'Halogen bulb on wheeled stand<br/>\nHigh intensity light for accurate diagnosis<br/>\nHigh bulb life<br/>\nAdjustable light brightness<br/>', '', '', '', '{\"Max illumination intensity\":\"30000 lx\",\"Light source\":\"Halogen\",\"Color temperature\":\"3600 \\u00b1 200k\",\"Bulb power\":\"35 W\",\"Bulb voltage\":\"12 V\",\"Bulb life\":\"4000 hr.\",\"Suitable illumination distance\":\"300 to 800 mm\"}', 'Used in emergency room, recovery rooms and ICU’s etc.', '', '', '', 'Examination Light KOL-A100', 'OR Solutions | Examination Light KOL-A100', 'KOL-A100', 'Examination Light KOL-A100 features high intensity halogen light as light source which reduces the heating and power requirement. Designed to use by medical personnel for individual medical examination and small procedures.', '', '', 'Examination Light KOL-A100', 'Examination Light KOL-A100', '', '{\"small\":\"assets\\/images\\/products\\/Examination-Light-KOL-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Examination-Light-KOL-A100-250x250.jpg\"}', '', 'OR-Solutions/Surgical-and-Examination-Lights/KOL-A100', 1, '2019-07-24 14:01:13', 1, '2019-07-24 08:31:13'),
