(75, 'KCTG-A100', 'Fetal Monitor KCTG-A100', 1, 'A1', 0, 86, 'Fetal Monitor KCTG-A100 is a continuous monitoring cardiotocography machine with wide LCD display screen. System analyzes the fetal heart rate (FHR) and uterine activity (UA) patterns, as well as trend characteristics of variability and decelerations. Time stamped event marking allows to cross-verify records and further analysis of the curve to enhance data storage.', '', '', 'Dual channel monitoring : UC/TOCO and FHR </br>\nWireless access </br>\nAuto monitoring for alarms </br>\nMulti-event marking </br>\n24 hours CTG data storage and review  </br>\nTwin monitoring module (Optional)', '', '', '', '{\"Display\":\"12.1\\u201d LCD display\",\"Ultrasound frequency\":\"1024 (1 \\u00b1 10%) kHz\",\"Max output intensity\":\"< 10 MW\\/cm<sup>2<\\/sup>\",\"FHR measurement range\":\"30 bpm \\uff5e 240 bpm\",\"FHR  sensitivity\":\"\\u2264 2 bpm\",\"FHR alarm range\":\"30 bpm \\uff5e 240 bpm\",\"Alarm time\":\"\\u2264 30s\",\"Alarm limits\":\"FHR Higher [User defined] <\\/br> FHR Lower [User defined]  <\\/br> TOCO Higher [User defined] <\\/br> TOCO Lower [User defined]\",\"TOCO measurement range\":\"0 \\uff5e 100 units\",\"TOCO baseline\":\"0 \\uff5e 20 units\",\"TOCO sensitivity\":\"\\u2264 10 %\",\"Recorder paper speed\":\"1,2,3 cm\\/min\",\"Recorder deviation\":\"\\u2264 5 %\",\"Print duration\":\"5 min \\u2013 240 min\",\"Safety standard\":\"Class I, BF type\",\"Storage temperature range\":\"40\\u2103 ~ 55\\u2103\",\"Storage relative humidity\":\"\\u2264 93 %\",\"Storage pressure range\":\"500 hPa ~ 1060hPa\",\"Operational temperature range\":\"10\\u00b0C ~ 40\\u00b0C\",\"Relative humidity\":\"\\u2264 80 %\",\"Atmosphere pressure\":\"70 kPa \\uff5e 106 kPa\",\"Weight\":\"4.5 Kgs\"}', 'Used in nursing homes, gynecology wards, delivery rooms for assessment of maternal uterine activity, FHR and FM during the period from 4th week till parturition.', '', '<table class=\"tableizer-table\">\n<thead><tr class=\"tableizer-firstrow\"><th>Sr.</th><th>Accessories</th><th>Qty</th></tr></thead><tbody>\n <tr><td>1</td><td>FHR US Transducer</td><td>1</td></tr>\n <tr><td>2</td><td>TOCO Transducer</td><td>1</td></tr>\n <tr><td>3</td><td>TOCO probe</td><td>1</td></tr>\n <tr><td>4</td><td>Marker</td><td>1</td></tr>\n <tr><td>5</td><td>Binding strap</td><td>2</td></tr>\n</tbody></table>', '', 'Fetal Monitor KCTG-A100', 'Patient Monitoring System | Fetal Monitor KCTG-A100', 'KCTG-A100', 'Fetal Monitor KCTG-A100 is a continuous monitoring cardiotocography machine with wide LCD display screen. System analyzes the fetal heart rate (FHR) and uterine activity (UA) patterns, as well as trend characteristics of variability and decelerations. Time stamped event marking allows to cross-verify records and further analysis of the curve to enhance data storage.', '', '', 'Fetal Monitor KCTG-A100', 'Fetal Monitor KCTG-A100', '', '{\"small\":\"assets\\/images\\/products\\/Fetal-Monitor-KCTG-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Fetal-Monitor-KCTG-A100-250x250.jpg\"}', '', 'Critical-Care/Patient-Monitoring-System/Fetal-Monitor/KCTG-A100', 1, '2019-07-24 14:05:34', 1, '2019-07-24 08:35:34'),
(76, 'KFW-A100', 'Folding Power Wheelchair KFW-A100', 1, 'A1', 0, 66, 'KFW-A100 is foldable and portable electrically-powered wheelchair easy to carry along and store for travel. Features detachable and washable seat cushion and backrest and flipping foot pedal. Wheelchair incorporates powerful motors responsible to easily operate wheelchair controller for user comfort.', '', '', 'Portable and foldable electric wheel chair<br/> \nDual motorized operation<br/> \nAluminum alloy frame<br/>  \nDetachable and washable seat cushion and backrest<br/>  \nFlipping foot pedal<br/> \nStable and durable black metal hub<br/> \nSafe electromagnetic brake<br/> \nLithium battery and battery indicator', '', '', '', '{\"Motor\":\"180 W brushless\",\"Max speed\":\"6 Km\\/hr\",\"Fold size\":\"610 \\u00d7 260 \\u00d7 770 mm\",\"Driving distance\":\"20 Km\",\"Seat height\":\"520 mm\",\"Seat width\":\"400 mm\",\"Controller\":\"24 V \\/ 2 A\",\"Grade ability\":\"8 \\u2013 12 \\u00b0\",\"Seat depth\":\"400 mm\",\"Back seat  height\":\"470 mm\",\"Armrest height\":\"220 mm\",\"Backrest height\":\"360 mm\",\"Foot rest height\":\"120 mm\",\"Charging time\":\"6 \\u2013 8 hour\",\"Max load capacity\":\"150 Kgs\",\"Battery\":\"24 V \\/ 10 Ah\",\"Dimension\":\"870 \\u00d7 610 \\u00d7 920  mm\",\"Net weight\":\"23 Kgs (with 1 battery)\"}', 'Used in Hospitals and at Home for geriatric patient. Easily portable because of its folding nature.', '', '', '', 'Folding Power Wheelchair KFW-A100', 'Mobility Aids | Folding Power Wheelchair KFW-A100', 'KFW-A100', 'KFW-A100 is foldable and portable electrically-powered wheelchair easy to carry along and store for travel. Features detachable and washable seat cushion and backrest and flipping foot pedal. Wheelchair incorporates powerful motors responsible to easily operate wheelchair controller for user comfort.', '', '', 'Folding Power Wheelchair KFW-A100', 'Folding Power Wheelchair KFW-A100', '', '{\"small\":\"assets\\/images\\/products\\/Folding-Power-Wheelch