(78, 'KHA-A100', 'Haematology Analyser KHA-A100', 1, 'A1', 0, 87, 'Haematology Analyser KHA-A100 is a fully-automated 20 parameter 3-part WBC differentiation benchtop blood cell counter unit. System features color LCD display, large storage memory, error alarms, 2 counting modes for whole blood and prediluted samples. Internal software system detects mechanical failures, enables calibration facility as well as advanced QC testing for standardized operation at reduced routine servicing. System is equipped with back-flush as well as blockage removal facility to improve hygiene control.', '', '', '8.4-inch color LCD display </br>\nThroughput: 60 samples/hr </br>\nPerforms 20 parameter testing with 3 histogram </br>\nWhole-blood and Pre-diluted modes </br>\nConnectivity options for data transfer </br>\nStores up to 35000 patient records </br>\nBuilt-in thermal printer </br>\nExternal printer (Optional)', '', '', '', '{\"Type\":\"Fully automated 3-part differential system\",\"Throughput\":\"60 samples\\/hr\",\"Principle of Operation\":\"\",\"Testing Parameters\":\"WBC, LYM#, MON#, GRA#, LYM%,MON%, GRA%, RBC, HGB, MCHC, MCH, MCV, PDW, RDW-CV, RDW-SD, HCT, PLT,MPV, P-LCR,  PCT with Histograms for WBC, RBC and PLT.\",\"Accuracy (CV %)\":\"WBC (10<sup>9<\\/sup>\\/L) : 2.0 % (7.0 - 15.0) <\\/br>\\nRBC (10<sup>12<\\/sup>\\/L) : 1.5 % (3.50 - 6.00) <\\/br>\\nHGB (g\\/L) : 1.5 %  (110 - 180) <\\/br>\\nMCV (fL) : 0.4 % (80.0 - 110.0) <\\/br>\\nPLT (10<sup>9<\\/sup>\\/L) : 4 % (100 - 500)\",\"Linear Range\":\"\",\"Sample Mode\":\"\",\"Test Mode\":\"\",\"Screen Display\":\"8.4\\u201d display color LCD\",\"Resolution\":\"640 x 480\",\"Sample Volume\":\"Pre-diluted : 20 \\u00b5L <\\/br>\\nWhole blood : 9.8 \\u03bcL\",\"Reagents\":\"\",\"Aperture Diameter\":\"WBC : 80\\u00b5m <\\/br>\\nRBC : 50\\u00b5m\",\"Carryover\":\"WBC \\/ RBC \\/ HGB <0.5 %\\nPLT<1.0 %\",\"QC\":\"\",\"Connectivity\":\"LAN, USB, RS-232\",\"Printer\":\"Built-in Thermal printer\",\"Storage\":\"35,000 records\",\"Operating Temperature\":\"15 \\u00b0C to 35 \\u00b0C\",\"Humidity\":\"10 % - 90 %\",\"Maintenance\":\"\",\"Power Supply\":\"AC 110 V \\u2013 220 V, 50 \\/ 60 Hz\",\"Dimensions\":\"436 x 363 x 367 mm\",\"Weight\":\"18 Kgs\"}', 'Used in diagnostic laboratories, pathological diagnostic centers to characterize blood cells, determine their count and cell volume for in-vitro pathological diagnosis of blood samples to meet qualifying performance requirements and standardized results for multiple sample analysis.', '', '', '', 'Haematology Analyser KHA-A100', 'Laboratory Analyser | Haematology Analyser KHA-A100', 'KHA-A100', 'Haematology Analyser KHA-A100 is a fully-automated 20 parameter 3-part WBC differentiation benchtop blood cell counter unit. System features color LCD display, large storage memory, error alarms, 2 counting modes for whole blood and prediluted samples. Internal software system detects mechanical failures, enables calibration facility as well as advanced QC testing for standardized operation at reduced routine servicing. System is equipped with back-flush as well as blockage removal facility to improve hygiene control.', '', '', 'Haematology Analyser KHA-A100', 'Haematology Analyser KHA-A100', '', '{\"small\":\"assets\\/images\\/products\\/Haematology-Analyser-KHA-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Haematology-Analyser-KHA-A100-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/Hematology-Analyser/KHA-A100', 1, '2019-07-24 14:13:11', 1, '2019-07-24 08:43:11'),
