laboratories, pathological diagnostic centers to characterize blood cells, determine their count and cell volume for in-vitro pathological diagnosis of blood samples to meet qualifying performance requirements and standardized results for multiple sample analysis.', '', '', '', 'Haematology Analyser KHA-A200', 'Laboratory Analyser | Haematology Analyser KHA-A200', 'KHA-A200', 'Haematology Analyser KHA-A200 is a fully-automated 20 parameter 3-part WBC differentiation benchtop blood cell counter unit. System features LCD display, error alarms, 2 counting modes for whole blood and prediluted samples. Internal software system detects failures, enables calibration facility, QC testing and steers automatic probe wash to prevent sample carryover phenomenon. Safe reagents ensure eco-friendly operational standards to be maintained.', '', '', 'Haematology Analyser KHA-A200', 'Haematology Analyser KHA-A200', '', '{\"small\":\"assets\\/images\\/products\\/Haematology-Analyser-KHA-A200-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Haematology-Analyser-KHA-A200-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/Hematology-Analyser/KHA-A200', 1, '2019-07-24 14:13:11', 1, '2019-07-24 08:43:13'),
(81, 'KHA-B100', 'Haematology Analyser KHA-B100', 1, 'B1', 0, 87, 'Haematology Analyser KHA-B100 is a fully-automated 28 parameter 5-part WBC differentiation benchtop blood cell counter unit. System adopts 3D topographic WBC mapping to illustrate different properties of WBC. Integrated Ti incubation system ensures constant temperature for accurate 5-part differentiation. Multiple QC protocols and calibration function allows standardized operation. User-oriented software provides large data storage, alarms, LIS interface, flexible data management system with versatile formats.', '', '', 'Flow Cytometry technology </br>\nContinuous linear shealth flow technique </br>\nNon-toxic reagents </br>\nDesktop for display and user interface </br>\nThroughput: 60 samples/hr </br>\nPerforms 28 parameter testing with 2 histogram and 2 scatter gram </br>\nWhole-blood and Pre-diluted sample modes </br>\nCBC+Diff and CBC test modes </br>\nStores up to 1, 00, 000 patient records </br>\nBuilt-in thermal printer </br>\nExternal printer (Optional)', '', '', '', '{\"Type\":\"Fully automated 5-part differential system\",\"Throughput\":\"60 samples\\/hr\",\"Principle of Operation\":\"\",\"Testing Parameters\":\"WBC, RBC, HGB. HCT, MCV, MCH, MCHC, RDW-SD, RDW-CV, PLT, PDW, MPV, PCT, P-LCR, NEU#, NEU%, LYM#, LYM%, MON#, MON%, EOS#, EOS%, BAS#, BAS%, ALY#, ALY%, IG#, IG%, 2 histograms, 2 scatter grams.\",\"Accuracy (CV %)\":\"WBC (10<sup>9<\\/sup>\\/L) : 2.0 %  <\\/br>\\nRBC (10<sup>12<\\/sup>\\/L) : 1.5 % <\\/br>\\nHGB (g\\/L) : 1.5 %  <\\/br>\\nPLT (10<sup>9<\\/sup>\\/L) : 4 %\",\"Linear Range\":\"WBC (10<sup>9<\\/sup>\\/L) : 1.0 \\u2013 99.9 <\\/br>\\nRBC (10<sup>12<\\/sup>\\/L) : 0.3 \\u2013 7.0 <\\/br>\\nHGB (g\\/L) : 20 \\u2013 24 <\\/br>\\nPLT (10<sup>9<\\/sup>\\/L) : 20 \\u2013 999\",\"Sample Mode\":\"Pre-diluted <\\/br>\\nWhole blood\",\"Test Mode\":\"CBC+5DIFF test <\\/br>\\nCBC test\",\"Screen Display\":\"\",\"Resolution\":\"\",\"Sample Volume\":\"\",\"Reagents\":\"\",\"Aperture Diameter\":\"\",\"Carryover\":\"WBC \\/ RBC \\/ HGB <0.5 %\\nPLT<1.0 %\",\"QC\":\"\",\"Connectivity\":\"LIS interface with HL7\",\"Printer\":\"Built-in Thermal printer\",\"Storage\":\"1,00,000 records\",\"Operating Temperature\":\"15 \\u00b0C to 30 \\u00b0C\",\"Humidity\":\"30 % - 85 %\",\"Maintenance\":\"\",\"Power Supply\":\"AC 110 V \\u2013 220 V, 50 \\/ 60 Hz\",\"Dimensions\":\"460 x 570 x 610 mm\",\"Weight\":\"53 Kgs\"}', 'Used in diagnostic laboratories, pathological diagnostic centers to characterize blood cells, determine their count and cell volume for in-vitro pathological diagnosis of blood samples to meet qualifying performance requirements and standardized results for multiple sample analysis.', '', '', '', 'Haematology Analyser KHA-B100', 'Laboratory Analyser | Haematology Analyser KHA-B100', 'KHA-B100', 'Haematology Analyser KHA-B100 is a fully-automated 28 parameter 5-part WBC differentiation benchtop blood cell counter unit. System adopts 3D topographic WBC mapping to illustrate different properties of WBC. Integrated Ti incubation system ensures constant temperature for accurate 5-part differentiation. Multiple QC protocols and calibration function allows standardized operation. User-oriented software provides large data storage, alarms, LIS interface, flexible data management system with versatile formats.', '', '', 'Haematology Analyser KHA-B100', 'Haematology Analyser KHA-B100', '', '{\"small\":\"assets\\/images\\/products\\/Haematology-Analyser-KHA-B100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Haematology-Analyser-KHA-B100-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/Hematology-Analyser/KHA-B100', 1, '2019-07-24 14:13:11', 1, '2019-07-24 08:43:13');
