(82, 'KHA-C100', 'Veterinary Haematology Analyser KHA-C100', 1, 'C1', 0, 87, 'Veterinary Haematology Analyser KHA-C100 is a fully-automated multi-species 19 parameter 3-part WBC differentiation benchtop blood cell counter unit. System features high resolution color LCD display with 12 pre-defined and 4 user-defined programs (optional) for accurate species-specific analysis. Internal software enables auto reverse flush and high voltage burning, clog clearing for blockage removal.', '', '', 'Throughput: 30 samples/hr </br>\nParameters : WBC, GRA#, LYM%, MON%, NEU%, BAS%,EOS%,#LYM,#EOS,#MON,#BAS, RBC, HGB, MCHC, MCH, MCV, PDW, RDW-CV, RDW-SD, HCT, PLT,MPV, P-LCR,  PCT and PLCC with 2 Histograms for WBC, RBC and PLT and 4 scatter grams for WBC differential </br>\nPerforms 19 parameter testing with 3 histogram </br>\nNon-toxic cyanide-free method for HGB </br>\nSample modes : Whole blood and Prediluted </br>\n12 Pre-defined species-wise programs with 4 programmable settings </br>\nSuitable for 7 species including Canine, Feline, Equine, etc </br>\nRS232 and USB connectivity for data transfer </br>\nAlert alarms as per species selected </br>\nSoft touch-key user panel </br>\nStores up to 35,000 patient records </br>\nBuilt-in Thermal printer </br>\nExternal Printer (Optional)', '', '', '', '{\"Type\":\"Fully automated 3-part differential system\",\"Throughput\":\"30 samples\\/hr\",\"Principle of Operation\":\"Impedance, SFT method\",\"Testing Parameters\":\"\",\"Accuracy (CV %)\":\"WBC(10<sup>9<\\/sup>\\/L) : 2.0 % <\\/br>\\nRBC (10<sup>12<\\/sup>\\/L) : 1.5 %  <\\/br>\\nHGB (g\\/L) : 1.5 %  <\\/br>\\nMCV (fL) : 0.5 % <\\/br>\\nPLT (10<sup>9<\\/sup>\\/L) : 4.0 %\",\"Linear Range\":\"\",\"Sample Mode\":\"Pre-diluted <\\/br>\\nWhole blood\",\"Test Mode\":\"\",\"Screen Display\":\"High resolution large color LCD\",\"Resolution\":\"800 x 600\",\"Sample Volume\":\"Pre-diluted : 20 \\u00b5L <\\/br>\\nWhole blood : 9 - 20 \\u00b5L\",\"Reagents\":\"Non-toxic cyanide-free reagents\",\"Aperture Diameter\":\"\",\"Carryover\":\"\",\"QC\":\"\",\"Connectivity\":\"RS232, USB\",\"Printer\":\"Built-in Thermal printer\",\"Storage\":\"35,000 records with 3 histograms\",\"Operating Temperature\":\"10 \\u00b0C to 30 \\u00b0C\",\"Humidity\":\"0.7\",\"Maintenance\":\"Auto reverse flush and high voltage burning, clog clearing\",\"Power Supply\":\"AC 100 V \\u2013 240 V, 50 \\/ 60 Hz\",\"Dimensions\":\"273 \\u00d7 420 \\u00d7 415 mm\",\"Weight\":\"16 Kgs\"}', 'Used in veterinary diagnostic clinical laboratories and hospitals to characterize blood cells, determine cell count and cell volume for in-vitro species-specific pathological diagnosis of blood samples to meet qualifying performance requirements and standardized results.', '', '', '', 'Veterinary Haematology Analyser KHA-C100', 'Laboratory Analyser | Veterinary Haematology Analyser KHA-C100', 'KHA-C100', 'Veterinary Haematology Analyser KHA-C100 is a fully-automated multi-species 19 parameter 3-part WBC differentiation benchtop blood cell counter unit. System features high resolution color LCD display with 12 pre-defined and 4 user-defined programs (optional) for accurate species-specific analysis. Internal software enables auto reverse flush and high voltage burning, clog clearing for blockage removal.', '', '', 'Veterinary Haematology Analyser KHA-C100', 'Veterinary Haematology Analyser KHA-C100', '', '{\"small\":\"assets\\/images\\/products\\/Veterinary-Haematology-Analyser-KHA-C100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Veterinary-Haematology-Analyser-KHA-C100-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/Hematology-Analyser/KHA-C100', 1, '2019-07-24 14:13:11', 1, '2019-07-24 08:43:14'),
(83, 'KHA-C101', 'Veterinary Haematology Analyser KHA-C101', 1, 'C1', 0, 87, 'Veterinary Haematology Analyser KHA-C101 is a fully-automated multi-species 25 parameter 5-part WBC differentiation benchtop blood cell counter unit. System features 10.4-inch LCD touch screen, real-time monitoring, hardware diagnosis and one-touch basic troubleshoot. Internal software enables calibration facilities as well as advanced QC testing for standardized operation at reduced routine servicing. System is equipped with high pressure flush for blockage removal.', '', '', 'Triangle laser scatter with flow cytometry technology </br>\nThroughput: 60 samples/hr </br>\nPerforms 25 parameter testing with 2 histogram and 4 scatter gram </br>\nIntegrated patient record management system </br>\nLIS connectivity for data transfer </br>\nNon-toxic cyanide-free method for HGB </br>\nSuitable for Canine, Feline, Equine, and other species </br>\nSample modes : CBC+Diff and Pre-diluted </br>\nStores up to 60,000 patient records </br>\nBuilt-in Thermal printer (External printer) </br>\nBuilt-in Barcode scanner (Optional)', '', '', '', '{\"Type\":\"Fully automated 5-part differential system\",\"Throughput\":\"60 samples\\/hr\",\"Principle of Operation\":\"Impedance, Colorimetry\",\"Testing Parameters\":\"\",\"Accuracy (CV %)\":\"WBC (10<sup>9<\\/sup>\\/L) : (0 - 100) <\\/br>\\nRBC (10<sup>12<\\/sup>\\/L) : (0 - 1700) <\\/br>\\nHGB (g\\/L) : (0 - 250) <\\/br>\\nPLT(10<sup>9<\\/sup>\\/L) : (0 - 3000)\",\"Linear Range\":\"\",\"Sample Mode\":\"Pre-diluted <\\/br>\\nWhole blood\",\"Test Mode\":\"\",\"Screen Display\":\"10.4\\u201d display color touchscreen LCD\",\"Resolution\":\"801 x 600\",\"Sample Volume\":\"Pre-diluted : 20 \\u00b5L <\\/br>\\nCBC + Diff mode : 20 \\u00b5L\",\"Reagents\":\"3 (2 Lyses + 1 Diluent) and 1PB cleanser\",\"Aperture Diameter\":\"\",\"Carryover\":\"\",\"QC\":\"3 level LJ graph, XB\",\"Connectivity\":\"1 LAN, 4 USB, HL7 protocol, LIS compliant\",\"Printer\":\"Built-in Thermal printer\",\"Storage\":\"60,000 records with 4 scatter grams and 2 histograms\",\"Operating Temperature\":\"10 \\u00b0C to 30 \\u00b0C\",\"Humidity\":\"\",\"Maintenance\":\"High voltage, High pressure flush and Auto cleaning of probes\",\"Power Supply\":\"AC 100 V \\u2013 240 V, 50 \\/ 60 Hz\",\"Dimensions\":\"430 x 350 x 435 mm\",\"Weight\":\"33 Kgs\"}', 'Used in veterinary diagnostic clinical laboratories and hospitals to characterize blood cells, determine cell count and cell volume for in-vitro species-specific pathological diagnosis of blood samples to meet qualifying performance requirements and standardized results.', '', '', '', 'Veterinary Haematology Analyser KHA-C101', 'Laboratory Analyser | Veterinary Haematology Analyser KHA-C101', 'KHA-C101', 'Veterinary Haematology Analyser KHA-C101 is a fully-automated multi-species 25 parameter 5-part WBC differentiation benchtop blood cell counter unit. System features 10.4-inch LCD touch screen, real-time monitoring, hardware diagnosis and one-touch basic troubleshoot. Internal software enables calibration facilities as well as advanced QC testing for standardized operation at reduced routine servicing. System is equipped with high pressure flush for blockage removal.', '', '', 'Veterinary Haematology Analyser KHA-C101', 'Veterinary Haematology Analyser KHA-C101', '', '{\"small\":\"assets\\/images\\/products\\/Veterinary-Haematology-Analyser-KHA-C101-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Veterinary-Haematology-Analyser-KHA-C101-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/Hematology-Analyser/KHA-C101', 1, '2019-07-24 14:13:11', 1, '2019-07-24 08:43:15'),
(84, 'KHG-A100', 'Haemoglobinometer KHG-A100', 1, 'A1', 0, 21, 'Abimed Haemoglobinometer KHG-A100 is assembled with the microcomputer with characters of intelligence, adjustable inletting and is reliable in function.', '', '', 'The Haemoglobinometer can be controlled through microcomputer and is accurate in testing of Haemoglobin<br/>\nIt is easy to operate and convenient to use', '', '', '', '{\"Measuring Range\":\"0 - 240 g\\/L\",\"Dilution Ratio\":\"0.21597222222222\",\"Testing Time\":\"< 4secs\",\"Linear Range\":\"< 5 % FS\",\"Standard Setting\":\"0-240 g\\/L adjustable (integral multiple of ten)\",\"Stability\":\"1 g\\/l\\/hr (25\\u00b110 \\u2070C)\",\"Continuous Working Time\":\"\\u2265 10 hrs\",\"Sample Absorption\":\"1-9 ml, ten grades adjustable\",\"Voltage\":\"220 V\\u00b110 %(50\\/60 Hz)\",\"Power Rating\":\"<10 W\",\"Humidity\":\"<85 %\",\"Temperature\":\"25\\u00b110 \\u2070C\",\"Air Pressure\":\"86-106 kPa\"}', 'Used to identify the of amount of Haemoglobin in blood.', '', '', '', 'Haemoglobinometer KHG-A100', 'In-Vitro Diagnostic | Haemoglobinometer KHG-A100', 'KHG-A100', 'Abimed Haemoglobinometer KHG-A100 is assembled with the microcomputer with characters of intelligence, adjustable inletting and is reliable in function.', '', '', 'Haemoglobinometer KHG-A100', 'Haemoglobinometer KHG-A100', '', '{\"small\":\"assets\\/images\\/products\\/Haemoglobinometer-KHG-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Haemoglobinometer-KHG-A100-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Haemoglobinometer/KHG-A100', 1, '2019-07-24 14:24:23', 1, '2019-07-24 08:54:24'),
