(89, 'KGH-A100', 'HbA1c analyzer KGH-A100', 1, 'A1', 0, 89, 'HbA1c analyzer KGH-A100 is an automated high-performance benchtop glycated hemoglobin analyser. Ion-exchange chromatography enables highly accurate area percentage for credible results. Integral high sensitivity photometer enhances accuracy of curvature analysis. In-built thermo-control assembly ensures temperature stability improving repeatability and standardized results.', '', '', 'Micro volume sample consumption </br>\nSample analysis within four minutes </br>\nReal-time summarized chromatogram </br>\nBubble detection and removal </br>\nHIS/LIS system network interface </br>\nAutomated and large data storage', '', '', '', '{\"Measurement range\":\"3 % ~ 18 %\",\"Testing parameters\":\"Precision (CV) < 3 % <\\/br> Accuracy (V) < 1.5 %\",\"Sample type\":\"Venous blood (EDTA anticoagulation), Peripheral finger blood\",\"Sample volume\":\"5 \\u00b5l whole blood for each sample\",\"Photometer\":\"415 nm LED integral flow colorimeter\",\"Sampling mode\":\"(20 samples) position 2 quality control position <\\/br>\\n1 emergency position <\\/br>\\n1 cleaning position <\\/br>\\n1 zero position\",\"Test mode\":\"Automated sample batch test <\\/br> Single sample test\",\"Calibration\":\"2 points or 4 points calibration, <\\/br> Manual or automation with a set of calibrators\",\"Thermostatic control\":\"25 \\u00b1 0.5\\u00b0C (column and reagent thermostatic control)\",\"Reagent matching\":\"Column and reagent consumable \\/ 300 pieces of testing sample\",\"Reagent allocation\":\"A, B, C, D eluent, calibrator, hemolytic agent, pump tubing\",\"Display\":\"320 x 240 LCD graphic display for real-time testing curve\",\"Printer\":\"58mm Thermal printer, printing testing curve and report\",\"Report output\":\"IFCC concentration value <\\/br> NGSP area percentage <\\/br> ADAG average glucose\",\"Data storage\":\"1000 tests report (including testing curve)\",\"Interface\":\"RS-232 interface <\\/br> HIS\\/LIS system interface\",\"Power supply\":\"AC 220V \\/ 50Hz\",\"Working environment\":\"Temperature: 12\\u00b0C ~ 30\\u00b0C <\\/br> Relative Humidity: < 85 %\",\"Dimensions\":\"408 x 390 x 230 mm\",\"Weight\":\"9 Kgs\"}', 'Used in small to medium sized pathological diagnostic laboratories, small or private hospital laboratories and diabetes clinics for monitoring HbA1c level as a long term indicator of diabetic control.', '', '', '', 'HbA1c analyzer KGH-A100', 'Laboratory Analyser | HbA1c analyzer KGH-A100', 'KGH-A100', 'HbA1c analyzer KGH-A100 is an automated high-performance benchtop glycated hemoglobin analyser. Ion-exchange chromatography enables highly accurate area percentage for credible results. Integral high sensitivity photometer enhances accuracy of curvature analysis. In-built thermo-control assembly ensures temperature stability improving repeatability and standardized results.', '', '', 'HbA1c analyzer KGH-A100', 'HbA1c analyzer KGH-A100', '', '{\"small\":\"assets\\/images\\/products\\/HbA1c-analyzer-KGH-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/HbA1c-analyzer-KGH-A100-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/HbA1c-Analyser/KGH-A100', 1, '2019-07-25 06:47:22', 1, '2019-07-25 01:17:22'),
