(108, 'KHM-A100', 'Holter Monitor KHM-A100', 1, 'A1', 0, 108, 'Holter Monitor KHM-A100 is a 24-hour ambulatory  ECG recorder designed to record real-time ECG. System is equipped with OLED screen for waveform preview, record review and event marking. Integrated frequency filters allow anti-jamming and aseismic capability for error free waveforms. Data storage up to 2GB using TF card enables original data to be stored without compression. System performs 12-lead synchro-analysis for distortion-free QRS detection.', '', '', '12-lead synchronous acquisition</br> \nFast review analysis</br>\nAccurate and Quick report generation</br> \nMore than 10 pre-defined modules and user-defined impulse tracking for premature conduction impulses</br>\nECG-analysis function</br>\nPredictive arrhythmia analysis module</br>\nPredictive pacing analysis module</br>\nFlexible channel selection', '', '', '', '{\"Display\":\"OLED 160 x 128 dot matrix display\",\"Storage\":\"Built-in TF card storage for up to 2 GB\",\"Standard Sensitivity\":\"10 mm\\/mV \\u00b1 5%\",\"Sensitivity Shift\":\"\\u2264  \\u00b1 10%\",\"Channel Display\":\"12 Channel\",\"Scan Speed\":\"25 mm\\/s \\u00b1 5%\",\"Pacing Analysis\":\"Dual chamber pacing, Atrial pacing, Ventricular pacing module <\\/br> Ventricular Pseudofusion and Ventricular asynchronous module\",\"Arrhythmia Analysis\":\"MCSSTM and TMCATM\",\"ECG-Analysis\":\"ST segment analysis , HRT analysis, T-Wave alternation,QTD (QT dispersion) <\\/br> VCG (vector cardiogram), VLP (ventricular late potential) and TVCG (time vector cardiogram) analysis\",\"Heart-rate Analysis\":\"Short range : 5 minutes <\\/br> Long range : 1 hour <\\/br> Continuous : 24 hours\",\"Sampling\":\"Sampling Accuracy : 12 Bit <\\/br> Rate of Sampling : 10 kHz\",\"Batteries\":\"2 AA batteries\",\"Interface\":\"USB 2.0\",\"Scale Voltage\":\"1mV \\u00b1 5%\",\"Noise\":\"\\u2264  30\\u00b5V\",\"CMRR\":\"\\u2265 60 dB\",\"Time Constant\":\"\\u2265 3.2 s\",\"Polarization voltage\":\"\\u00b1 300 mV (DC)\",\"Dimension\":\"111 x 60 x 25 mm\",\"Weight\":\"105 g\"}', 'Used in cardiology center to diagnose and detect symptoms of various heart disease and arrhythmias, determine a patient’s response to drug therapy, function of pacemaker and reveal trends or changes in heart function during normal routine activities.', '', '', '', 'Holter Monitor KHM-A100', 'Patient Monitoring System | Holter Monitor KHM-A100', 'KHM-A100', 'Holter Monitor KHM-A100 is a 24-hour ambulatory  ECG recorder designed to record real-time ECG. System is equipped with OLED screen for waveform preview, record review and event marking. Integrated frequency filters allow anti-jamming and aseismic capability for error free waveforms. Data storage up to 2GB using TF card enables original data to be stored without compression. System performs 12-lead synchro-analysis for distortion-free QRS detection.', '', '', 'Holter Monitor KHM-A100', 'Holter Monitor KHM-A100', '', '{\"small\":\"assets\\/images\\/products\\/Holter-Monitor-KHM-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Holter-Monitor-KHM-A100-250x250.jpg\"}', '', 'Critical-Care/Patient-Monitoring-System/Holter-Monitor/KHM-A100', 1, '2019-07-25 07:03:00', 1, '2019-07-25 01:33:00'),
