(112, 'KIV-A101', 'Intensive Care Ventilator KIV-A101', 1, 'A1', 0, 39, 'Intensive Care Ventilator KVI- A101 is a respiratory ventilator unit for invasive artificial respiration. Built-in provision for self-testing and calibration. The device is made up of high configuration intelligent control system that allows changes to be made according to user requirements.', '', '', 'Large screen display for parameter visualization and control </br>\nDesirable display color schemes </br>\nSelf-testing and calibration </br>\nAir compressor support (Optional)', '', '', '', '{\"Tidal Volume\":\"20 ml ~ 500 ml\",\"Standard Ventilation Mode\":\"VCV, SIMV, PSV, PCV, CPAP, Manual, SIGH\",\"Application\":\"Adult\\/ Pediatric  Invasive\",\"Pressure Range\":\"5 mbar ~ 80 mbar\",\"Respiration rate range\":\"1 bpm ~ 99 bpm <\\/br>\\n1 bpm ~ 40 bpm under SIMV\",\"I:E Ratio\":\"4:1 to 1:8\",\"Oxygen Concentration\":\"21 % ~ 100 %\",\"Pressure trigger Range\":\"-20 to 20 cmH2O\",\"PEEP Type\":\"Integrated, Electronic Control\",\"PEEP Range\":\"0 to 30 cmH2O\",\"Gas Supply\":\"O2, Air ( 280 kPa ~ 600 kPa )\",\"Alarm\":\"Visual : No tidal volume, MV, Paw, FiO2 limitation O2, Air failure, AC power failure, low back up <\\/br>\\nAudio: No tidal volume, MV, Paw, FiO2 limitation\",\"Display\":\"12.1\\u201d Color LCD\",\"Graphic Display\":\"Waveforms of P-T, F-T, V-T\",\"Operating Temperature\":\"5 \\u00b0C ~ 40 \\u00b0C\",\"Storage Temperature\":\"-10 \\u00b0C to 40 \\u00b0C\",\"Relative Humidity\":\"\\u2264 80 %\",\"Atmospheric Pressure\":\"96 kPa ~ 104 kPa\",\"Battery\":\"Lead acid 12V, 4Ah  (120 mins run time)\",\"Output Pressure\":\"0.4 mPa \\u00b1 0.1 mPa\",\"Noise\":\"\\u2264 50 dB\",\"Power Supply\":\"AC 220 V \\u00b1 10 %, 50 Hz \\u00b1 2 %\",\"Dimension\":\"450 x 550 x 1400 mm\",\"Weight\":\"65 kgs\"}', 'Used in operating rooms, surgical care wards, intensive care unit, and other departments for pulmonary life-support during acute lung injury or respiratory distress which result in inadequate oxygenation or ventilation inability to protect the airway fluids.', '', '', '', 'Intensive Care Ventilator KIV-A101', 'Critical Care | Intensive Care Ventilator KIV-A101', 'KIV-A101', 'Intensive Care Ventilator KVI- A101 is a respiratory ventilator unit for invasive artificial respiration. Built-in provision for self-testing and calibration. The device is made up of high configuration intelligent control system that allows changes to be made according to user requirements.', '', '', 'Intensive Care Ventilator KIV-A101', 'Intensive Care Ventilator KIV-A101', '', '{\"small\":\"assets\\/images\\/products\\/Intensive-Care-Ventilator-KIV-A101-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Intensive-Care-Ventilator-KIV-A101-250x250.jpg\"}', '', 'Critical-Care/Ventilator/KIV-A101', 1, '2019-07-25 07:05:30', 1, '2019-07-25 01:35:31'),
(198, 'KIV-A102', 'Intensive Care Ventilator KIV-A102', 1, 'A1', 0, 39, 'Intensive Care Ventilator KVI- A102 is designed to meet the needs of clinical respiratory management for Infants with respiratory disorder. It has a provision to work with innovative ventilation modes like constant flow, pressure limit and time cycle ventilation.', '', '', 'Innovative ventilation mode </br>\nSafe and Reliable </br>\nCompact and Reasonable', '', '', '', '{\"Tidal Volume\":\"10 ml ~ 300 ml\",\"Standard Ventilation Mode\":\"CMV, IMV, CPAP, Manual\",\"Application\":\"Pediatric\",\"Inspiratory Flow\":\"3 L\\/min ~ 20 L\\/min\",\"Respiration rate\":\"1 bpm ~120 bpm\",\"I:E Ratio\":\"1:1 to 1:3\",\"Oxygen Concentration\":\"21 % ~ 100 %\",\"Pressure trigger Range\":\"-1.0 to 0 kPa\",\"Flow Trigger Range\":\"0 to 10 L\",\"PEEP Type\":\"Pneumatic Driven, Electronic Control\",\"Inspiratory Pause Time\":\"0.2 s ~ 3.0 s\",\"Maximum Security Pressure\":\"\\u2264 10 kPa\",\"PEEP Range\":\"0 kPa ~2.0 kPa\",\"Max Ventilation Volume\":\"> 5 L\\/min\",\"Input Pressure\":\"0.15 MPa ~ 0.3 Mpa\",\"Inspiratory Pressure\":\"1 kPa ~ 9 kPa\",\"Dimension\":\"\",\"Weight\":\"\"}', 'Used in operating rooms, NICU, and other departments for pulmonary life-support during acute lung injury or respiratory distress which result in inadequate oxygenation or ventilation inability to protect the airway fluids.', '', '', '', 'Intensive Care Ventilator KIV-A102', 'Critical Care | Intensive Care Ventilator KIV-A102', 'KIV-A102', 'Intensive Care Ventilator KVI- A102 is designed to meet the needs of clinical respiratory management for Infants with respiratory disorder. It has a provision to work with innovative ventilation modes like constant flow, pressure limit and time cycle ventilation.', '', '', 'Intensive Care Ventilator KIV-A102', 'Intensive Care Ventilator KIV-A102', '', '{\"small\":\"assets\\/images\\/products\\/Intensive-Care-Ventilator-KIV-A102-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Intensive-Care-Ventilator-KIV-A102-250x250.jpg\"}', '', 'Critical-Care/Ventilator/KIV-A102', 1, '2019-07-25 07:14:28', 1, '2019-07-25 01:44:28');
