(246, 'KHS-B100', 'Hydraulic Stretcher KHS-B100', 1, 'B1', 0, 62, 'KHS-B100 is a functional stretcher with a provision of five movements namely backrest and footrest movement, height adjustment, trendelenburg and anti-trendelenburg position control. Features weight system for easy weighing reference.  Back section is controlled by spring and manual control of footrest.', '', '', 'Aluminum alloy hand rails<br/> \nSpring controlled back section, manually controlled foot rest<br/>   \nCPR handle at head section<br/>  \nSteel frame and bottom platform<br/> \nEntire bed board  with x-ray cassette tray<br/>  \nRise and fall guide wheel<br/>  \nPU cover water proof mattress<br/> \nCentral locking system<br/>', '', '', '', '{\"Trendelenburg\":\"15 \\u00b0\",\"Variable height\":\"630 to 950 mm\",\"Anti-trendelenburg\":\"15 \\u00b0\",\"Weight accuracy\":\"0.02 or 0.05 kg\",\"Weight capacity\":\"150 kgs\",\"Backrest  upward angle\":\"75 \\u00b0\",\"Footrest upward angle\":\"45 \\u00b0\",\"Castor diameter\":\"\",\"Mattress thickness\":\"80 mm\",\"Dimensions\":\"2100 mm \\u00d7 850 mm \\u00d7 630 - 950 mm\"}', 'Used to move patient in need of medical care, at hospitals and clinics and to lift the patient with spinal cord injury.', '', '', '', 'Hydraulic Stretcher KHS-B100', 'Patient Transfer Solutions | Hydraulic Stretcher KHS-B100', 'KHS-B100', 'KHS-B100 is a functional stretcher with a provision of five movements namely backrest and footrest movement, height adjustment, trendelenburg and anti-trendelenburg position control. Features weight system for easy weighing reference.  Back section is controlled by spring and manual control of footrest.', '', '', 'Hydraulic Stretcher KHS-B100', 'Hydraulic Stretcher KHS-B100', '', '{\"small\":\"assets\\/images\\/products\\/Hydraulic-Stretcher-KHS-B100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Hydraulic-Stretcher-KHS-B100-250x250.jpg\"}', '', 'Patient-Transfer-Solutions/Stretchers/KHS-B100', 1, '2019-07-25 07:20:18', 1, '201