(252, 'KXP-A100', 'X-Ray Film Processor KXP-A100', 1, 'A1', 0, 50, 'X-ray Film Processor KXP-A100 is a medical thermal imaging processor. It enables processing of high-quality image in DICOM 3.0 ensuring optimum image quality. Integrated with in-built program to process 4 most common film sizes used in conventional radiography.', '', '', 'Programmable Microprocessor\n Control ease for user convenience\n Network Connectivity: TCP/IP and LAN', '', '', '', '{\"Geometrical\":\"320 dpi (12.6 pixel\\/mm)\",\"Processor\":\"Intel\",\"Interface\":\"TCP\\/IP\",\"Gray Scale Resolution\":\"12 bit ( 4096 gradation )\",\"Film type\":\"Medical thermal ( blue base )\",\"Film size\":\"8\\u201d\\u00d710\\u201d<BR\\/>\\n10\\u201d\\u00d712\\u201d<BR\\/>\\n11\\u201d\\u00d714\\u201d<BR\\/>\\n14\\u201d\\u00d717\\u201d\",\"Film output\":\"80 sheets\\/hour (14\\u201d\\u00d717\\u201d)                           \\n100 sheets\\/hour (8\\u201d\\u00d710\\u201d)\",\"Film output tray\":\"1 output tray,50 sheets\\/tray\",\"Film supply tray\":\"2 supply trays,100 sheets\\/tray\",\"Film input cassette\":\"Prepackaged in factory sealed\",\"Port\":\"10\\/100 Base \\u2013 T Ethernet (RJ-45)\",\"Image Format\":\"DICOM 3.0\",\"Image Quality\":\"Built-in densitometer<BR\\/>automatic calibration\",\"Image Control\":\"Contrast\\/gray scale\\/polar\\/rotate\\/saturation\\/scale\",\"Humidity\":\"10 % ~ 80 %\",\"Working humidity\":\"10 % ~ 70 %\",\"Working temperature\":\"15 \\u00b0C ~ 30 \\u00b0C\",\"Optimum temperature\":\"22.2 \\u00b0C\",\"Storage temperature\":\"-22 \\u00b0C ~ 50 \\u00b0C\",\"Control Panel\":\"LCD backlight display\",\"Key switch\":\"Power supply and menu navigation buttons\",\"Internal Memory\":\"2 GB\",\"Disk capacity\":\"320 GB\",\"Power\":\"Auto ranging 100 V ~ 240 V ;\\n 50 Hz \\/ 60 Hz\\nPrinting 6000 W\\nStandby 75 W\",\"Dimensions\":\"556 \\u00d7 770 \\u00d7 1250 mm\",\"Weight\":\"87.1 kgs\"}', 'Used in Diagnostic radiology for development and digitization of  X-ray films in CT, MRI, PACS, Dental radiography, Nuclear medicine and other medical imaging applications.', '', '', '', 'X-Ray Film Processor KXP-A100', 'General Aids | X-Ray Film Processor KXP-A100', 'KXP-A100', 'X-ray Film Processor KXP-A100 is a medical thermal imaging processor. It enables processing of high-quality image in DICOM 3.0 ensuring optimum image quality. Integrated with in-built program to process 4 most common film sizes used in conventional radiography.', '', '', 'X-Ray Film Processor KXP-A100', 'X-Ray Film Processor KXP-A100', '', '{\"small\":\"assets\\/images\\/products\\/X-Ray-Film-Processor-KXP-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/X-Ray-Film-Processor-KXP-A100-250x250.jpg\"}', '', 'General-Aids/X-Ray-Film-Viewer/KXP-A100', 1, '2019-07-25 07:23:53', 1, '2019-07-25 01:53:54'),
(253, 'KSP-A100', 'Syringe pump KSP-A100', 1, 'A1', 0, 100, 'Syringe pump KSP–A100 is a light weight, portable device designed for low-volume infusion. Equipped with LCD screen to display parameters like injection state, volume, mode, speed, syringe size, alarms, dosage, occlusion status, etc. for enhanced clinical efficiency. Inbuilt software based control system delivers higher levels of precision, safety and allows remote control mechanism to improve standardization, accuracy analysis of infusion data and reduce free–flow risks.', '', '', '4.3” color segment LCD </br>\nMulti injection modes – Volume/Time/Body </br>\n Adjustable speed, time, volume and dosage </br>\nAudio–visual alarms for critical events', '', '', '', '{\"KVO Rate\":\"0.1 \\u2013  5ml\\/h (steps : 0.1ml\\/h)\",\"Injection Compliance\":\"Adaptable for 5 syringe sizes\",\"Preset Volume Range\":\"0.1 ml \\u2013  1999.9 ml\",\"Occlusion System\":\"3-level alarming system\",\"Mechanical Precision\":\"\\u2264 \\u00b12 %\",\"Injection Rate Range\":{\"50 ml Syringe\":\"0.1 ml \\u2013  999.9 ml\\/h (step: 0.1 ml\\/h)<br\\/>1000 ml \\u2013  1800 ml\\/h (step: 1 ml\\/h)\",\"30 ml Syringe\":\"0.1 ml \\u2013  900 ml\\/h (step: 0.1 ml\\/h)\",\"20 ml Syringe\":\"0.1 ml \\u2013  600 ml\\/h (step: 0.1 ml\\/h)\",\"10 ml Syringe\":\"0.1 ml \\u2013  300 ml\\/h (step: 0.1 ml\\/h)\",\"5 ml Syringe\":\"0.1 ml \\u2013  150 ml\\/h (step: 0.1 ml\\/h)\"},\"Purge Rate\":{\"50 ml Syringe\":\"1800 ml\\/h (Bolus rate: 1200 ml\\/h)\",\"30 ml Syringe\":\"900 ml\\/h (Bolus rate: 600 ml\\/h)\",\"20 ml Syringe\":\"600 ml\\/h (Bolus rate: 400 ml\\/h)\",\"10 ml Syringe\":\"300 ml\\/h (Bolus rate: 200 ml\\/h)\",\"5 ml Syringe\":\"150 ml\\/h (Bolus rate: 100 ml\\/h)\"},\"Occlusion Alarm Threshold\":{\"High\":\"800 mmHg \\u00b1 200 mmHg (106.7 kPa \\u00b1 26.7 kPa)\",\"Medium\":\"500 mmHg \\u00b1 100 mmHg (66.7 kPa \\u00b1  13.3 kPa)\",\"Low\":\"300 mmHg \\u00b1 100 mmHg (40.7 kPa \\u00b1  13.3 kPa)\"},\"Fuse\":\"F1AL\\/250V (2 nos.)\",\"Power Supply\":\"100 V \\u2013  220 V, 50 Hz\",\"Battery\":\"Built\\u2013in Rechargeable Li\\u2013ion battery (11.1V) <\\/br> Capacity  \\u2265 2000mAh ; 10 hours of charging <\\/br> Works at 5ml\\/h after 4 hours of charging\",\"Alarm\":\"Near Injection finished, Preset dose injection finished, Occlusion, \\nSyringe off, Syringe dislocated, Low Battery, On AC Supply.\",\"Safety\":\"Class I Type BF\",\"Operation\":{\"Ambient Temperature\":\"5\\u00b0C to 40\\u00b0C\",\"Relative Humidity\":\"20% \\u2013 90%\",\"Atmospheric Pressure\":\"86 kPa \\u2013 106 kPa\"},\"Storage\":{\"Ambient Temperature\":\"\\u201330\\u00b0C to 55\\u00b0C\",\"Relative Humidity\":\"\\u2264 95%\",\"Atmospheric Pressure\":\"50 kPa \\u2013 106 kPa\"},\"Dimensions\":\"282 x 210 x 148 mm\",\"Weight\":\"2 Kgs\"}', 'Used in general ward, ICU or post-operative care facilities in hospitals to gradually administer intravenous fluid drug dosage in controlled amounts at a predetermined rate and speed through syringe attached with a catheter for consistent and effective infusion therapy.', '', '', '', 'Syringe pump KSP-A100', 'Critical Care | Syringe pump KSP-A100', 'KSP-A100', 'Syringe pump KSP–A100 is a light weight, portable device designed for low-volume infusion. Equipped with LCD screen to display parameters like injection state, volume, mode, speed, syringe size, alarms, dosage, occlusion status, etc. for enhanced clinical efficiency. Inbuilt software based control system delivers higher levels of precision, safety and allows remote control mechanism to improve standardization, accuracy analysis of infusion data and reduce free–flow risks.', '', '', 'Syringe pump KSP-A100', 'Syringe pump KSP-A100', '', '{\"small\":\"assets\\/images\\/products\\/Syringe-pump-KSP-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Syringe-pump-KSP-A100-250x250.jpg\"}', '', 'Critical-Care/Syringe-Pump/KSP-A100', 1, '2019-07-25 07:24:43', 1, '2019-07-25 01:54:44'),
(254, 'KIW-A100', 'Infant Warmer KIW-A100', 1, 'A1', 0, 34, 'Infant Warmer KIW-A100 is Microprocessor-based thermo-regulated open care system. Infrared heater cased in swivel head enables focused and uniform heat distribution. Smooth Bassinet Tilt allows effortless positioning of bed platform. Lockable Bed panels ensure better access without compromising on safety.', '', '', 'Control modes: Pre-warm/Manual/Skin-temp </br> \nSmooth Bassinet tilt  </br> \nPivot-hinged Head source  </br> \nRS-232 Network Interface  </br> \nCrystal quartz heater source (Optional)  </br> \nOxygen therapy (Optional)  </br> \nIn-built Low-pressure suction (Optional)', '', '', '', '{\"Control System\":\"Microprocessor based temperature control system\",\"Control Modes\":\"Preheat, Manual and Skin-temp mode\",\"Manual : Heater output\":\"0-100%, 10% increments\",\"Skin-temp : Control range\":\"25 \\u00b0C ~ 37 \\u00b0C\",\"Heater Source\":\"Far-infrared heater (Silicon Carbide)\",\"Skin-temp : Display range\":\"25 \\u00b0C  ~ 42 \\u00b0C\",\"Temperature Resolution\":\"0.1\",\"Display\":\"Digital LED display\",\"APGAR Timer\":\"1min \\/ 5min \\/ 10min\",\"Alarm\":\"High\\/Low Temperature, Sensor failure, Power failure, Heater failure, System failure\",\"Heater Head\":\"Adjustable \\u00b1 90\\u00b0\",\"Infant Bassinet\":\"\\u00b115\\u00b0continuous tilt with under bed X-ray cassette tray\",\"Bassinet Panel\":\"Acrylic\",\"Lateral Shelf\":\"Fixed shelf  <\\/br> Load carrying capacity : 2 Kgs\",\"Mattress Size\":\"570 \\u00d7 760 mm\",\"Temperature Sensor\":\"NTC thermistor 2.25K\",\"Power Consumption\":\"\\u2264 800 VA\",\"Power Supply\":\"110 V ~ 120 V, 50\\/60 Hz <\\/br> 220 V ~ 240 V, 50\\/60 Hz\",\"Dimensions\":\"935 x 650 x 1833 mm\",\"Weight\":\"75 Kgs\"}', 'Used in Delivery Ward, NICUs in hospitals and nursing homes for consistent infant warming and effective thermal control to prevent hypothermia and reduce cold stress to achieve safe thermoregulation in pre-term or sick neonates.', '', '', '', 'Infant Warmer KIW-A100', 'Critical Care | Infant Warmer KIW-A100', 'KIW-A100', 'Infant Warmer KIW-A100 is Microprocessor-based thermo-regulated open care system. Infrared heater cased in swivel head enables focused and uniform heat distribution. Smooth Bassinet Tilt allows effortless positioning of bed platform. Lockable Bed panels ensure better access without compromising on safety.', '', '', 'Infant Warmer KIW-A100', 'Infant Warmer KIW-A100', '', '{\"small\":\"assets\\/images\\/products\\/Infant-Warmer-KIW-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Infant-Warmer-KIW-A100-250x250.jpg\"}', '', 'Critical-Care/Infant-Warmer/KIW-A100', 1, '2019-07-25 07:25:36', 1, '2019-07-25 01:55:36'),
(257, 'KIV-A200', 'Intensive-Care Ventilator KIV-A200', 1, 'A1', 0, 39, 'Intensive-Care Ventilator KIV-A100 is a high performance, closed-loop controlled, pneumatically-driven critical care ventilator with multiple ventilation modes. System features high resolution detachable touch screen with navigation knob to view monitored parameters, pulmonary mechanics waveform, lung volumes, flow-volume loops and three-level audio-visual alarm system with 360-degree panoramic alert light.', '', '', 'Pneumatic-driven Flow </br>\nMultiple Ventilation modes with BIVENT and PRVC Modes  </br>\nInvasive and Non-invasive Modes </br>\nFlexible Configuration </br>\n15 Display Parameters </br>\nAlarm Recording Feature </br>\nLung mechanics function monitoring', '', '', '', '{\"Tidal Volume\":\"20 ml \\u2500 2500 ml\",\"Configurations\":\"Trolley or Ceiling Pendant\",\"Respiratory Rate\":\"1 bpm  \\u2500 40  bpm (V-SIMV\\/P-SIMV\\/PRVC-SIMV) <\\/br>\\n 4 bpm \\u2500 100 bpm ( VCV\\/PCV\\/PRVC)\",\"P<sub>support<\\/sub>\":\"0  kPa \\u2500 6 kPa\",\"P<sub>control<\\/sub>\":\"0.5 kPa \\u2500 6 kPa\",\"Pulmonary Mechanics Waveform\":\"3\",\"Loops\":\"2\",\"Standard Ventilation Modes\":\"VCV (A\\/C) <\\/br>\\nPCV (A\\/C) <\\/br>\\nSIMV (VCV) <\\/br>\\nSIMV(PCV) <\\/br>\\nSIMV (PRVC) <\\/br>\\nSPONT\\/CPAP <\\/br>\\nNIV\\/CPAP <\\/br>\\nNIV\\/PCV <\\/br>\\nBIVENT\",\"Combined  Ventilation Modes\":\"SPONT+PS <\\/br>\\nSIMV(VCV)+ PS <\\/br>\\nSIMV(PCV)+PS <\\/br>\\nSIMS(PRVC)+PS <\\/br>\\nBIVENT+PS <\\/br>\\nVCV+SIGH <\\/br>\\nNIV\\/CPAP+PS\",\"Inspiration Time\":\"0.1 s \\u2500 12 s\",\"Inspiratory Pause Time\":\"0 s \\u2500 4 s\",\"FiO<sub>2<\\/sub> Range\":\"21% \\u2500 100%\",\"Trigger Sensitivity\":\"Pressure : - 2 kPa to 0  kPa (above PEEP) <\\/br> Flow :        0.5  LPM \\u2500 20 LPM (base flow)\",\"PEEP\":\"0  kPa \\u2500 5 kPa\",\"Suction\":\"< 2 min\",\"Nebulizer\":\"30 mins\",\"Pressure Values\":\"P<sub>plat<\\/sub> \\/ P<sub>peak<\\/sub> \\/ P<sub>mean<\\/sub> \\/ PEEP\",\"Volume \