(258, 'KPM-A100', 'Vital Sign Monitor KPM-A100', 1, 'A1', 0, 85, 'Vital Sign Monitor KPM-A100 is a four parameter compact spot check device with graphic trends to illustrate patient status. Smooth crevice-free exterior with integrated handle aids portable usage reducing cross infection. Advanced software enables instant data download and tele-monitoring.', '', '', '2.8-inch screen display </br>\nAutomatic shut-down and stand-by </br>\nTrend review up to 3888 groups </br>\nAudio-visual alarm system </br>\nTele monitoring and USB connectivity </br>\nBattery status indicator', '', '', '', '{\"Vital Parameters\":\"<table class=\\\"tableizer-table\\\">\\n<thead><tr class=\\\"tableizer-firstrow\\\"><th>Type A<\\/th><th>Type B<\\/th><th>Type C<\\/th><\\/tr><\\/thead><tbody>\\n <tr><td>4 Parameters (NIBP,SpO<sub>2<\\/sub>, PR, Temp)<\\/td><td>3 Parameters                 (SpO<sub>2<\\/sub>, PR, Temp)<\\/td><td>3 Parameters                                            (NIBP, SpO<sub>2<\\/sub>, PR)<\\/td><\\/tr>\\n<\\/tbody><\\/table>\",\"Display\":\"240 x 320 dot matrix colour TFT\",\"NIBP Measurement range\":\"Adult: 30-255 mmHg <\\/br> Paediatric: 30-160 mmHg\\u00a0\",\"NIBP Mode\":\"Auto, Manual, STAT\",\"NIBP Parameters\":\"SYS, DIA, MAP\\u00a0\",\"NIBP interval\":\"Auto mode: 1, 2 , 3, 5, 10, 15, 20, 25, 30, 45, 60 mins <\\/br> STAT mode: 5 mins\",\"Resolution\":\"1 mmHg\",\"NIBP Over-pressure protection\":\"\\u00a0Adult: 300 mmHg <\\/br> Pediatric: 22 mmHg\",\"SpO<sub>2<\\/sub> Measurement range\":\"0 - 100%\",\"SpO<sub>2<\\/sub> Accuracy\":\"\\u00b12% (90-100)%, \\u00b13% (70-89)%, <70% (unspecified)\",\"SpO<sub>2<\\/sub> Resolution\":\"0.01\",\"PR Measurement range\":\"30 bpm - 250 bpm\",\"PR Accuracy\":\"\\u00b11 bpm\",\"PR Resolution\":\"1bpm\",\"Temp Probe\":\"Body sensitive temperature sensor\",\"Temp Measurement range\":\"0\\u2070C to 50\\u2070C\\u00a0\",\"Temp Accuracy\":\"\\u00b1 0.1\\u2070C\",\"Temp Resolution\":\"0.1\\u2070C\",\"Graphic LCD size\":\"44 x 59 mm\",\"Audio-visual Alarms\":\"Sensor-off alarm, Measurement out of user-defined limits\",\"Data Transmission\":\"USB-based transmission to PC <\\/br> Internet-based tele monitoring\",\"Operational Temperature\":\"0\\u2070C to 45\\u2070C\",\"Relative Humidity\":\"15% to 95%\",\"Pressure\":\"86 kPa \\u2013 106 kPa\",\"Power Supply\":\"Input power: AC 100-240V, 50-60Hz, 0.7A <\\/br> Output power: 5V,2.5A\",\"Battery\":\"2.8 A built-in rechargeable Li-ion battery <\\/br> Run Time : 5 hours <\\/br> Charging Time : 8 hours\"}', 'Used in OPD, diagnostic centers, emergency wards, first-aid and rescue ambulatory care intended for spot checking, non-invasive monitoring or recording of vital body parameters.', '', '', '', 'Vital Sign Monitor KPM-A100', 'Patient Monitoring System | Vital Sign Monitor KPM-A100', 'KPM-A100', 'Vital Sign Monitor KPM-A100 is a four parameter compact spot check device with graphic trends to illustrate patient status. Smooth crevice-free exterior with integrated handle aids portable usage reducing cross infection. Advanced software enables instant data download and tele-monitoring.', '', '', 'Vital Sign Monitor KPM-A100', 'Vital Sign Monitor KPM-A100', '', '{\"small\":\"assets\\/images\\/products\\/Vital-Sign-Monitor-KPM-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Vital-Sign-Monitor-KPM-A100-250x250.jpg\"}', '', 'Critical-Care/Patient-Monitoring-System/Vital-Sign-Monitor/KPM-A100', 1, '2019-07-25 07:29:32', 1, '2019-07-25 01:59:32'),
(260, 'KAL-A100', 'Laryngoscope KAL-A100', 1, 'A1', 0, 31, 'Laryngoscope KAL-A100 is standard optical laryngoscope set with three blades designed with true mac curve for maximum view. Blades are manufactured from surgical grade durable stainless steel preventing cross-infection. Standard fine-knurled handle design ensures firm and steady grip. Stainless steel contact light bulb serves reliable standards of illumination.', '', '', '100% stainless steel blades </br>\nMacintosh blades in 3 sizes  </br>\nStandard durable handle', '', '', '', '{\"Bulb\":\"One spare bulb\",\"Bulb type\":\"Stainless bulb\",\"Blades\":\"3 Macintosh blades\",\"Handle\":\"Standard Knurled\",\"Blade Dimension\":\"Large : 160mm <\\/br> Medium : 130mm <\\/br> Small: 100mm\"}', 'Used in Emergency departments, general wards as well as clinical and primary healthcare environment for use in anaesthesia/resuscitation for endotracheal intubation or to inspepction of vocal folds and the glottis.', '', '', '', 'Laryngoscope KAL-A100', 'Medical Diagnostic | Laryngoscope KAL-A100', 'KAL-A100', 'Laryngoscope KAL-A100 is standard optical laryngoscope set with three blades designed with true mac curve for maximum view. Blades are manufactured from surgical grade durable stainless steel preventing cross-infection. Standard fine-knurled handle design ensures firm and steady grip. Stainless steel contact light bulb serves reliable standards of illumination.', '', '', 'Laryngoscope KAL-A100', 'Laryngoscope KAL-A100', '', '{\"small\":\"assets\\/images\\/products\\/Laryngoscope-KAL-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Laryngoscope-KAL-A100-250x250.jpg\"}', '', 'Medical-Diagnostic/Diagnostic-ENT/KAL-A100', 1, '2019-07-25 07:31:24', 1, '2019-07-25 02:01:25'),
(261, 'KIP-A100', 'Infusion Pump KIP–A100', 1, 'A1', 0, 37, 'Infusion Pump KIP–A100 is a single-channel light–weight, drip-type volumetric fluid delivery system. Digitally driven fluid-control, automated calibration and dose titration enhances safety. Peristaltic pumping mechanism ensures precise flow-measurement and prevents back-flow of IV fluid. Backlit display enables suitably ambient illumination to operate even at low light condition.', '', '', 'Infusion Modes - Rate mode, Time mode, Volume mode </br>\nAutomated calibration </br>\nProvision for infusion fluid warming </br> \nBuilt-in drug database library </br>\nSuitable for all brands of IV set </br>\nAlarm: Infusion Complete, Occlusion, Door Open, Air Bubble, </br>\nLow Battery, Setting Error, Power failure, Stand-by', '', '', '', '{\"Channel\":\"Single channel infusion\",\"Volume  (VTBI)\":\"1 ml ~ 9999.9 ml ( 0.1 ml increment)\",\"Accuracy\":\"Flow rate: \\u2264 \\u00b1 3 % <\\/br> Mechanical: \\u2264 \\u00b1 2 %\",\"KVO Rate\":\"1 ml\\/h (1 ml\\/h ~ 300 ml\\/h) <\\/br>\\n3 ml\\/h (greater than 300 ml\\/h)\",\"Occlusion System\":\"3 selectable occlusion levels\",\"Drop Rate\":\"1 drop\\/min ~ 400 drops\\/min (1 drop\\/min increment)\",\"Infusion Rate\":\"1.0 ml\\/h ~99.9 ml\\/h (0.1 ml\\/h increment)  <\\/br>\\n100 ml\\/h ~1200 ml\\/h (1 ml\\/h increment)\",\"Purge\":\"800 ml\\/h\",\"Bolus\":\"10 ml\\/h ~ 1200 ml\\/h at 0.1 ml\\/h (flow rate < 100 ml\\/h) <\\/br>\\n10 ml\\/h ~ 1200 ml\\/h at 1 ml\\/h (flow rate > 100 ml\\/h)\",\"Therapy Timer Range\":\"1 min ~ 9999 min ( 1 min increment)\",\"Display\":\"4.3-inch colour LCD with backlight\",\"Drug Library\":\"Database of up to 210 drugs\",\"Memory\":\"Up to 1500 record entries\",\"Occlusion Threshold\":\"High: 800 mmHg \\u00b1 200 mmHg (106.7 kPa \\u00b1 26.7 kPa) <\\/br>\\nMedium: 500 mmHg \\u00b1 100 mmHg (66.7 kPa \\u00b1 13.3 kPa) <\\/br>\\nLow: 300 mmHg \\u00b1 100 mmHg (40.7 kPa \\u00b1 13.3 kPa)\",\"Sensitivity [Bubble detection&#93;\":\"> 25 \\u03bcL\",\"Environmental Condition : Operation\":\"Operating temperature  5 \\u2070C ~ 40 \\u2070C <\\/br> Operating humidity  20 % ~ 90 %\",\"Environmental Condition: Storage\":\"Storage temperature  -10 \\u2070C ~ 55 \\u2070C <\\/br> Storage humidity  10 % ~ 90 %\",\"Fuse\":\"F1AL \\/ 250 V\",\"Power Supply\":\"AC 85 ~ 265 V, 50\\/60 Hz, < 40 VA\",\"Battery\":\"11.1 V rechargeable Li-ion battery; > 2000 mAh <\\/br> Works more than 4 hours at 25 ml\\/h after charging for 8 hours <\\/br>\",\"Dimensions\":\"188 x 198 x 228 mm\",\"Weight\":\"2.5 Kgs\"}', 'Used in general ward, ICU in hospital to gradually administer intra-venous fluid drug dosage at a predetermined rate through syringe for consistent and effective infusion therapy.', '', '', '', 'Infusion Pump KIP–A100', 'Critical Care | Infusion Pump KIP–A100', 'KIP-A100', 'Infusion Pump KIP–A100 is a single-channel light–weight, drip-type volumetric fluid delivery system. Digitally driven fluid-control, automated calibration and dose titration enhances safety. Peristaltic pumping mechanism ensures precise flow-measurement and prevents back-flow of IV fluid. Backlit display enables suitably ambient illumination to operate even at low light condition.', '', '', 'Infusion Pump KIP–A100', 'Infusion Pump KIP–A100', '', '{\"small\":\"assets\\/images\\/products\\/Infusion-Pump-KIPA100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Infusion-Pump-KIPA100-250x250.jpg\"}', '', 'Critical-Care/Infusion-Pump/KIP-A100', 1, '2019-07-25 07:33:10', 1, '2019-07-25 02:03:10'),
(262, 'KOL-A300', 'Integral Reflection Surgical Light KOL-A300', 1, 'A3', 0, 47, 'Integral Reflection Surgical light KOL-A300 features a high quality reflector allowing the bulb to focus concentrate the light to its specific operational area. Designed to use by medical personnel for individual medical examination and small procedures.  Failure of the primary light will be automatically replaced by standby light.', '', '', 'High quality reflector<br/> \nAutomatic switch over between the primary and standby lights<br/>\nBrightness focus ( light diameter density ) can be customized<br/>', '', '', '', '{\"Illumination intensity\":\"50,000 lux ~ 100,000 lux\",\"Lamp holder diameter\":\"500 mm\",\"Light field\":\"100 mm ~ 280 mm\",\"Temperature increased\":\"\\u2264 12 \\u00b0C\",\"Depth of illumination\":\"\\u2265 700 mm\",\"Bulb voltage\":\"24 V (AC)\",\"Mains voltage\":\"220 V \\u00b1 20 %<br\\/> \\n50 Hz\",\"Temperature increased of Doctor\\u2019s head\":\"\\u2264 2 \\u00b0C\",\"Bulb power\":\"\",\"Power input\":\"220 VA\"}', 'Used in hospitals to conduct modern surgical operations as ideal light source.', '', '', '', 'Integral Reflection Surgical Light KOL-A300', 'OR Solutions | Integral Reflection Surgical Light KOL-A300', 'KOL-A300', 'Integral Reflection Surgical light KOL-A300 features a high quality reflector allowing the bulb to focus concentrate the light to its specific operational area. Designed to use by medical personnel for individual medical examination and small procedures.  Failure of the primary light will be automatically replaced by standby light.', '', '', 'Integral Reflection Surgical Light KOL-A300', 'Integral Reflection Surgical Light KOL-A300', '', '{\"small\":\"assets\\/images\\/products\\/Integral-Reflection-Surgical-Light-KOL-A300-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Integral-Reflection-Surgical-Light-KOL-A300-250x250.jpg\"}', '', 'OR-Solutions/Surgical-and-Examination-Lights/KOL-A300', 1, '2019-07-25 07:33:39', 1, '2019-07