(265, 'KSP-B100', 'Syringe pump KSP–B100', 1, 'B1', 0, 100, 'Syringe pump KSP–B100 is a dual-channel light–weight, infusion device designed for low volume infusion. Equipped with separate LCD screen to display independent flow parameters. Inbuilt software system accurately delivers infusion rate and monitors infusion therapy. Memory log system stores last setting of infusion parameters for fast infusion.', '', '', 'Multi injection modes – Volume/Time/Body </br>\nAdjustable speed, time, volume and dosage </br>\nAudio–visual alarms with repeat alarm function </br>\nLarge data storage', '', '', '', '{\"Channel\":\"Dual channel infusion\",\"Volume  (VTBI)\":\"0.1 ml \\u2013  1999.9 ml\",\"Injection Compliance\":\"Adaptable for 10 syringe sizes\",\"Accuracy\":\"\\u2264 \\u00b1 3 %\",\"KVO Rate\":\"0.1 ml\\/h \\u2013  5 ml\\/h (steps : 0.1 ml\\/h)\",\"Occlusion System\":\"3 selectable occlusion levels\",\"Infusion Rate\":\"0.1 ml\\/h ~ 1600 ml\\/h,  increment 0.1ml\\/h\",\"Syringe Size\":\"Channel 01 : 5 ml \\/ 10 ml \\/ 20ml \\/ 30ml \\/ 50ml <\\/br>  Channel 02 : 6 ml \\/ 12 ml \\/ 25 ml \\/ 35 ml \\/ 60 ml\",\"Bolus\":\"Syringe 50 ml: 1600 ml\\/h <\\/br>\\nSyringe 30 ml: 900 ml\\/h <\\/br>\\nSyringe 20 ml: 600 ml\\/h <\\/br>\\nSyringe 10 ml: 400 ml\\/h <\\/br>\\nSyringe 5 ml: 200 ml\\/h\",\"Occlusion Alarm Threshold\":\"High: 110 kPa \\u00b1 20 kPa (825 mmHg \\u00b1 150 mmHg) <\\/br>\\nMedium: 80 kPa \\u00b1 30 kPa (600 mmHg \\u00b1 225 mmHg) <\\/br>\\nLow: 60 kPa \\u00b1 20 kPa (450 mmHg \\u00b1 150 mmHg)\",\"Display\":\"4.3\\u201d color segment LCD screen\",\"Environmental conditions : Operation\":\"Ambient Temperature: 5 \\u00b0C to 40 \\u00b0C <\\/br> Relative Humidity: 20 % to 90 % <\\/br> Atmospheric Pressure: 86 kPa to 106 kPa\",\"Environmental conditions : Storage\":\"Ambient Temperature: \\u201330 \\u00b0C to 55 \\u00b0C  <\\/br> Relative Humidity: \\u2264\\u00a0\\u00a095% <\\/br> Atmospheric Pressure: 50 kPa \\u2013 106 kPa\",\"Alarm\":\"Occlusion, nearly finish, finish, standby (no operation), <\\/br> low battery, battery exhausted\\u00a0\",\"Power Supply\":\"100 V ~ 240 V, 50 Hz \\/ 60 Hz\",\"Power Consumption\":\"\\u2264  25 VA\",\"Safety\":\"Class I Type CF\",\"Dimensions\":\"354 \\u00d7 132 \\u00d7 199 mm\",\"Weight\":\"2.8 kg\"}', 'Used in general ward, ICU in hospital to gradually administer intra-venous fluid drug dosage at a predetermined rate through syringe for consistent and effective infusion therapy.', '', '', '', 'Syringe pump KSP–B100', 'Critical Care | Syringe pump KSP–B100', 'KSP-B100', 'Syringe pump KSP–B100 is a dual-channel light–weight, infusion device designed for low volume infusion. Equipped with separate LCD screen to display independent flow parameters. Inbuilt software system accurately delivers infusion rate and monitors infusion therapy. Memory log system stores last setting of infusion parameters for fast infusion.', '', '', 'Syringe pump KSP–B100', 'Syringe pump KSP–B100', '', '{\"small\":\"assets\\/images\\/products\\/Syringe-pump-KSPB100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Syringe-pump-KSPB100-250x250.jpg\"}', '', 'Critical-Care/Syringe-Pump/KSP-B100', 1, '2019-07-25 07:36:25', 1, '2019-07-25 02:06:26');
