(267, 'KALM-A100', 'Automated Lens meter KALM-A100', 1, 'A1', 0, 104, 'Automated  Lens meter KALM-A100 is a high-performance digital measurement tool designed to measure optical power of lens. Incorporated Hartmann-Shack sensor provides faster, more accurate and stable measurements. Wide LCD monitor with variable directional angle of observation allows clear view from virtually any position.', '', '', 'Hartman testing method </br>\nLCD tilt-able display screen </br>\nBuilt-in UV transmittance measurement </br>\nIntegrated thermal printer </br>\nAutomatic mono- & multi-focal detection', '', '', '', '{\"Range of measurement\":\"<table class=\\\"tableizer-table\\\">\\n<thead><tr class=\\\"tableizer-firstrow\\\"><th>Lens<\\/th><th>Range<\\/th><\\/tr><\\/thead><tbody>\\n <tr><td>Sphere<\\/td><td>-25 ~ +25 D unit( 0.01\\/0.12\\/0.25 D steps)<\\/td><\\/tr>\\n <tr><td>Cylinder<\\/td><td>-9.99 ~ +9.99 D  unit (0.01\\/0.12\\/0.25 D steps)<\\/td><\\/tr>\\n <tr><td>Axis<\\/td><td>0\\u00b0 ~ 180\\u00b0 unit (1\\u00b0 steps)<\\/td><\\/tr>\\n <tr><td>Add<\\/td><td>0 ~ +9.99 D unit (0.01\\/0.12\\/0.25 D)<\\/td><\\/tr>\\n <tr><td>Prism<\\/td><td>0 ~ 6 \\u25b3 unit ( 0.01\\/0.12\\/0.25 \\u25b3)<\\/td><\\/tr>\\n<\\/tbody><\\/table>\",\"Lens measurement type\":\"<table class=\\\"tableizer-table\\\">\\n<thead><tr class=\\\"tableizer-firstrow\\\"><th>Lens<\\/th><th>Type<\\/th><\\/tr><\\/thead><tbody>\\n <tr><td>Cylinder<\\/td><td>       +,+\\/-,-<\\/td><\\/tr>\\n <tr><td>Prism<\\/td><td>        X-Y,P-B<\\/td><\\/tr>\\n <tr><td>Contact lens        <\\/td><td>         Soft\\/hard<\\/td><\\/tr>\\n<\\/tbody><\\/table>\",\"Measuring mode\":\"Single <\\/br> Progressive <\\/br> Auto recognition\",\"Diameter of lens\":\"\\uffe020 mm ~ 108 mm\",\"PD\":\"45 mm ~ 90mm, 0.25mm steps\",\"Speed\":\"0.1s\",\"ABBE compensation\":\"30 ~ 60\",\"Display\":\"5.6\\u201d TFT-LCD  <\\/br> Tilt range : 20\\u00b0 - 90\\u00b0\",\"Printer\":\"Thermal Printer\",\"Dimension\":\"222 \\u00d7 161 \\u00d7 372 mm\",\"Weight\":\"5.5 Kgs\"}', 'Used in small to medium sized optical diagnostic clinics and at opticians mainly by optometrists and opticians to verify the lens prescription for measuring single vision lenses, bifocal (trifocal) lenses, progressive power lenses, (PPL) and contact lenses (CL).', '', '', '', 'Automated Lens meter KALM-A100', 'Medical Diagnostic | Automated Lens meter KALM-A100', 'KALM-A100', 'Automated  Lens meter KALM-A100 is a high-performance digital measurement tool designed to measure optical power of lens. Incorporated Hartmann-Shack sensor provides faster, more accurate and stable measurements. Wide LCD monitor with variable directional angle of observation allows clear view from virtually any position.', '', '', 'Automated Lens meter KALM-A100', 'Automated Lens meter KALM-A100', '', '{\"small\":\"assets\\/images\\/products\\/Automated-Lens-Meter-KALM-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Automated-Lens-Meter-KALM-A100-250x250.jpg\"}', '', 'Medical-Diagnostic/Lensmeter/KALM-A100', 1, '2019-07-25 07:37:54', 1, '2019-07-25 02:07:54'),
(270, 'KSS-A100', 'Slide Stainer KSS-A100', 1, 'A1', 0, 14, 'KSS-A100 is a 1 L capacity touch screen unit with LCD display designed to stain a specimen consisting 12 or 16 reagent container with processing capacity of 72 pieces.  Equipped with automated water cleansing and tissue drying function ensuring care free maintenance. Integrated with dyeing shelf for loading multiple slides.', '', '', 'Touch screen LCD display<br/> \nAddition and drainage of stains by logic control<br/>\n Air purification system vent fumes<br/>\nWater cleansing and tissue drying function  removes pollutants', '', '', '', '{\"Reagent Containers\":\"12 or 16\",\"Cleaning Bath\":\"9 <sup>th<\\/sup>one\",\"Roasting Bath\":\"1<sup>st<\\/sup> one\",\"Processing Time of Each Container\":\"0 secs to 59 mins and 59 secs.\",\"Capacity of Containers\":\"1 L\",\"Specimen Process\":\"72 pieces\",\"Specimen\\u00a0slide\\u00a0throughput\":\"\",\"Loading capacity\":\"\",\"Number\\u00a0of\\u00a0stations\":\"\",\"Slide Rack Capacity\":\"\",\"Distribution of station\":\"\",\"Number of\\u00a0reagent\\u00a0stations\":\"\",\"Number\\u00a0of\\u00a0Wash\\u00a0Stations\":\"\",\"Number\\u00a0of\\u00a0Wait\\u00a0Stations\":\"\",\"Oven\\u00a0Chamber\\u00a0Temperature\":\"\",\"Load\\/unload Stations\":\"\",\"Incubation Time Setting\":\"\",\"Permanent Memory Capacity\":\"\",\"Operation Temperature Range\":\"\",\"Relative Humidity\":\"\",\"Voltage\":\"AC 220 V,\\u00a050 Hz <hr>AC 110 V 60 Hz\",\"Power\":\"1000 W\",\"Dimension (W x D x H)\":\"1130 mm x  460 mm x  400 mm\",\"Weight\":\"85 kgs\"}', 'Used in hospitals, histology, pathology, scientific laboratories, research institutes for research, analysis, in-situ hybridization, PCR automation, etc.', '', '', '', 'Slide Stainer KSS-A100', 'In-Vitro Diagnostic | Slide Stainer KSS-A100', 'KSS-A100', 'KSS-A100 is a 1 L capacity touch screen unit with LCD display designed to stain a specimen consisting 12 or 16 reagent container with processing capacity of 72 pieces.  Equipped with automated water cleansing and tissue drying function ensuring care free maintenance. Integrated with dyeing shelf for loading multiple slides.', '', '', 'Slide Stainer KSS-A100', 'Slide Stainer KSS-A100', '', '{\"small\":\"assets\\/images\\/products\\/Slide-Stainer-KSS-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Slide-Stainer-KSS-A100-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Slide-Stainer/KSS-A100', 1, '2019-07-25 07:40:13', 1, '2019-07-25 02:10:13'),
(271, 'KSS-A101', 'Slide Stainer KSS-A101', 1, 'A1', 0, 14, 'KSS-A101 is a PLC controlled computerized stainer unit ensuring easy operation with a specimen slide throughput of 200 slides per hour. It features 26 stations (1 to 17 stations for reagent containers and 19, 21, 23 stations are water washing containers).Integrated with stepper motor and synchronous belt drive ensuring accuracy and balanced running of the unit.', '', '', 'PLC control computerized system <br/>\nHigh throughput of specimen slices<br/>\n Automatic reset function <br/>\n Storage for five programs<br/>\nOptional battery backup for power failure', '', '', '', '{\"Reagent Containers\":\"600 ml\",\"Cleaning Bath\":\"\",\"Roasting Bath\":\"\",\"Processing Time of Each Container\":\"\",\"Capacity of Containers\":\"\",\"Specimen Process\":\"\",\"Specimen\\u00a0slide\\u00a0throughput\":\"200 specimen slides per hour\",\"Loading capacity\":\"3 slides rack\",\"Number\\u00a0of\\u00a0stations\":\"26\",\"Slide Rack Capacity\":\"30 Specimen Slide\",\"Distribution of station\":\"0-unloading staining rack <hr>                      1 to 17- reagent container<hr>  18,20,22-waiting container<hr> 19,21,23-water washing container<hr>                   24-loading staining rack  <hr>  25-oven\",\"Number of\\u00a0reagent\\u00a0stations\":\"18\",\"Number\\u00a0of\\u00a0Wash\\u00a0Stations\":\"3\",\"Number\\u00a0of\\u00a0Wait\\u00a0Stations\":\"3\",\"Oven\\u00a0Chamber\\u00a0Temperature\":\"From ambient temperature to 85 \\u00b0C\",\"Load\\/unload Stations\":\"1 each\",\"Incubation Time Setting\":\"0\\u00a0secs\\u00a0\\u00a0to\\u00a09999\\u00a0secs\",\"Permanent Memory Capacity\":\"5 programs, up to 24 program steps each\",\"Operation Temperature Range\":\"15 \\u00b0C\\u00a0to\\u00a035 \\u00b0C\",\"Relative Humidity\":\"\\u2264 90 % (+ 25 \\u00b0C)\",\"Voltage\":\"AC 220 V,\\u00a050 Hz <hr>AC 110 V 60 Hz\",\"Power\":\"300 W\",\"Dimension (W x D x H)\":\"1200 mm \\u00d7 500 mm \\u00d7 600 mm\",\"Weight\":\"110 kgs\"}', 