(272, 'KIP-A101', 'Infusion Pump KIP–A101', 1, 'A1', 0, 37, 'Infusion Pump KIP–A101 is a single-channel light–weight, drip-type volumetric fluid delivery system. Built-in pressure sensor system reduces false alarm. Infusion driver accurately delivers infusion rate and monitors infusion therapy. Backlit display enables suitably ambient illumination to operate even at low light condition. Smooth dustproof exterior design allows easy maintenance.', '', '', 'Built-in drug database library </br>\nUp-stream & Down-stream pressure sensor </br>\nElectric anti-free flow clamp </br> \nVertically stackable to save storage space </br>\nSuitable for all brands of IV set </br>\nAlarm: Infusion complete, Pressure, Upstream pressure, Battery status, KVO finished, Clip-lock open, Air bubble, Infusion near end,  Battery low, Power fail, Drop sensor connection, System fail', '', '', '', '{\"Channel\":\"Single channel infusion\",\"Infusion Volume\":\"0 ml ~ 9999 ml ( 0.1ml increment)\",\"Infusion Rate\":\"0.01 ml\\/h ~ 1200 ml\\/h (0.01ml\\/h increment)\",\"KVO Rate\":\"0.01 ml\\/h \\u2013 5 ml\\/h\",\"Occlusion\":\"4 selectable levels of occlusion\",\"Accuracy\":\"\\u00b15%\",\"Infusion Modes\":\"Rate mode, Time mode, Body weight, Drip mode, Micro mode\",\"Drop Rate\":\"1 drop\\/min ~ 400 drops\\/min (1 drop\\/min increment)\",\"Purge\":\"Available\",\"Bolus\":\"0.1 ml\\/h ~1200 ml\\/h (auto & manual bolus control)\",\"Therapy Timer Range\":\"1 min ~ 9999 min ( 1 min increment)\",\"Display\":\"4.3-inch colour LCD with backlight\",\"Drug Library\":\"Database of up to 30 drugs\",\"Memory\":\"Up to 5000 record entries\",\"Safety\":\"Class I, CF\",\"Moisture Protection\":\"IP24\",\"Stand by\":\"00 mins \\u2013 99 h 59 mins\",\"Free-flow Protection\":\"Anti-free flow safeguard clip lock system\",\"Power Supply\":\"AC: 110 V ~ 240 V, 50 Hz \\/ 60 Hz, DC: 12 V\",\"Battery\":\"11.1 V rechargeable Li-ion battery; > 2600 mAh <\\/br> Works more than 9 hours at 25 ml\\/h after charging for 5 hours\",\"Dimensions\":\"235 x 95 x 120 mm\",\"Weight\":\"1.6 Kg\"}', 'Used in general ward, ICU in hospital to gradually administer intra-venous fluid drug dosage at a predetermined rate through syringe for consistent and effective infusion therapy.', '', '', '', 'Infusion Pump KIP–A101', 'Critical Care | Infusion Pump KIP–A101', 'KIP-A101', 'Infusion Pump KIP–A101 is a single-channel light–weight, drip-type volumetric fluid delivery system. Built-in pressure sensor system reduces false alarm. Infusion driver accurately delivers infusion rate and monitors infusion therapy. Backlit display enables suitably ambient illumination to operate even at low light condition. Smooth dustproof exterior design allows easy maintenance.', '', '', 'Infusion Pump KIP–A101', 'Infusion Pump KIP–A101', '', '{\"small\":\"assets\\/images\\/products\\/Infusion-Pump-KIPA101-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Infusion-Pump-KIPA101-250x250.jpg\"}', '', 'Critical-Care/Infusion-Pump/KIP-A101', 1, '2019-07-25 07:41:36', 1, '2019-07-25 02:11:36'),
(273, 'KOT-C101', 'Hydraulic Operating Table KOT-C101', 1, 'C1', 0, 105, 'Hydraulic Operating Table KOT-C101 is a is multifunctional parturition table with hydraulic lift -n-lower mechanism of platform for safer operation. Modular table top sections allow quick set up and alignment. Streamlined cushioning with ergonomic design increases comfort.', '', '', 'Anti-corrosive 304 stainless steel base </br>\nDurable Y type sealing ring </br>\nHigh density sponge mattress </br>\nRotary brake for ease of movement </br>\nExtendable auxillary bed', '', '', '', '{\"Length\":\"1900 \\u00b1 50 mm\",\"Width\":\"600 \\u00b1 10 mm\",\"Adjustable Height (Min to Max)\":\"(700-950) \\u00b1 50 mm\",\"Back Section\":\"Upward: \\u2265 50\\u00b0 <\\/br>\\nDownward: \\u2265 3\\u00b0\",\"Trendelenburg\":\"10\\u00b0\",\"Reverse Trendelenburg\":\"20\\u00b0\",\"Seat Section\":\"800 \\u00d7 600 mm\",\"Auxillary Table\":\"410 \\u00d7 600 mm\"}', 'Used in hospitals, labour delivery room, operating room for performing gynecology operations, diagnosis, inspections and orthopaedic procedures on patients.', '', '', '', 'Hydraulic Operating Table KOT-C101', 'OR Solutions | Hydraulic Operating Table KOT-C101', 'KOT-C101', 'Hydraulic Operating Table KOT-C101 is a is multifunctional parturition table with hydraulic lift -n-lower mechanism of platform for safer operation. Modular table top sections allow quick set up and alignment. Streamlined cushioning with ergonomic design increases comfort.', '', '', 'Hydraulic Operating Table KOT-C101', 'Hydraulic Operating Table KOT-C101', '', '{\"small\":\"assets\\/images\\/products\\/Hydraulic-Operating-Table-KOT-C101-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Hydraulic-Operating-Table-KOT-C101-250x250.jpg\"}', '', 'OR-Solutions/Operating-Table/KOT-C101', 1, '2019-07-25 07:42:11', 1, '2019-07-25 02:12:11'),
(279, 'KDK-A100', 'Multi-drug test kit KDK-A100', 1, 'A1', 0, 103, 'Multi-drug test kit KDK-A100 is a fully self-contained immunochromatographic assay quality screening kit. Screening provides preliminary results for qualitative detection of up to 10 drugs at specific cut-off levels on urine specimen. Specimen collection sealed cup design prevents leakage and eliminates need to handle urine. Rapid detection and procedural quality control ensures integrity of results.', '', '', 'Tests up to 10 drugs in one cup </br>\nQuick results </br>\nIntegrated test panel in sample collection cup </br>\nSecured seal cap', '', '', '', '{\"Test\":\"AMP + COC + MET + OPI + MDMA + KET + BZO + THC + TRA + PPX \\u00a0\",\"Test panel\":\"Integrated in Specimen Cup\",\"Specimen\":\"Urine\",\"Test duration\":\"5 mins\",\"Test Standards\":\"High Accuracy and Sensitivity level\"}', 'Used in Rehabilitation centre, Primary healthcare centres, Emergency wards as well as Point-of-care use for quick and reliable preliminary determination of suspected drug-abuse.', '', '', '', 'Multi-drug test kit KDK-A100', 'Medical Disposables | Multi-drug test kit KDK-A100', 'KDK-A100', 'Multi-drug test kit KDK-A100 is a fully self-contained immunochromatographic assay quality screening kit. Screening provides preliminary results for qualitative detection of up to 10 drugs at specific cut-off levels on urine specimen. Specimen collection sealed cup design prevents leakage and eliminates need to handle urine. Rapid detection and procedural quality control ensures integrity of results.', '', '', 'Multi-drug test kit KDK-A100', 'Multi-drug test kit KDK-A100', '', '{\"small\":\"assets\\/images\\/products\\/Multi-Drug-Test-Kit-KDK-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Multi-Drug-Test-Kit-KDK-A100-250x250.jpg\"}', '', 'Medical-Disposables/Rapid-Test-Kits/KDK-A100', 1, '2019-07-25 07:47:11', 1, '2019-07-25 02:17:11'),
(280, 'KMS-A100', 'Manual Transfer Stretcher KMS-A100', 1, 'A1', 0, 62, 'KMS-A100 functional stretcher with a provision of two movements namely backrest and height adjustment. It allows manual transfer of patient onto another location. Back section movement is controlled by spring. Fifth rise and fall guide wheel features shock proof system.', '', '', 'Cold-rolled steel tube frame<br/>\nPP (Polypropylene) bottom platform<br/>\nCPR handle at head side for quickly lowering the head section<br/>\nRise and fall guide wheels<br/>\nIV pole, IV pole holders<br/> \nABS bed board with oxygen cylinder holder<br/> \nWater proof mattress with straps<br/>', '', '', '', '{\"Variable height\":\"500 to 900 mm\",\"Transfer operation\":\"Manual\",\"Back rest  upward angle\":\"75 \\u00b0\",\"Weight capacity\":\"250 Kgs\",\"Mattress\":\"60 mm thick\",\"Castor diameter\":\"150 mm\",\"Dimension\":\"1930 \\u00d7 640 \\u00d7 500 - 900 mm\"}', 'Used in hospital, nursing home and ambulances.', '', '', '', 'Manual Transfer Stretcher KMS-A100', 'Patient Transfer Solutions | Manual Transfer Stretcher KMS-A100', 'KMS-A100', 'KMS-A100 functional stretcher with a provision of two movements namely backrest and height adjustment. It allows manual transfer of patient onto another location. Back section movement is controlled by spring. Fifth rise and fall guide wheel features shock proof system.', '', '', 'Manual Transfer Stretcher KMS-A100', 'Manual Transfer Stretcher KMS-A100', '', '{\"small\":\"assets\\/images\\/products\\/Manual-Transfer-Stretcher-KMS-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Manual-Transfer-Stretcher-KMS-A100-250x250.jpg\"}', '', 'Patient-Transfer-Solutions/Stretchers/KMS-A100', 1, '2019-07-25 07:48:05', 1, '2019-07-25 02:18:06'),
