(287, 'KPM-A200', 'Vital Sign Monitor KPM-A200', 1, 'A2', 0, 85, 'KPM-A200 is a battery operated vital sign monitor suitable for adult pediatric and neonate. Equipped with 4 hour capacity removable and rechargeable battery. Custom configuration includes SpO2, NIBP, ECG, TEMP and built-in printer option.', '', '', 'Trend review up to 400 groups of NIBP data </br> \nLarge storage capacity </br> \nAudio-visual alarm system </br> \nNurse call system </br> \nNetwork connectivity(Optional)', '', '', '', '{\"Vital Parameters\":\"3 Parameters (SpO2 (with PR), NIBP, & 1-channel TEMP)\",\"NIBP Measurement range\":\"Systolic Adult 50 ~ 265 mmHg\\n Child 25 ~ 135 mmHg\\nDiastolic Adult 15 ~ 220 mmHg\\n Child 12 ~ 110 mmHg\\nMAP Adult 25 ~ 245 mmHg\\n Child 18 ~ 120 mmHg\",\"NIBP Mode\":\"Manual, Auto\",\"NIBP Parameters\":\"Sys, Dia, MAP\",\"NIBP interval\":\"Auto Mode: 1 ~ 240 min, < 10 s\",\"NIBP Over-pressure protection\":\"Adult: 300 mmHg\\nChild: 140 mmHg\",\"SpO2 Measurement range\":\"35 % ~ 100 %\",\"SpO2 Accuracy\":\"75 % ~ 100 % @ \\u00b1 2 %\\n35 % ~ 74 % @ \\u00b1 3 %\",\"PR Measurement range\":\"30 bpm ~ 250 bpm\",\"PR Accuracy\":\"\\u00b12 bpm\",\"TEMP Monitoring range\":\"21 \\u2070C ~ 50 \\u2070C\",\"TEMP Monitoring accuracy\":\"\\u00b10.1 \\u2070C\",\"TEMP Responding time\":\"\\u2264 150 s\",\"Recording speed\":\"25 mm\\/s\",\"Recording speed accuracy\":\"\\u2264 5%\",\"Power Supply\":\"AC 100-250V, 50-60Hz\",\"Battery\":\"12 V, 2.3 AH (Lead-acid battery)\"}', 'Used in OPD, diagnostic centers, emergency wards, first-aid and rescue ambulatory care intended for spot checking, non-invasive monitoring or recording of vital body parameters.', '', '', '', 'Vital Sign Monitor KPM-A200', 'Patient Monitoring System | Vital Sign Monitor KPM-A200', 'KPM-A200', 'KPM-A200 is a battery operated vital sign monitor suitable for adult pediatric and neonate. Equipped with 4 hour capacity removable and rechargeable battery. Custom configuration includes SpO2, NIBP, ECG, TEMP and built-in printer option.', '', '', 'Vital Sign Monitor KPM-A200', 'Vital Sign Monitor KPM-A200', '', '{\"small\":\"assets\\/images\\/products\\/Vital-Sign-Monitor-KPM-A200-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Vital-Sign-Monitor-KPM-A200-250x250.jpg\"}', '', 'Critical-Care/Patient-Monitoring-System/Vital-Sign-Monitor/KPM-A200', 1, '2019-07-25 07:54:32', 1, '2019-07-25 02:24:32'),
(288, 'KRE-A100', 'Resuscitator KRE-A100', 1, 'A1', 0, 110, 'Resuscitator KRE-A100 is an auto-clavable, hand held, emergency device intended for pulmonary resuscitation. Inbuilt pressure relief valve minimizes the risk of over pressure. Transparent bag for complete internal visibility. Made of durable, firm and flexible material. Substantial range of reservoir volume.  Easily detachable for cleaning and disinfecting.', '', '', '100% Latex free</br>\nTextured grip (non-slip)</br>\nAutoclavable repeatedly at 134 °C</br>\nAvailable with mask, patient valve, intake valve, resuscitation bag</br>\nAvailable in adult</br>\n2000 ml bag reservoir volume', '', '', '', '{\"Type\":\"Adult\",\"Stroke volume\":\"800 ml\",\"Resuscitator volume\":\"1630 ml\",\"Bag reservoir volume\":\"2000 ml\",\"Pressure\":\"60 cmH<sub>2<\\/sub>O\",\"Patient weight\":\"\\u2265 33 kg\",\"Dead space (patient valve)\":\"7 ml\",\"Dimensions (L \\u00d7 D)\":\"325 \\u00d7 132 mm\"}', 'Used in emergency medical services, crash carts and critical care to provide positive pressure to inflate the lungs of an unconscious person who is not breathing, in order to keep them oxygenated.', '', '', '', 'Resuscitator KRE-A100', 'Critical Care | Resuscitator KRE-A100', 'KRE-A100', 'Resuscitator KRE-A100 is an auto-clavable, hand held, emergency device intended for pulmonary resuscitation. Inbuilt pressure relief valve minimizes the risk of over pressure. Transparent bag for complete internal visibility. Made of durable, firm and flexible material. Substantial range of reservoir volume.  Easily detachable for cleaning and disinfecting.', '', '', 'Resuscitator KRE-A100', 'Resuscitator KRE-A100', '', '{\"small\":\"assets\\/images\\/products\\/Resuscitator-KRE-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Resuscitator-KRE-A100-250x250.jpg\"}', '', 'Critical-Care/Resuscitator/KRE-A100', 1, '2019-07-25 07:55:25', 1, '2019-07-25 02:25:25'),
