(291, 'KSP-A200', 'Syringe pump KSP–A200', 1, 'A2', 0, 100, 'Syringe pump KSP–A200 is a single-channel light–weight, infusion system designed for low volume infusion. Programmed infusion modes, administer drug volume at specified rate as per patient dosage. Dose titration allows uninterrupted flow during change of flow rate. Real-time pressure sensing with anti-bolus and purge feature assures safe operation.', '', '', 'Syringe barrel, alignment and volume detection </br>\nBuilt-in drug database library </br>\nVertically stackable to save storage space </br>\nExtensive system memory for review </br>\nNurse call, RS232, USB connectivity </br>\nWi-Fi connectivity (optional) </br>\nComprehensive alarms and reminder with selectable volume control', '', '', '', '{\"Channel\":\"Single channel infusion\",\"Volume  (VTBI)\":\"0 ml \\u2013  9999 ml\",\"Injection Compliance\":\"Adaptable for 6 syringe sizes\",\"Accuracy\":\"\\u2264 \\u00b12 %\",\"KVO Rate\":\"0.01 ml\\/h \\u2013  5 ml\\/h (steps : 0.01 ml\\/h)\",\"Occlusion System\":\"12 selectable occlusion levels\",\"Syringe Size\":\"5 ml, 10 ml, 20 ml, 30 ml, 50 ml, 60 ml\",\"Infusion Mode\":\"Rate mode\\/Time mode, Body weight, TIVA, Relay mode <\\/br> Loading-dose, Ramp up\\/down, Sequence, Drug library mode, Micro mode\",\"Flow Selection\":\"0.01 ml\\/h ~ 1500 ml\\/h, increment 0.01 ml\\/h\",\"Bolus Rate\":\"0.1 ml\\/h ~ 1500 ml\\/h (Auto or Manual bolus control)\",\"Display\":\"4.3-inch colour LCD screen\",\"Battery\":\"Lithium polymer battery 11.1 V 2600 mAh <\\/br> About 12 hours of operation at 5ml\\/h (< 5 hours of charging)\",\"Memory\":\"Records over 5000 entries for review\",\"Drug library\":\"Database of up to 2000 drugs\",\"Safety\":\"Class I Type CF\",\"Moisture Protection\":\"IP24\",\"Operation\":\"Ambient Temperature: 5 \\u00b0C to 40 \\u00b0C <\\/br> Relative Humidity: 20 % to 90 %\",\"Storage\":\"Ambient Temperature: \\u201330 \\u00b0C to 55 \\u00b0C <\\/br>   Relative Humidity: \\u2264 95%\",\"Power Supply\":\"AC : 110 V ~ 240 V, 50\\/60 Hz <\\/br> DC : 12 V\",\"Dimensions\":\"235 \\u00d7 90 \\u00d7 120 mm\",\"Weight\":\"1.7 kgs\"}', 'Used in general ward, ICU in hospital to gradually administer intra-venous fluid drug dosage at a predetermined rate through syringe for consistent and effective infusion therapy.', '', '', '', 'Syringe pump KSP–A200', 'Critical Care | Syringe pump KSP–A200', 'KSP-A200', 'Syringe pump KSP–A200 is a single-channel light–weight, infusion system designed for low volume infusion. Programmed infusion modes, administer drug volume at specified rate as per patient dosage. Dose titration allows uninterrupted flow during change of flow rate. Real-time pressure sensing with anti-bolus and purge feature assures safe operation.', '', '', 'Syringe pump KSP–A200', 'Syringe pump KSP–A200', '', '{\"small\":\"assets\\/images\\/products\\/Syringe-pump-KSPA200-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Syringe-pump-KSPA200-250x250.jpg\"}', '', 'Critical-Care/Syringe-Pump/KSP-A200', 1, '2019-07-25 07:57:32', 1, '2019-07-25 02:27:33'),
