(295, 'KDF-A100', 'Deep Freezer KDF-A100', 1, 'A1', 0, 94, 'Deep Freezer KDF-A100 offers a high storage capacity with thermostat-based refrigeration. System features large data storage, auto-defrost and functional alarms. Galvanized steel exterior with stainless steel interior improve toughness and durability. High density polyurethane insulation with magnetic seal rings promotes impermeability.', '', '', 'CFC-free eco-friendly cooling </br>\n Rapid cooling technology </br>\nDouble-glazed insulation with magnetic gasket </br>\nAutomatic charging for power back up </br>\nAlarm:  Temperature limits, open door, low voltage and power off conditions </br>\nUser-friendly digital control panel </br>\nThermal printer (optional)', '', '', '', '{\"Available Options\":\"<table class=\\\"tableizer-table\\\">\\n<thead><tr class=\\\"tableizer-firstrow\\\"><th>I<\\/th><th>II<\\/th><th>III<\\/th><\\/tr>\\n<\\/tbody><\\/table>\",\"Storage Capacity\":\"<table class=\\\"tableizer-table\\\">\\n<thead><tr class=\\\"tableizer-firstrow\\\"><td>150 L<\\/td><td>350 L<\\/td><td>600 L<\\/td><\\/tr>\\n<\\/tbody><\\/table>\",\"Net Volume\":\"<table class=\\\"tableizer-table\\\">\\n<thead><tr class=\\\"tableizer-firstrow\\\"><td>200 L<\\/td><td>360 L<\\/td><td>620 L<\\/td><\\/tr>\\n<\\/tbody><\\/table>\",\"Internal Dimensions\":\"<table class=\\\"tableizer-table\\\">\\n<thead><tr class=\\\"tableizer-firstrow\\\"><td>450 x 450 x 1000 mm<\\/td><td>540 x 565 x 1190 mm<\\/td><td>620 x 650 x 1550 mm<\\/td><\\/tr>\\n<\\/tbody><\\/table>\",\"External Dimensions\":\"<table class=\\\"tableizer-table\\\">\\n<thead><tr class=\\\"tableizer-firstrow\\\"><td>655 x 595 x 1420 mm<\\/td><td>655 x 595 x 1990 mm <\\/td><td>800 x 745 x 1990 mm<\\/td><\\/tr>\\n<\\/tbody><\\/table>\",\"Temperature Range\":\"-5\\u00b0C to 30\\u00b0C\",\"Refrigeration\":\"Forced cooling\",\"Refrigerant\":\"R404A\",\"Data Storage\":\"Up to 30 days\",\"Connectivity\":\"USB port\",\"Power Supply\":\"195  V - 230 V \\/ 50 Hz\",\"Temperatur