(296, 'KOO-A100', 'Otoscope KOO-A100', 1, 'A1', 0, 31, 'Otoscope KOO-A100 is an optical handheld monocular illumination device for visual examination of ear-canal. Scratch-resistant high quality optical glass lens ensures clarity for detailed examination of anatomical structures. High intensity cool LED illumination bulb provides higher luminance with aperture selection promoting precise optical guidance.', '', '', 'Focussed and homogeneous luminosity </br> \nPrecise magnification scope </br> \nScratch resistant glass lenses  </br> \nWashable & Re-usable Ear Tips  </br> \nDurable and comfortable handle', '', '', '', '{\"Light source\":\"LED bulb\",\"Luminance\":\"About 18.5 lumen\",\"Lens\":\"Glass lens with 3 X  magnification\",\"Ear Specula sizes\":\"2.4 mm <\\/br> 3 mm <\\/br> 4 mm <\\/br> 5 mm\",\"Patient groups\":\"Infant to Adults\",\"Batteries\":\"Replaceable cells\"}', 'Used in ENT, OPDs, examination clinics, audiology during rounds as well as for home-care use in pneumatic examination and magnification for detailed inspection of the in-ear anatomical structures and easy recognition during routine check-ups.', '', '', '', 'Otoscope KOO-A100', 'Medical Diagnostic | Otoscope KOO-A100', 'KOO-A100', 'Otoscope KOO-A100 is an optical handheld monocular illumination device for visual examination of ear-canal. Scratch-resistant high quality optical glass lens ensures clarity for detailed examination of anatomical structures. High intensity cool LED illumination bulb provides higher luminance with aperture selection promoting precise optical guidance.', '', '', 'Otoscope KOO-A100', 'Otoscope KOO-A100', '', '{\"small\":\"assets\\/images\\/products\\/Otoscope-KOO-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Otoscope-KOO-A100-250x250.jpg\"}', '', 'Medical-Diagnostic/Diagnostic-ENT/KOO-A100', 1, '2019-07-25 08:18:43', 1, '2019-07-25 02:48:43'),
