(302, 'KPI-A100', 'Platelet Incubator KPI-A100', 1, 'A1', 0, 18, 'Platelet Incubator KPI-A100 is a  continuous side-to-side motion agitation incubator which operates at a temperature range of 4°C to 37°C with 1 agitation chamber. Equipped with stainless steel wire shelf system to enable easy sliding and mounting. System features precise temperature control, large data storage, real-time temperature trends and alarming for temperature limits, open door, low voltage and power off conditions. Galvanized steel exterior with chrome-nickel interior improves toughness and durability.', '', '', 'Micro-processor based temperature control </br>\n1 Integrated agitator </br>\nDouble-glazed insulation with magnetic gasket </br>\nCFC-free eco-friendly cooling </br>\nAutomatic charging for power back up </br>\nInterior chamber illumination </br>\nUser-friendly digital control panel  </br>\nAuto-cut off (Fan and Agitator) at open door detection </br>\n Thermal printer (optional)', '', '', '', '{\"Temperature Range\":\"(Set point - 22\\u00b0C) 22\\u00b0C to 24\\u00b0C\",\"Capacity\":\"1 agitator (5 shelves)\",\"Internal dimensions\":\"572 x 495 x 495 mm\",\"Stroke speed\":\"60 strokes\\/min\",\"Construction\":\"Galvanized steel\",\"Interiors\":\"Chrome-Nickel plating with LED lighting\",\"Sensitivity\":\"0.1\\u00b0C\",\"Data storage\":\"Stores data up to 30 days\",\"Connectivity\":\"USB port\",\"Power supply\":\"195  V - 230 V \\/ 50 Hz\",\"External dimensions\":\"695 x 600 x 895 mm\",\"Mobility\":\"4 castor wheels\",\"Weight\":\"95 Kg\"}', 'Used in diagnostic laboratories, hospital blood banks, blood transfusion centers, clinical pathology laboratories for storage of cell platelets with continuous suspension at room temperature to maintain consistent oxygenation, their in vitro quality, in vivo effectiveness and preservation stability.', '', '', '', 'Platelet Incubator KPI-A100', 'In-Vitro Diagnostic | Platelet Incubator KPI-A100', 'KPI-A100', 'Platelet Incubator KPI-A100 is a  con