(319, 'KPA-A100', 'Platelet Agitator KPA-A100', 1, 'A1', 0, 17, 'Platelet Agitator KPA-A100 is an open continuous side-to-side motion agitation system with a low to moderate storage capacity to hold up to 30 apheresis bags. Equipped with stainless steel wire shelf system to enable easy sliding, mounting and dismounting. Specialized motor assembly allows shelf platform to produce smooth strokes reducing squeaks and noise. Pull-out type perforated shelves and uniform non-slip slot design dissipates heat and regulates airflow evenly to maintain RTP conditions.', '', '', 'Sturdy stainless steel interior </br>\nDesign promotes gas permeability </br>\nStacked 5 shelf platforms </br>\nContinuous airflow ventilation', '', '', '', '{\"Storage capacity\":\"30  apheresis bags\",\"Shelf platforms\":\"5 shelves\",\"Construction\":\"Stainless steel\",\"Stroke speed\":\"60 strokes\\/min\",\"Mobility\":\"castor wheels\",\"Dimension\":\"480 x 400 x 350 mm\",\"Weight\":\"16 Kgs\"}', 'Used in diagnostic laboratories, hospital blood banks, blood transfusion centers, clinical pathology laboratories for storage of cell platelets with suspension at room temperature to maintain continuous oxygenation, their in vitro quality, in vivo effectiveness.', '', '', '', 'Platelet Agitator KPA-A100', 'In-Vitro Diagnostic | Platelet Agitator KPA-A100', 'KPA-A100', 'Platelet Agitator KPA-A100 is an open continuous side-to-side motion agitation system with a low to moderate storage capacity to hold up to 30 apheresis bags. Equipped with stainless steel wire shelf system to enable easy sliding, mounting and dismounting. Specialized motor assembly allows shelf platform to produce smooth strokes reducing squeaks and noise. Pull-out type perforated shelves and uniform non-slip slot design dissipates heat and regulates airflow evenly to maintain RTP conditions.', '', '', 'Platelet Agitator KPA-A100', 'Platelet Agitator KPA-A100', '', '{\"small\":\"assets\\/images\\/products\\/Platelet-Agitator-KPA-A100-150x