(328, 'KCX-A100', 'Mobile C-Arm X-ray KCX-A100', 1, 'A1', 0, 41, 'Mobile C-Arm X-ray KCX-A100 is a compact multi-configurational x-ray imaging surgical modality. System incorporates advanced 9” image intensifier with multiple imaging tools for advanced and optimized workflow. Extended orbital rotation with dual focus larger field of view improves image quality. Pre-defined positional configurations assist greater coverage on areas typically considered out of reach.', '', '', '10-inch high resolution screen </br>\nDigital beam-forming technology </br>\nPseudo-colour imaging </br>\nSharp high definition imaging  </br>\nReal-time depth adjustability </br>\nAdjustable focus control and positioning', '', '', '', '{\"X-Ray Generator\":\"Frequency 40 kHz <\\/br>\\nPower Capacity 3.5 kW\",\"Tube Current\":\"X-ray : 20 mA - 63 mA <\\/br>\\nFluoroscopy :  8 mA\",\"Tube Voltage\":\"40 kV  ~  110 kV\",\"Exposure Factor\":\"1 ~ 125 mAs\",\"X-ray Tube Configuration\":\"Stationary anode with dual focus\",\"Video Monitoring System\":\"Monitor : 14\\\" High definition CRT with  \\u00b1135\\u00b0 \\nrotation <\\/br> Vidicon Tube : 0.47 MP Ultra Low-Illumination CCD\",\"Detector\":\"9\\\"  Image Intensifier with micro-groove grid\",\"X-ray Tube Thermal Capacity\":\"650 kJ\",\"Operation Interface\":\"Graphic LCD touch screen  along with portable hand-held controller\",\"Collimator\":\"Motorized multi-leaf collimator\",\"Fluoroscopy Mode : Automatic\\u00a0\":\"Tube voltage : 40 kV ~ 110 kV adjust automatically <\\/br>\\nTube current: 0.3 mA ~ 4 mA adjust automatically\",\"Fluoroscopy Mode : Manual\":\"Tube voltage 40 kV ~ 110 kV continuous <\\/br>\\nTube current: 0.3 mA~4 mA continuous\",\"Fluoroscopy Mode : Pulsed\":\"Tube voltage 40 kV ~ 110 kV continuous <\\/br>\\nTube current: 4.1 mA~8 mA continuous\",\"C-Arm Positioning Angles\":\"Forward and backward movement: 200m <\\/br>\\nRevolution around Horizontal axis: \\u00b1 180\\u00b0 <\\/br>\\nRevolution around Vertical axis: \\u00b1 15\\u00ba\\nOrbital Rotation: 120\\u00b0 (+90\\u00b0~ -30\\u00b0)\",\"Focus Control\":\"Focus screen distance: 960 mm <\\/br>\\nSmall focus: 0.6  and Large focus: 1.5\",\"Plate Holder\":\"8\\u2033 x 10\\u2033 \\/ 10\\u2033 x 12\\u2033\",\"Dimensions\":\"2440 x 1100 x 1420 mm\",\"Weight\":\"353 Kgs\"}', 'Used in OTs, cardiac OT, orthopedics, general surgery for fluoroscopy or real-time image-guided surgical navigation during implant placement, DSA, etc.', '', '', '', 'Mobile C-Arm X-ray KCX-A100', 'Surgical | Mobile C-Arm X-ray KCX-A100', 'KCX-A100', 'Mobile C-Arm X-ray KCX-A100 is a compact multi-configurational x-ray imaging surgical modality. System incorporates advanced 9” image intensifier with multiple imaging tools for advanced and optimized workflow. Extended orbital rotation with dual focus larger field of view improves image quality. Pre-defined positional configurations assist greater coverage on areas typically considered out of reach.', '', '', 'Mobile C-Arm X-ray KCX-A100', 'Mobile C-Arm X-ray KCX-A100', '', '{\"small\":\"assets\\/images\\/products\\/Mobile-C-Arm-X-ray-KCX-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Mobile-C-Arm-X-ray-KCX-A100-250x250.jpg\"}', '', 'Surgical/C-Arm-X-ray-Imaging/KCX-A100', 1, '2019-07-25 08:53:54', 1, '2019-07-25 03:23:54'),
(329, 'KOL-A500', 'LED Surgical Light KOL-A500', 1, 'A5', 0, 47, 'KOL-A500 is shadow less operating light featuring LED cold light with ultrathin optical lenses suitable for surgical procedures. Digital step less regulated LED brightness and handle adjusted to alter light field size. Wall mounted with minimum height of 3100 mm for installation. Incorporates video system for easy visualization of entire process.', '', '', 'Light source : LED<br/>\nConfigured with video system<br/> \nCross arm rotate around fixed seat<br/> \nLamp body turns around riser<br/>\nQuick acting main fuse for safety<br/>', '', '', '', '{\"Rated illumination\":\"100,000 lux \\u2053160,000 lux \\/ <br\\/> 80,000 lux \\u2053 130,000 lux\",\"Camera shooting distance\":\"80 to 200 mm\",\"Foci (F3)\":\"66 to 91.36 mm\",\"Power input\":\"140 VA\",\"Bulb power\":\"3.2 V ; 1 W\",\"Cross arm rotation\":\"360 \\u00b0\",\"Lamp body turn\":\"360 \\u00b0\",\"Color temperature\":\"3800 \\u00b1 200 K \\/ 4400 \\u00b1 200 K \\/ 5000 \\u00b1 200 K\",\"Video system specification\":\"12 V (DC) \\u00b1 10 %\",\"Lowest height of installation\":\"3100 mm\",\"Main fuse\":\"250 V\"}', 'Used in hospitals as medical exam light, operating room lights.', '', '', '', 'LED Surgical Light KOL-A500', 'OR Solutions | LED Surgical Light KOL-A500', 'KOL-A500', 'KOL-A500 is shadow less operating light featuring LED cold light with ultrathin optical lenses suitable for surgical procedures. Digital step less regulated LED brightness and handle adjusted to alter light field size. Wall mounted with minimum height of 3100 mm for installation. Incorporates video system for easy visualization of entire process.', '', '', 'LED Surgical Light KOL-A500', 'LED Surgical Light KOL-A500', '', '{\"small\":\"assets\\/images\\/products\\/LED-Surgical-Light-KOL-A500-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/LED-Surgical-Light-KOL-A500-250x250.jpg\"}', '', 'OR-Solutions/Surgical-and-Examination-Lights/KOL-A500', 1, '2019-07-25 08:55:16', 1, '2019-07-25 03:25:17'),
(330, 'KOC-A100', 'Oxygen Concentrator KOC-A100', 1, 'A1', 0, 65, 'Oxygen Concentrator KOC-A100 is a 5L continuous flow portable medical oxygen concentration unit. Equipped with intelligent oxygen delivery system and clinically advanced medical grade molecular sieve ensures ergonomic use and delivers elevated purity levels of oxygen for safe inhalation housed in a sleek and stylish design. Ideally works as plug and play but operates on battery as well to provide hours of consistent oxygen supply with minimal noise at low maintenance requirements.', '', '', 'Capacity: 5L </br>\nTouch screen control </br>\nSilent operation </br>\nHigh levels of purity </br>\nVariable pulse flow control', '', '', '', '{\"Capacity\":\"5 L\",\"Flow Range\":\"1 L\\/min \\u2013 5 L\\/min\",\"Oxygen Concentration\":\"90 % \\u2013 96 %\",\"Power Output\":\"150 W\",\"Noise\":\"\\u2264 45 dB\",\"Operational temperature\":\"10 \\u00b0C to 40 \\u00b0C\",\"Operation\":\"Continuous Flow\",\"Power supply\":\"220 V\\/110 V, 50 Hz\\/ 60 Hz\",\"Dimensions\":\"390 x 270 x 200 mm\",\"Weight\":\"7 Kgs\"}', 'Used in primary healthcare facilities, ambulatory oxygen therapy as well as for point of care treatments at prescription for administrating point of care delivery of supplemental oxygen supply to maintain targeted SpO2 levels consistently all day to patients with respiratory disorders.', '', '', '', 'Oxygen Concentrator KOC-A100', 'Respiratory Aids | Oxygen Concentrator KOC-A100', 'KOC-A100', 'Oxygen Concentrator KOC-A100 is a 5L continuous flow portable medical oxygen concentration unit. Equipped with intelligent oxygen delivery system and clinically advanced medical grade molecular sieve ensures ergonomic use and delivers elevated purity levels of oxygen for safe inhalation housed in a sleek and stylish design. Ideally works as plug and play but operates on battery as well to provide hours of consistent oxygen supply with minimal noise at low maintenance requirements.', '', '', 'Oxygen Concentrator KOC-A100', 'Oxygen Concentrator KOC-A100', '', '{\"small\":\"assets\\/images\\/products\\/Oxygen-Concentrator-KOC-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Oxygen-Concentrator-KOC-A100-250x250.jpg\"}', 'catalog/Oxygen-Concentrator.pdf', 'Respiratory-Aids/Oxygen-Concentrator/KOC-A100', 1, '2019-07-25 08:57:37', 1, '2019-07-25 03:27:38'),
(331, 'KOC-A101', 'Oxygen Concentrator KOC-A101', 1, 'A1', 0, 65, 'Oxygen Concentrator KOC-A101 is a 5L continuous flow portable medical oxygen concentration unit. Equipped with intelligent oxygen delivery system and clinically advanced medical grade molecular sieve with micro-particle entrapment filter ensures delivery of pure oxygen for safe inhalation as per oxygen flowrate control. Operates on battery as well as power supply to provide hours of consistent oxygen supply with minimal noise at low maintenance requirements.', '', '', 'Capacity: 5L </br>\nTouch screen control </br>\nSilent operation </br>\nHigh concentration of oxygen </br>\nVariable flow-rate settings', '', '', '', '{\"Capacity\":\"5 L\",\"Flow Range\":\"1 L\\/min \\u2013 5 L\\/min\",\"Oxygen Concentration\":\"30 % \\u2013 90 %\",\"Power Output\":\"\\u2264 200 W\",\"Noise\":\"\\u2264 60 dB\",\"Operational temperature\":\"5 \\u00b0C to 40 \\u00b0C\",\"Operation\":\"Continuous Flow\",\"Power supply\":\"220 V\\/110 V, 50 Hz\\/ 60 Hz\",\"Dimensions\":\"335 x 215 x 375 mm\",\"Weight\":\"6.5 Kgs\"}', 'Used in primary healthcare facilities, ambulatory oxygen therapy as well as for point of care treatments at prescription for administrating point of care delivery of supplemental oxygen supply to maintain targeted SpO2 levels consistently all day to patients with respiratory disorders.', '', '', '', 'Oxygen Concentrator KOC-A101', 'Respiratory Aids | Oxygen Concentrator KOC-A101', 'KOC-A101', 'Oxygen Concentrator KOC-A101 is a 5L continuous flow portable medical oxygen concentration unit. Equipped with intelligent oxygen delivery system and clinically advanced medical grade molecular sieve with micro-particle entrapment filter ensures delivery of pure oxygen for safe inhalation as per oxygen flowrate control. Operates on battery as well as power supply to provide hours of consistent oxygen supply with minimal noise at low maintenance requirements.', '', '', 'Oxygen Concentrator KOC-A101', 'Oxygen Concentrator KOC-A101', '', '{\"small\":\"assets\\/images\\/products\\/Oxygen-Concentrator-KOC-A101-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Oxygen-Concentrator-KOC-A101-250x250.jpg\"}', 'catalog/Oxygen-Concentrator.pdf', 'Respiratory-Aids/Oxygen-Concentrator/KOC-A101', 1, '2019-07-25 08:57:37', 1, '2019-07-25 03:27:38'),
(332, 'KOC-A102', 'Oxygen Concentrator KOC-A102', 1, 'A1', 0, 65, 'Oxygen Concentrator KOC-A102 is a 1L portable medical oxygen concentration unit. Equipped with clinically advance medical grade molecular sieve and micro-particle entrapment filter to prevent atmospheric contamination and deliver clean and pure oxygen flow for safe inhalation. Precise flow-rate control settings and alarms reduce risk of oxygen toxicity. System operates on battery as well as power supply to provide hours of consistent oxygen supply with humidifier bottle.', '', '', 'Capacity: 1L </br>\nBacklit LED screen </br>\nHumidifier bottle </br>\nSilent operation </br>\nHigh concentration of oxygen </br>\nOxygen flow settings', '', '', '', '{\"Capacity\":\"1 L\",\"Flow Range\":\"1 L\\/min \\u2013 5 L\\/min\",\"Oxygen Concentration\":\"90 % \\u00b1 3 %\",\"Power Output\":\"90 W\",\"Noise\":\"\\u2264 43 dB\",\"Operational temperature\":\"10 \\u00b0C to 40 \\u00b0C\",\"Operation\":\"Continuous Flow\",\"Power supply\":\"220 V\\/110 V, 50 Hz\\/ 60 Hz\",\"Dimensions\":\"265 x 195 x 387 mm\",\"Weight\":\"5.5 Kgs\"}', 'Used in primary healthcare facilities, ambulatory oxygen therapy as well as for point of care treatments at prescription for administrating point of care delivery of supplemental oxygen supply to maintain targeted SpO2 levels consistently all day to patients with respiratory disorders.', '', '', '', 'Oxygen Concentrator KOC-A102', 'Respiratory Aids | Oxygen Concentrator KOC-A102', 'KOC-A102', 'Oxygen Concentrator KOC-A102 is a 1L portable medical oxygen concentration unit. Equipped with clinically advance medical grade molecular sieve and micro-particle entrapment filter to prevent atmospheric contamination and deliver clean and pure oxygen flow for safe inhalation. Precise flow-rate control settings and alarms reduce risk of oxygen toxicity. System operates on battery as well as power supply to provide hours of consistent oxygen supply with humidifier bottle.', '', '', 'Oxygen Concentrator KOC-A102', 'Oxygen Concentrator KOC-A102', '', '{\"small\":\"assets\\/images\\/products\\/Oxygen-Concentrator-KOC-A102-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Oxygen-Concentrator-KOC-A102-250x250.jpg\"}', 'catalog/Oxygen-Concentrator.pdf', 'Respiratory-Aids/Oxygen-Concentrator/KOC-A102', 1, '2019-07-25 08:57:38', 1, '2019-07-25 03:27:38'),
(333, 'KVI-A100', 'Vein Illuminator KVI-A100', 1, 'A1', 0, 46, 'Vein Illuminator KVI-A100 is a portable illumination unit with NIR for projection of vein image on superficial skin. It allows quick and precise vein display which is useful for infants (newborns), pediatricians and adults. Provides significant help for patients whose vein access becomes a challenge such as dark skin, hairy skin, swollen tissues, obese, old age etc.', '', '', 'Large display screen for vein viewing<br/>\nProvides real time accurate images<br/>\nAdjustable height antennae<br/>\nImproves site selection (cursor locator)<br/>\nReduces discomfort', '', '', '', '{\"Optical Technology\":\"\",\"Luminosity Range\":\"\",\"Optimal Temperature\":\"\",\"Optimal Humidity\":\"\",\"Optimal Pressure\":\"\",\"Display Mode\":\"Screen\",\"Wavelength  (Infrared)\":\"850 nm\",\"Image Resolution\":\"640 x 480 Pixel\",\"Optimal Imaging Distance\":\"210 mm \\u00b1 30 mm\",\"Power Source\":\"3000 mAh\",\"Source Voltage\":\"DC 7.4 V\",\"Dimension\":\"242 x 182 x 70 mm\",\"Weight\":\"950 gms\"}', 'Used in hospitals, clinical labs, blood donation camps, rehabilitation department, academic institutions and others for intravenous access and blood collection', '', '', '', 'Vein Illuminator KVI-A100', 'General Aids | Vein Illuminator KVI-A100', 'KVI-A100', 'Vein Illuminator KVI-A100 is a portable illumination unit with NIR for projection of vein image on superficial skin. It allows quick and precise vein display which is useful for infants (newborns), pediatricians and adults. Provides significant help for patients whose vein access becomes a challenge such as dark skin, hairy skin, swollen tissues, obese, old age etc.', '', '', 'Vein Illuminator KVI-A100', 'Vein Illuminator KVI-A100', '', '{\"small\":\"assets\\/images\\/products\\/Vein-Illuminator-KVI-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Vein-Illuminator-KVI-A100-250x250.jpg\"}', '', 'General-Aids/Vein-Illuminator/KVI-A100', 1, '2019-07-25 08:59:36', 1, '2019-07-25 03:29:36'),
(334, 'KVI-A200', 'Vein Illuminator KVI-A200', 1, 'A2', 0, 46, 'Vein Illuminator KVI-A200 is a table-top vein finder equipped with two imaging modules, selectable according to patient‘s skin tone for improved peripheral vein imaging. Medical cold light ensures safer prolonged usage. Adjustable image clarity enables detailed vascular structure. Easy to install, light and compact machine.', '', '', 'Cold light projection technology <br/>\nSelectable imaging modes (Blue-White/Red-Green) <br/> \nFine vascular accuracy and clarity <br/>\nLight and compact design <br/>\nAdjustable image clarity and brightness <br/>\nEasy positioning and operation <br/>\nBattery low and charging indicator', '', '', '', '{\"Optical Technology\":\"Infrared Projection\",\"Luminosity Range\":\"300 lux ~ 1000 lux\",\"Optimal Temperature\":\"0\\u2103 ~ 40\\u2103\",\"Optimal Humidity\":\"\\u2264 80%\",\"Optimal Pressure\":\"700 hPa ~ 1060 hPa\",\"Display Mode\":\"\",\"Wavelength  (Infrared)\":\"\",\"Image Resolution\":\"\",\"Optimal Imaging Distance\":\"\",\"Power Source\":\"\",\"Source Voltage\":\"\",\"Dimension\":\"5.5\\u201d x 3\\u201d x 2.6\\u201d\",\"Weight\":\"5 Kgs\"}', 'Used in diagnostic clinics, hospital wards, rehabilitation and blood transfusion centers to identify, assess and view patient’s vasculature for successful venipuncture in single attempt, reduce patient discomfort and prevent complications of IV therapy.', '', '', '', 'Vein Illuminator KVI-A200', 'General Aids | Vein Illuminator KVI-A200', 'KVI-A200', 'Vein Illuminator KVI-A200 is a table-top vein finder equipped with two imaging modules, selectable according to patient‘s skin tone for improved peripheral vein imaging. Medical cold light ensures safer prolonged usage. Adjustable image clarity enables detailed vascular structure. Easy to install, light and compact machine.', '', '', 'Vein Illuminator KVI-A200', 'Vein Illuminator KVI-A200', '', '{\"small\":\"assets\\/images\\/products\\/Vein-Illuminator-KVI-A200-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Vein-Illuminator-KVI-A200-250x250.jpg\"}', '', 'General-Aids/Vein-Illuminator/KVI-A200', 1, '2019-07-25 08:59:36', 1, '2019-07-25 03:29:37'),
