(336, 'KPL-A100', 'Plasma Thawer KPL-A100', 1, 'A1', 0, 20, 'Plasma Thawer KPL-A100 is a micro-processor controlled benchtop blood plasma thawing system. Stainless steel chamber with thawing basket conserves workspace providing substantial storage capacity. System enables continuous operation and optimal temperature stability for batch wise thawing. Controlled thawing cycles reduces procedure time. Built-in floating system quickly drains out unused water.', '', '', 'Stainless steel basket </br>\nBuilt-in floating system </br>\nTemperature control and agitation </br>\nSafe and leak-proof chamber </br>\nAudio-visual alarming', '', '', '', '{\"Construction\":\"Stainless steel\",\"Volume\":\"15 L (4-6 bags)\",\"Temperature range\":\"20\\u00b0C to 40\\u00b0C\",\"Power supply\":\"220 V \\/ 50 Hz\",\"Power consumption\":\"300 W\",\"Dimensions\":\"350 x 290 x 330 mm\",\"Weight\":\"11 Kgs\"}', 'Used in Blood banks and laboratories where it is required to thaw up to four units of frozen plasma or cryoprecipitated AHF for future infusion.', '', '', '', 'Plasma Thawer KPL-A100', 'In-Vitro Diagnostic | Plasma Thawer KPL-A100', 'KPL-A100', 'Plasma Thawer KPL-A100 is a micro-processor controlled benchtop blood plasma thawing system. Stainless steel chamber with thawing basket conserves workspace providing substantial storage capacity. System enables continuous operation and optimal temperature stability for batch wise thawing. Controlled thawing cycles reduces procedure time. Built-in floating system quickly drains out unused water.', '', '', 'Plasma Thawer KPL-A100', 'Plasma Thawer KPL-A100', '', '{\"small\":\"assets\\/images\\/products\\/Plasma-Thawer-KPL-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Plasma-Thawer-KPL-A100-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Plasma-Thawer/KPL-A100', 1, '2019-07-25 09:01:03', 1, '2019-07-25 03:31:03'),
(342, 'KNWS-A100', 'Knee Walker Scooter KNWS-A100', 1, 'A1', 0, 99, 'KNWS-A100 is four wheeled scooter available in various color options built with adjustable height feature for handle and knee cushion. Steady and firm whole integral steel tube welded frame.', '', '', 'Steady an firm steel tube welded frame<br/>\nAdjustable handle bar and knee cushion height<br/> \nFoldable handle<br/> \nAnti-slip back wheel band type brake<br/> \nPU solid and wearable tire', '', '', '', '{\"Knee Pad Height range\":\"17.5 to 22 inch\",\"Adjustable Handle Height range\":\"31 to 41 inch\",\"Material\":\"Steel tubes coat with electroplates\",\"Max Load\":\"150 Kg\",\"Wheel Size\":\"8 inch\",\"Dimension\":\"780 \\u00d7 420 \\u00d7 775 to 1015 mm\",\"Weight\":\"10.5 Kgs\"}', 'Used in hospitals and at homes. Suitable for patient with injury at lower limb.', '', '', '', 'Knee Walker Scooter KNWS-A100', 'Mobility Aids | Knee Walker Scooter KNWS-A100', 'KNWS-A100', 'KNWS-A100 is four wheeled scooter available in various color options built with adjustable height feature for handle and knee cushion. Steady and firm whole integral steel tube welded frame.', '', '', 'Knee Walker Scooter KNWS-A100', 'Knee Walker Scooter KNWS-A100', '', '{\"small\":\"assets\\/images\\/products\\/Knee-Walker-Scooter-KNWS-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Knee-Walker-Scooter-KNWS-A100-250x250.jpg\"}', '', 'Mobility-Aids/Mobility-Scooter/KNWS-A100', 1, '2019-07-25 09:20:55', 1, '2019-07-25 03:50:56'),
(343, 'KOT-A200', 'Hydraulic Operating table KOT-A200', 1, 'A2', 0, 105, 'Operating Table KOT-A200 features high density sponge in one piece with no seam, mattress is wrapped with artificial leather. Controlled by hydraulic pneumatic systems to provide accurate positioning during major surgeries. Base of table is fixed and table can be rotated 360 degree. Carbon plastic plate on table surface allow easy X-ray examination.', '', '', 'Operating mode : Hydraulic system <br/>\nAdjustable height, Trendelenburg and lateral tilt <br/>\nHigh quality stainless steel rails on bed sides <br/>\nAlloy aluminum fabricated table support <br/>\nBase seat and upright column covering of stainless steel', '', '', '', '{\"Length\":\"2000 \\u00b1 50 mm\",\"Width\":\"500 \\u00b1 20 mm\",\"Horizontal rotary\":\"360 \\u00b0\",\"Adjustable height (Min to Max)\":\"(740 to 1000) \\u00b1 50 mm\",\"Loading capacity\":\"\",\"Trendelenburg\":\"20 \\u00b0\",\"Reverse Trendelenburg\":\"20 \\u00b0\",\"Lateral tilt\":\"25 \\u00b0\",\"Head section folds upward\":\"30 \\u00b0\",\"Head section folds downward\":\"90 \\u00b0\",\"Leg of the board split\":\"\",\"Leg section folds downward\":\"90 \\u00b0\",\"Leg section folds upward\":\"\",\"Leg section folds outward\":\"180 \\u00b0\",\"Waist board lifting\":\"\",\"Back section upward\":\"\",\"Back section downward\":\"\",\"Horizontal and longitudinal movement\":\"\",\"Kidney section elevation\":\"\",\"Lumbar upper corner\":\"200 \\u00b0\",\"Lumbar lower corner\":\"120 \\u00b0\",\"Power supply\":\"\",\"Power\":\"\"}', 'Used in hospitals, operating room to carry out surgeries on patients.', '', '', '', 'Hydraulic Operating table KOT-A200', 'OR Solutions | Hydraulic Operating table KOT-A200', 'KOT-A200', 'Operating Table KOT-A200 features high density sponge in one piece with no seam, mattress is wrapped with artificial leather. Controlled by hydraulic pneumatic systems to provide accurate positioning during major surgeries. Base of table is fixed and table ca