(354, 'KCD-A200', 'Portable Color Doppler KCD-A200', 1, 'A2', 0, 24, 'Portable Color Doppler system KCD-A200 is a continuous wave doppler equipped with color LCD screen for real-time triplex display offering a wide range of imaging modes. Excellent system performance combined with automatic optimized image enhancements. Advanced report management system supports versatile image formats and offers superior storage capacity. Supports various connectivity options for data transmission.', '', '', '12-inch color LCD display screen </br>\nDigital beam emission technology </br>\nPortable and easy user interface </br>\nAccurate and quick measurement  </br>\nMedical grade report management system </br>\nVarious modes of data transmission  </br>\nFusion THI for clear tissue harmonic imaging </br>\nAdvanced image processing technology', '', '', '', '{\"Display Size\":\"12\\u201d Color LCD Triplex display\",\"Display Modes\":\"B\\/BB\\/B\\/M\\/CD\\/PWD\\/CWD\\/DIR PWR\\/PWR\",\"Imaging Technology\":\"3D\\/4D  Imaging\",\"Image Format\":\"AVI, JPG, TIF, BMP, SEQ, DICOM 3.0\",\"Beam Formation\":\"DAS Technology\",\"Report Generation\":\"Automatic\",\"TGC\":\"8 segment (3 segment simultaneous adjustments)\",\"Connectivity\":\"USB 2.0 RS-232, XGA, DICOM 3.0, PAL-D, DVD-R\\/W\",\"Interface\":\"Alphanumeric keyboard, switch-control, Backlit-navigation knob\",\"Dimensions\":\"460 x 380 x 570 mm\",\"Weight\":\"17 kgs\"}', 'Used in diagnostic centers, hospital and nursing homes for cardiac, vascular, obstetric and urological imaging to perform primary interventional tests or morphological examinations.', '', '<table class=\"tableizer-table\">\n<thead><tr class=\"tableizer-firstrow\"><th>Sr</th><th>Standard Accessories</th><th>Qty</th></tr></thead><tbody>\n <tr><td>1</td><td>Transducer : Convex 5C2A(2.0-5.0 MHz)</td><td>1</td></tr>\n <tr><td>2</td><td>Transducer : Linear 12L5A (5.0-12MHZ)</td><td>1</td></tr>\n</tbody></table>', '<table class=\"tableizer-table\">\n<thead><tr class=\"tableizer-firstrow\"><th>Sr</th><th>Optional Accessories</th><th>Qty</th></tr></thead><tbody>\n <tr><td>1</td><td>Transducer : Transvaginal 8EC4(4.0-8.0 MHz)</td><td>1</td></tr>\n <tr><td>2</td><td>Transducer : Phased array 4V2S(2.0-4.0 MHz)</td><td>1</td></tr>\n <tr><td>3</td><td>Transducer : 6V2W Volume 4D probe</td><td>1</td></tr>\n <tr><td>4</td><td>Medical Video Printer</td><td>1</td></tr>\n <tr><td>5</td><td>Biopsy Bracket </td><td>1</td></tr>\n</tbody></table>', 'Portable Color Doppler KCD-A200', 'Medical Diagnostic | Portable Color Doppler KCD-A200', 'KCD-A200', 'Portable Color Doppler system KCD-A200 is a continuous wave doppler equipped with color LCD screen for real-time triplex display offering a wide range of imaging modes. Excellent system performance combined with automatic optimized image enhancements. Advanced report management system supports versatile image formats and offers superior storage capacity. Supports various connectivity options for data transmission.', '', '', 'Portable Color Doppler KCD-A200', 'Portable Color Doppler KCD-A200', '', '{\"small\":\"assets\\/images\\/products\\/Portable-Color-Doppler-KCD-A200-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Portable-Color-Doppler-KCD-A200-250x250.jpg\"}', '', 'Medical-Diagnostic/Medical-Ultrasound/KCD-A200', 1, '2019-07-25 10:04:26', 1, '2019-07-25 04:34:26'),
(355, 'KPS-A100', 'Cassette printer KPS-A100', 1, 'A1', 0, 51, 'KPS-A100 is a thermal transfer digital printing unit with a 450 input cassettes capacity and print direction of 0°, 90°, 180° and 270°. Prints standard characters, logos, common barcode formats, pictures and QR code with 400 dpi print resolution. Built in Windows XP operating system ensures data processing and network interface. Print medium capacity is about 3000 pcs/ink cartridge enhancing laboratory efficiency.', '', '', 'Printing speed ≥ 800 cassette per hour<br/>\nDigital printing method - Ribbon thermal transfer<br/>\nMultiple output (print standard characters, logos, common barcode formats, pictures and QR code)<br/>\n3 Input source  ( keyboard + mouse, bar code scanner, network data support) <br/>\nOutput mode -  First In First out (fast unloading)<br/>\nNoise emission  ≥ 45 dB (lowest)', '', '', '', '{\"Speed\":\"\\u2265 800 cassettes per hour\",\"Method\":\"Ribbon thermal transfer mode\",\"Print Resolution\":\"400 dpi\",\"Print medium type\":\"35 mm wide thermal transfer ribbon\",\"Print medium capacity\":\"About 3000 pcs\\/ink cartridge\",\"Direction (Writing angle)\":\"0\\u00b0, 90\\u00b0, 180\\u00b0, 270\\u00b0\",\"Input capacity\":\"Six magazines with 75 cassette capacity \\n(450 cassettes in total )\",\"Output capacity\":\"Unlimited\",\"Output channel execution way\":\"First In First Out\",\"Operating system\":\"WINDOWS XP system\",\"Operation interface\":\"8 inch full-color high definition touch screen\",\"Network interface\":\"Can support\",\"Information input\":\"keyboard + mouse, Bar code scanner, Network data support\",\"Print area\":\"cassettes request no deformation, no burr\",\"Working temperature\":\"5 \\u2103 to 35 \\u2103\",\"Relative humidity\":\"45 %  to 85 %\",\"Noise of the machine\":\"\\u2265 45 dB\",\"Data processing\":\"\",\"Barcode scanning\":\"\",\"Preview feature\":\"\",\"Communication and connection\":\"LAN, RS232, USB\",\"Power supply voltage\":\"AC 220 V ; 50 Hz\",\"Size of Slide\":\"\",\"Size of cassette\":\"L:41 mm - 43 mm ,W:28 mm - 28.5 mm, D:6 mm - 7 mm\",\"Size\":\"540 mm x 380 mm x 450 mm\",\"Weight\":\"\"}', 'Used in histology, pathology, cytology, clinical lab, biomedical lab, research institutes, and Immunhistochemistry (IHC)', '', '', '', 'Cassette printer KPS-A100', 'General Aids | Cassette printer KPS-A100', 'KPS-A100', 'KPS-A100 is a thermal transfer digital printing unit with a 450 input cassettes capacity and print direction of 0°, 90°, 180° and 270°. Prints standard characters, logos, common barcode formats, pictures and QR code with 400 dpi print resolution. Built in Windows XP operating system ensures data processing and network interface. Print medium capacity is about 3000 pcs/ink cartridge enhancing laboratory efficiency.', '', '', 'Cassette printer KPS-A100', 'Cassette printer KPS-A100', '', '{\"small\":\"assets\\/images\\/products\\/Cassette-Printer-KPS-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Cassette-Printer-KPS-A100-250x250.jpg\"}', '', 'General-Aids/Medical-Printing-System/KPS-A100', 1, '2019-07-25 10:07:55', 1, '2019-07-25 04:37:55'),
(356, 'KPS-A101', 'Slide printer KPS-A101', 1, 'A1', 0, 51, 'KPS-A101 is  a thermal transfer digital printing unit with 350 input slide capacity and  print direction of 0°, 90°, 180° and 270°.Prints standard characters, logos, common barcode formats, pictures and QR code. Equipped with Windows XP system with multilingual printing function ensures data processing and network interface. Built in barcode scanner enable to read 1-D, 2-D barcodes. Print medium capacity is about 2000 pcs/ink cartridge enhancing laboratory efficiency.', '', '', 'Printing speed  ≥ 800 slides per hour<br/>\nDigital printing method - Ribbon Thermal transfer<br/>\nMultiple outputs ( prints standard characters, logos, common barcode formats, pictures and QR code)<br/>\nBarcode scanner - ( 1-D, 2-D barcode)<br/>\nOutput mode – First In First Out (fast unloading)<br/>\nNoise emission  ≤ 45 dB (lowest)', '', '', '', '{\"Speed\":\"\\u2265 800 slides per hour\",\"Method\":\"Ribbon thermal transfer mode\",\"Print Resolution\":\"\",\"Print medium type\":\"30 mm wide thermal transfer ribbon\",\"Print medium capacity\":\"About 2000 pcs\\/ink cartridge\",\"Direction (Writing angle)\":\"0\\u00b0, 90\\u00b0, 180\\u00b0, 270\\u00b0\",\"Input capacity\":\"350\",\"Output capacity\":\"25\",\"Output channel execution way\":\"First In First Out\",\"Operating system\":\"WINDOWS XP system\",\"Operation interface\":\"8 inch full-color high definition touch screen\",\"Network interface\":\"Can support\",\"Information input\":\"\",\"Print area\":\"\",\"Working temperature\":\"5 \\u2103 to 35 \\u2103\",\"Relative humidity\":\"45 % to 85 %\",\"Noise of the machine\":\"\\u2264 45 dB\",\"Data processing\":\"Storage, query, automatic generation of form\",\"Barcode scanning\":\"One-dimensional barcode, two dimensional barcode\",\"Preview feature\":\"Yes\",\"Communication and connection\":\"LAN, RS232, USB\",\"Power supply voltage\":\"AC 220 V ; 50 Hz\",\"Size of Slide\":\"25 mm x 75 mm x 1 mm\",\"Size of cassette\":\"\",\"Size\":\"320 mm x 300 mm x 360 mm\",\"Weight\":\"12 Kgs\"}', 'Used in histology, pathology, cytology, clinical lab, research lab, biomedical lab and Immunhistochemistry (IHC)', '', '', '', 'Slide printer KPS-A101', 'General Aids | Slide printer KPS-A101', 'KPS-A101', 'KPS-A101 is  a thermal transfer digital printing unit with 350 input slide capacity and  print direction of 0°, 90°, 180° and 270°.Prints standard characters, logos, common barcode formats, pictures and QR code. Equipped with Windows XP system with multilingual printing function ensures data processing and network interface. Built in barcode scanner enable to read 1-D, 2-D barcodes. Print medium capacity is about 2000 pcs/ink cartridge enhancing laboratory efficiency.', '', '', 'Slide printer KPS-A101', 'Slide printer KPS-A101', '', '{\"small\":\"assets\\/images\\/products\\/Slide-Printer-KPS-A101-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Slide-Printer-KPS-A101-250x250.jpg\"}', '', 'General-Aids/Medical-Printing-System/KPS-A101', 1, '2019-07-25 10:07:55', 1, '2019-07-25 04:37:55'),
(359, 'KSL-A100', 'Safety Lancet KSL-A100', 1, 'A1', 0, 73, 'Safety Lancet KSL-A100 is a sterile, single use, pressure activated lancet that have unique design and features improving safety, comfort and ease-of-use. Available with variety of needle gauge and penetration method minimizing patient’s pain and clinical errors. Needle is fully shielded before and after use ensuring safety for both patient and user.', '', '', 'Ultra sharp tri-bevel needle reduces pain<br/>\nCap sealed needle tip ( injection moulded )<br/>\nPressure activation technique ( defined blood flow )<br/>\nPrevention of cross contamination<br/>\nPoint configuration and penetration depths suits capillary requirements<br/>\nMinimal training for new users<br/>\nGamma radiated sterilization <br/>\nComplies with standard safety guidelines', '', '', '', '{\"Gauge sizes\":\"18G <hr>\\n21G <hr>\\n23G <hr>\\n26G <hr>\\n28G <hr>\\n30G\"}', 'Used in Hospital, clinics and laboratory for blood sampling and others for diagnostic test', '', '', '', 'Safety Lancet KSL-A100', 'Medical Consumables | Safety Lancet KSL-A100', 'KSL-A100', 'Safety Lancet KSL-A100 is a sterile, single use, pressure activated lancet that have unique design and features improving safety, comfort and ease-of-use. Available with variety of needle gauge and penetration method minimizing patient’s pain and clinical errors. Needle is fully shielded before and after use ensuring safety for both patient and user.', '', '', 'Safety Lancet KSL-A100', 'Safety Lancet KSL-A100', '', '{\"small\":\"assets\\/images\\/products\\/Safety-Lancet-KSL-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Safety-Lancet-KSL-A100-250x250.jpg\"}', '', 'Medical-Consumables/Safety-Lancet/KSL-A100', 1, '2019-07-25 10:56:01', 1, '2019-07-25 05:26:01'),
(360, 'KSPM-A100', 'Spirometer KSPM-A100', 1, 'A1', 0, 48, 'KSPM-A100 is a hand held unit which can be used in two different ways (connectible to PC through USB or the unit itself as a desktop) to meet user’s requirements. It features a large TFT screen to display measured FVC, FEV and PEF values. It displays volume and flow rate charts to support diagnosis. Automated unit shut down in case of no user operation.', '', '', 'Portable ultra-thin model<br/>\nTFT screen displays clear test result<br/>\nRespondant’s current condition is displayed by red, yellow and green bar<br/>\nRepeated measurement of pre analyzed data<br/>\nProvision of memorizing data<br/>\nConnectable to PC through USB cable<br/>\nRechargeable lithium battery', '', '', '', '{\"Flow range\":\"1 L\\/s \\u2053 16 L\\/s\",\"Volume range\":\"10 L\",\"Flow accuracy\":\"\\u00b1 10 %\",\"Volume Accuracy\":\"\\u00b1 3 %\",\"Trend\":\"Flow rate \\u2013 Volume<br\\/>\\nVolume \\u2013 time\",\"Measure mode\":\"Infrared\",\"Measures\":\"FVC - Forced Vital Capacity<br\\/>\\nFEV - Forced Expired Volume in one second<br\\/> PEF - Peak expiratory flow\",\"Operating environment\":\"Temperature: +10 \\u00b0C ~ +40 \\u00b0C<br\\/>\\nRelative humidity: \\u226480 %<br\\/>\\nAtmospheric pressure: 70 kPa~106 kPa\",\"Storage environment\":\"Temperature: -40 \\u00b0C ~ +55 \\u00b0C<br\\/>\\nRelative humidity: \\u2264 95 %<br\\/>\\nAtmospheric pressure: 50 kPa~106 kPa<br\\/>\",\"Working Current\":\"60 mA\",\"Battery\":\"DC 3.7 V ; 820 mAh\",\"Dimension\":\"97 \\u00d7 89 \\u00d7 36 mm\",\"Weight\":\"150 g\"}', 'Used to check lung conditions to diagnose chronic respiratory diseases. Applicable for routine analysis in hospital, clinics.', '', '', '', 'Spirometer KSPM-A100', 'Medical Diagnostic | Spirometer KSPM-A100', 'KSPM-A100', 'KSPM-A100 is a hand held unit which can be used in two different ways (connectible to PC through USB or the unit itself as a desktop) to meet user’s requirements. It features a large TFT screen to display measured FVC, FEV and PEF values. It displays volume and flow rate charts to support diagnosis. Automated unit shut down in case of no user operation.', '', '', 'Spirometer KSPM-A100', 'Spirometer KSPM-A100', '', '{\"small\":\"assets\\/images\\/products\\/Spirometer-KSPM-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Spirometer-KSPM-A100-250x250.jpg\"}', '', 'Medical-Diagnostic/Spirometer/KSPM-A100', 1, '2019-07-25 10:57:03', 1, '2019-07-25 05:27:03');
