(361, 'KMX-A100', 'Mobile X-ray machine KMX-A100', 1, 'A1', 0, 22, 'Mobile X-ray machine KMX-A100 is an advanced x-ray imaging modality designed for easy mobility and handling during intra-hospital transport. Regulated voltage control ensures powerful and brief exposure yet stabilized x-ray output consistently. Focused and precise x-ray exposure with adjustable collimators reduces scatter enhancing image quality and contrast. Tube head cantilever allows easy source orientation suitable for different patient positions.', '', '', 'Standard frequency X-ray generator  </br>  \nHigh imaging quality  </br>\nStabilized and short time exposure  </br>\nFocused x-ray output </br>\nEasy and fast positioning  </br>\nSimplistic operational console', '', '', '', '{\"Focal Distance\":\"430 \\u00d7 430 mm\",\"Source Head Range\":\"550 mm - 1820 mm\",\"Exposure DC Voltage\":\"\",\"Exposure DC Current\":\"\",\"Exposure Time\":\"0.08 s - 6.32 s\",\"Tube Focus\":\"2.6 x 2.6 mm\",\"Collimator Film (max)\":\"1000 mm\",\"Spot-film Tube Current\":\"\",\"Power Rating\":\"5 kVA\",\"Column Angular Range\":\"\",\"Internal Resistance\":\"\\u22641 \\u03a9\",\"Current\":\"Max. 15 A\",\"Spot Focus\":\"\",\"Power Supply\":\"Voltage : 180 V - 240 V Frequency : 50Hz\\u00a0\",\"Dimensions\":\"1350 \\u00d7 750 \\u00d7 1500 mm\",\"Weight\":\"135 Kgs\"}', 'Used throughout the hospital from in-patient, to NICU, operating room, and emergency room as well as polyclinics to perform projection radiography readily on bedbound or critical patients for convenience.', '', '', '', 'Mobile X-ray machine KMX-A100', 'Medical Diagnostic | Mobile X-ray machine KMX-A100', 'KMX-A100', 'Mobile X-ray machine KMX-A100 is an advanced x-ray imaging modality designed for easy mobility and handling during intra-hospital transport. Regulated voltage control ensures powerful and brief exposure yet stabilized x-ray output consistently. Focused and precise x-ray exposure with adjustable collimators reduces scatter enhancing image quality and contrast. Tube head cantilever allows easy source orientation suitable for different patient positions.', '', '', 'Mobile X-ray machine KMX-A100', 'Mobile X-ray machine KMX-A100', '', '{\"small\":\"assets\\/images\\/products\\/Mobile-X-ray-machine-KMX-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Mobile-X-ray-machine-KMX-A100-250x250.jpg\"}', '', 'Medical-Diagnostic/Medical-X-ray-Imaging/KMX-A100', 1, '2019-07-25 11:01:42', 1, '2019-07-25 05:31:43'),
(362, 'KMX-A101', 'Mobile X-ray machine KMX-A101', 1, 'A1', 0, 22, 'Mobile X-ray machine KMX-A101 is an advanced X-ray imaging modality designed to be highly efficient and portable medical imaging solution for intra-departmental transport. Equipped with single focus full wave rectification for stable and precise-controlled operation. Accurate X-ray beam focusing results in dose-efficient X-ray and enhances image quality. Equipped with high voltage protection circuit for user as well as patient.', '', '', 'Standard frequency X-ray generator  </br>  \nHigh quality imaging </br>\nSCM control  technology </br>\n8 Pre-defined exposure control </br>\nHigh voltage SCR safety circuit </br>\nCantilever head source structure', '', '', '', '{\"Focal Distance\":\"\\u00a0350 x 350 mm\",\"Source Head Range\":\"520 mm - 1880 mm\",\"Exposure DC Voltage\":\"100 kV ; 50 kV - 100 kV\",\"Exposure DC Current\":\"35 A (instant)\",\"Exposure Time\":\"0.08 s - 6.32\\u00a0s\",\"Tube Focus\":\"4.3 x 4.3 mm\",\"Collimator Film (max)\":\"650 mm\",\"Spot-film Tube Current\":\"150 mA (fixed)\",\"Power Rating\":\"\",\"Column Angular Range\":\"\\u00b145\\u00b0\",\"Internal Resistance\":\"\",\"Current\":\"\",\"Spot Focus\":\"16 mA, 32mA, 63mA, 100mA\",\"Power Supply\":\"Voltage : 180 V - 240 V Frequency : 50 Hz\",\"Dimensions\":\"1500  x 800 x 1500 mm\",\"Weight\":\"150 Kgs\\u00a0\"}', 'Used throughout the hospital from in-patient, to NICU, operating room, and emergency room as well as polyclinics to perform projection radiography readily on bedbound or critical patients for convenience.', '', '', '', 'Mobile X-ray machine KMX-A101', 'Medical Diagnostic | Mobile X-ray machine KMX-A101', 'KMX-A101', 'Mobile X-ray machine KMX-A101 is an advanced X-ray imaging modality designed to be highly efficient and portable medical imaging solution for intra-departmental transport. Equipped with single focus full wave rectification for stable and precise-controlled operation. Accurate X-ray beam focusing results in dose-efficient X-ray and enhances image quality. Equipped with high voltage protection circuit for user as well as patient.', '', '', 'Mobile X-ray machine KMX-A101', 'Mobile X-ray machine KMX-A101', '', '{\"small\":\"assets\\/images\\/products\\/Mobile-X-ray-machine-KMX-A101-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Mobile-X-ray-machine-KMX-A101-250x250.jpg\"}', '', 'Medical-Diagnostic/Medical-X-ray-Imaging/KMX-A101', 1, '2019-07-25 11:01:42', 1, '2019-07-25 05:31:43'),
(363, 'KSX-A100', 'Stationary X-Ray Machine KSX-A100', 1, 'A1', 0, 22, 'Stationary X-Ray Machine KSX-A100 series is a traditional X-ray imaging modality equipped with single focus X-ray source and full wave rectification high-voltage generator for reliable performance. The high voltage X-ray generator has an independent configuration for electrical isolation subsequently increasing safety and stability. X-ray tube incorporates space charge compensator and pressure regulator to ensure the sharp images and low X-ray dosage on every output.', '', '', 'Standard Frequency X-Ray Generator </br>\n7 kVA Generator Capacity </br>\nVibrating Ray-Filter Radiographic Flatbed </br>\nHigh Quality Imaging </br>\nAccurate Timer Controlled Exposure  </br>\nSuitable for Radiography as well as Fluoroscopy  </br>\nStep Less Adjustability of Controls', '', '', '', '{\"Exposure Voltage\":\"50 kV ~ 90 kV\",\"Exposure Current\":\"Small focus: 25 mA  <\\/br> Big focus:  (50, 75, 100 and 125) mA\",\"Max. Output Voltage\":\"90 kV\",\"Max. Output Current\":\"100 mA\",\"Exposure Time\":\"0.04 s ~ 6.3 s, 23 grades\",\"Supply Voltage\":\"Single Phase ;  380 V\\/220 V\",\"Supply Frequency\":\"50 Hz\",\"Power Capacity\":\"10 kVA\",\"Inner Resistance\":\"380 V: 2\\u00b0 <\\/br> 220 V: 0.6\\u00b0\",\"Glide Up\\/Down\":\"720 mm \\u2013 1800 mm\",\"HV Generator\":\"7 kVA\",\"X-Ray Focus\":\"Big: 4.3 mm <\\/br> Small: 1.8 mm\",\"Bed Dimensions\":\"1960 \\u00d7 660 \\u00d7 700 mm\",\"Cassette Size\":\"356 \\u00d7 432 mm or (14\\\" \\u00d717\\\")\",\"Dimensions\":\"\",\"Weight\":\"\"}', 'Used in hospital radiology departments, orthopedic and diagnostic imaging centers to perform projection radiography.', '', '', '', 'Stationary X-Ray Machine KSX-A100', 'Medical Diagnostic | Stationary X-Ray Machine KSX-A100', 'KSX-A100', 'Stationary X-Ray Machine KSX-A100 series is a traditional X-ray imaging modality equipped with single focus X-ray source and full wave rectification high-voltage generator for reliable pe