(366, 'KSM-A100', 'Electric Suction Machine KSM-A100', 1, 'A1', 0, 49, 'Electric Suction Machine KSM-A100 is a light-weight, portable phlegm suction unit. Incorporated oil-free suction pump with analog vacuum gauge housed in a crevice-free plastic exterior ensures precise infection-control, fast suction build up and improves flux-rate for efficient suction performance. Advanced overflow-protection design of graduated suction bottle prevents leakage of aspirated fluids.', '', '', 'Oil-free suction mechanism </br>\nAdvanced overflow-protection design </br>\nCompact design </br>\nSuitable for emergency use', '', '', '', '{\"Vacuum Pressure\":\"( Negative ) 0.075 MPa\",\"Reservoir Capacity\":\"1000 ml (1 Jar)\",\"Pumping Rate\":\"15 L\\/min\",\"Continuous Operation\":\"Up to 30 min\",\"Input Power\":\"90 VA\",\"Noise\":\"\\u2264 65 dB\",\"Power Supply\":\"220 V\\u00b110% , 50 Hz\\u00b12%\",\"Dimensions\":\"350 x 260 x 290 mm\",\"Weight\":\"5 Kgs\"}', 'Used in hospital wards, surgical rooms as well as at home by medical professionals or patients for performing aspirations or suction of congestive secretions for respiratory home-care.', '', '', '', 'Electric Suction Machine KSM-A100', 'General Aids | Electric Suction Machine KSM-A100', 'KSM-A100', 'Electric Suction Machine KSM-A100 is a light-weight, portable phlegm suction unit. Incorporated oil-free suction pump with analog vacuum gauge housed in a crevice-free plastic exterior ensures precise infection-control, fast suction build up and improves flux-rate for efficient suction performance. Advanced overflow-protection design of graduated suction bottle prevents leakage of aspirated fluids.', '', '', 'Electric Suction Machine KSM-A100', 'Electric Suction Machine KSM-A100', '', '{\"small\":\"assets\\/images\\/products\\/Electric-Suction-Machine-KSM-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Electric-Suction-Machine-KSM-A100-250x250.jpg\"}', '', 'General-Aids/Suction-Machine/KSM-A100', 1, '2019-07-25 11: