(379, 'KTV-A100', 'Transport Ventilator KTV-A100', 1, 'A1', 0, 39, 'Transport Ventilator KTV-A100 is a high-end portable transport ventilation system equipped with mobile stand, oxygen cylinder and inbuilt clamps to be fastened for secured and easy transportation. Extensive ventilation assistance with real-time trends, lung mechanics ensures high-end performance to achieve best delivered care.', '', '', 'Turbine-driven ventilation technology </br>\nCombined mode : VCV + SIGH </br>\nCPAP based backup ventilation </br>\nDurable and high-impact housing', '', '', '', '{\"Tidal Volume\":\"0  ml \\u2013 1500  ml\",\"Gas Supply\":\"O<sub>2<\\/sub>, 0.28 to 0.6 MPa\",\"Ventilation Modes\":\"A\\/C, SIMV, SPONT, Manual, VCV+SIGH\",\"Respiratory Rate\":\"4  bpm \\u2013 40 bpm (SIMV) <\\/br>\\n4  bpm \\u2013 99 bpm (A\\/C)\",\"Range Of I:E Ratio\":\"2:1 to 1: 4\",\"FiO<sub>2<\\/sub> Range\":\"48% to 100%\",\"Pressure Sensitivity\":\"Above PEEP: - 2 kPa to 0 kPa  <\\/br>\\nPEEP: 0.5 kPa to 2  kPa\",\"Pressure Parameter\":\"P<sub>peak<\\/sub>\",\"Volume\\/Flow  Parameter\":\"Vt , MV\",\"Time Parameter\":\"F<sub>total<\\/sub>\",\"Real-Time Curves\":\"Pressure-Time\",\"Compliance\":\"< 4 ml\\/100 Pa\",\"Cylinder Capacity\":\"3.2 L\",\"Max. Pressure\":\"< 6 kPa\",\"Battery Life\":\"4 Hours of Uninterrupted Battery life\",\"Environmental Temperature\":\"Operation: -10\\u00b0C to 50\\u00b0C <\\/br>\\nStorage: -20\\u00b0C to 55\\u00b0C\",\"Relative Humidity\":\"Operation: < 85 % <\\/br>\\nStorage: < 93 %\",\"Atmospheric Pressure\":\"Operation: 70 kPa \\u2013 110 kPa <\\/br>\\nStorage: 50  kPa \\u2013 110 kPa\",\"Power Supply\":\"110 V  - 220 V, 50\\/60Hz , < 65 VA\",\"Dimensions\":\"175 x 170 x 300 mm\",\"Weight\":\"3.5 Kgs\"}', 'Used in ambulances or outdoor patient transfer, ideal for acute-care airway ventilation for inter-hospital, intra-hospital, or prehospital emergency transport etc.', '', '', '', 'Transport Ventilator KTV-A100', 'Critical Care | Transport Ventilator KTV-A100', 