(385, 'KUS-A101', 'Ultrasound System with Trolley KUS-A101', 1, 'A1', 0, 24, 'Ultrasound System with Trolley KUS-A101 is a cart-based B/W digital ultrasound imaging system equipped with 15” LCD screen, 10 pseudo-colour imaging functions and core features such as digital beam-forming, ultrasonic frame-forming, real-time dynamic aperture control, advanced frequency scan, dynamic focusing for efficient measuring and spot-analysis of the body area under study.', '', '', 'Pseudo-colour imaging </br>\nTissue Harmonic Imaging </br> \nAdjustable puncture guide </br>\nSuitable for General, Obstetric, Cardiac, Urology and Orthopedics </br> \n Automated report formation based on diagnostic description </br> Comprehensive patient data management system', '', '', '', '{\"Display size\":\"15-inch LCD screen\",\"Display depth\":\"250 mm\",\"Display view\":\"\\u2265 152\\u00b0\",\"Ultrasound modes\":\"B, B+B, B+M, M, 4B\",\"TGC\":\"Total gain, 8 segment TGC\",\"Depth adjustability\":\"16 level of real-time depth adjustments\",\"Probe scan methods\":\"Convex, Linear, Micro-convex\",\"Pseudo-colour imaging\":\"\\u2265 10 pseudo-colors\",\"Cine-loop\":\"\\u2265 600 frames\",\"Frame storage\":\"\\u2265 1000 permanent storage frames, supports Disk Storage\",\"Image formats\":\"BMP, JPG, DCM, TIF\",\"Hard disk\":\"\\u2265 80 G\",\"Body marks\":\"95 types\",\"Zoom\":\"16-level zoom, \\u2265 5 times local zoom\",\"Output interface\":\"Video, RS-232,  XGA, USB 2.0, DICOM 3.0, PS\\/3\",\"Dimensions\":\"580 x 720 x 1320 mm\",\"Weight\":\"64 Kg\"}', 'Used in examination rooms, consultation clinics, primary healthcare centers and rescue ambulance or outdoor examinations for point of care ultrasonography imaging for symptomatic examination and diagnosis at patient’s bedside.', '', '<table class=\"tableizer-table\">\n<thead><tr class=\"tableizer-firstrow\"><th>Sr.</th><th>Standard Accessories</th><th>Qty</th></tr></thead><tbody>\n <tr><td>1</td><td>3.5 MHz Convex Probe</td><td>1</td></tr>\n <tr><