(386, 'KUBT-A100', 'Urea Breath Analyser KUBT-A100', 1, 'A1', 0, 25, '<sup>13</sup>C Urea Breath Analyser KUBT-A100 is a 10 channel non-invasive bacterial breath test analyser based on IRMS technology. System is designed for near-patient testing at short test duration with reliable diagnosis. Advanced IR-spectrometer ensures accurate test results compliant with standard quality criteria. Integrated control system ensures high repeatability and efficient clinical workflow.', '', '', 'IRMS Technology <br>\nSafe and Non-invasive Method <br>\nHigh Sensitivity and Specificity <br>\nComfortable and Painless Diagnosis <br>\nSuitable for Pregnant/Lactating Women and Children <br>\n13C Urea Breath Test Kit (optional)', '', '', '', '{\"No. of Channels\":\"10\",\"No. of Sample Analysis\":\"5\",\"Specificity\":\"1\",\"Sensitivity\":\"0.95\",\"Range of CO<sub>2<\\/sub> Concentration\":\"0.5 % \\u2500 6 %\",\"Measurement Time\":\"< 3 mins \\/ test\",\"Sample Volume\":\"\\u2265 120 ml\",\"Power Consumption\":\"< 50 W\",\"Power Supply\":\"110 V \\u2500 220 V (50 Hz)\",\"Dimensions\":\"330 x 450 x 245 mm\",\"Weight\":\"15 Kgs\"}', 'Used in diagnostic clinic, hospital wards and pediatric clinic to detect infection of the stomach by the bacterium Helicobacter pylori, the primary causative agent in most gastric disorders. Suitable for primary diagnosis and to confirm eradication post-treatment.', '', '', '', 'Urea Breath Analyser KUBT-A100', 'Medical Diagnostic | Urea Breath Analyser KUBT-A100', 'KUBT-A100', '<sup>13</sup>C Urea Breath Analyser KUBT-A100 is a 10 channel non-invasive bacterial breath test analyser based on IRMS technology. System is designed for near-patient testing at short test duration with reliable diagnosis. Advanced IR-spectrometer ensures accurate test results compliant with standard quality criteria. Integrated control system ensures high repeatability and efficient clinical workflow.', '', '', 'Urea Breath Analyser KUBT-A100', 'Urea Breath Analyser KUBT-A100', '', '{\"small\":\"assets\\/images\\/products\\/Urea-Breath-Analyser-KUBT-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Urea-Breath-Analyser-KUBT-A100-250x250.jpg\"}', 'catalog/Urea-Breath-Analyser.pdf', 'Medical-Diagnostic/Urea-Breath-Test-Analyser/KUBT-A100', 1, '2019-07-25 14:07:10', 1, '2019-07-25 08:37:11'),
(387, 'KUA-A100', 'Urine analyzer KUA-A100', 1, 'A1', 0, 92, 'Urine analyzer KUA-A100 is a high-precision handheld strip-based urine test equipment. Microprocessor based reader, monitors test and ensures repeatability. Docking system provides a print-out of the quantitative measurements. Built-in program controls development time for test strip before analysis. One touch data transfer and review streamlines data management.', '', '', 'Automated and large data storage </br>\nMicro USB interface </br>\nBluetooth connectivity (optional) </br>\nCompliant with all urinalysis strips', '', '', '', '{\"Method\":\"RGB Tricolor test\",\"Test mode\":\"Single-step test\",\"Strip compliance\":\"8, 10, 11, 12, 14 parameter test strips\",\"Memory\":\"Stores up to 500 records\",\"Repeatability\":\"CV \\u2264 1%\",\"Stability\":\"CV \\u2264 1%\",\"Display\":\"2.4-inch LCD (320 x 240 resolution)\",\"Interface\":\"Micro USB interface\",\"Record mode\":\"Flash ROM data storage\",\"Power\":\"100 V \\u2013 240 V, 50 \\/ 60 Hz\",\"Power consumption\":\"\\u2264 5 W\",\"Battery\":\"Rechargeable Li-ion battery, 3.7 V, 1900 mAh\",\"Dimensions\":\"126 x 74 x 30 mm\",\"Weight\":\"200 g\"}', 'Used in small to medium sized nephrology clinics, medical camps, for long-term monitoring of nephrotic diseases, clinical inspection of urine to screen for potential conditions or diseases affecting the kidney or urinary tract.', '', '', '', 'Urine analyzer KUA-A100', 'Laboratory Analyser | Urine analyzer KUA-A100', 'KUA-A100', 'Urine analyzer KUA-A100 is a high-precision handheld strip-based urine test equipment. Microprocessor based reader, monitors test and ensures repeatability. Docking system provides a print-out of the quantitative measurements. Built-in program controls development time for test strip before analysis. One touch data transfer and review streamlines data management.', '', '', 'Urine analyzer KUA-A100', 'Urine analyzer KUA-A100', '', '{\"small\":\"assets\\/images\\/products\\/Urine-analyzer-KUA-A100-150x150.jpg\",\"medium\":\"assets\\/images\\/products\\/Urine-analyzer-KUA-A100-250x250.jpg\"}', '', 'In-Vitro-Diagnostic/Laboratory-Analyser/Urine-Analyser/KUA-A100', 1, '2019-07-25 14:09:42', 1, '2019-07-25 08:39:43');
